INSERT INTO `dialogs` VALUES ('4', '2', '2', '1', '1', '2', '- Не вижу сводного бюджета! Ты должен был сдать еще вчера!', '0', '0', 'E1', '1', '0', null, '0', '0', 'E1_1.wav', '4', '-', '', '1');
INSERT INTO `dialogs` VALUES ('5', '1', '1', '2', '2', '2', '- Раиса Романовна, ну что вы так волнуетесь?! Я уже несколько дней только бюджетом и занимаюсь, до отпуска точно успею.', '0', '0', 'E1', '1', '1', null, '0', '0', 'нет', '5', '-', '', '1');
