INSERT INTO `dialogs` VALUES ('7', '1', '1', '2', '2', '2', '- Раиса Романовна, помню про бюджет. Сейчас же приступаю к доработке.', '0', '0', 'E1', '1', '3', null, '0', '0', 'нет', '7', '-', '', '1');
INSERT INTO `dialogs` VALUES ('8', '1', '1', '2', '2', '2', '- Раиса Романовна, я всегда говорил, что сроки подготовки бюджета не реальны. Делаю все от меня зависящее.', '0', '0', 'E1', '1', '4', null, '0', '0', 'нет', '8', '-', '', '1');
INSERT INTO `dialogs` VALUES ('9', '2', '2', '1', '1', '2', '- Так, у тебя на доработку три часа. И никаких отсрочек! Чтобы через три часа файл был у меня в почте!', '0', '0', 'E1', '2', '0', null, '0', '0', 'E1_2.wav', '9', '-', '', '1');
INSERT INTO `dialogs` VALUES ('10', '1', '1', '2', '2', '2', '- Я пока не знаю, сколько времени мне потребуется. Но точно смогу проверить все цифры к вечеру.', '0', '0', 'E1', '2', '1', null, '0', '0', 'нет', '10', '-', '', '1');
INSERT INTO `dialogs` VALUES ('11', '1', '1', '2', '2', '2', '- Хорошо, за три часа управлюсь.', '0', '0', 'E1', '2', '2', '104', '0', '0', 'нет', '11', 'D1', '', '1');
INSERT INTO `dialogs` VALUES ('12', '1', '1', '2', '2', '2', '- Ну, с помощью Крутько я должен управиться в эти сроки.', '0', '0', 'E1', '2', '3', '5', '0', '0', 'нет', '12', 'E1.2', '', '1');
INSERT INTO `dialogs` VALUES ('13', '2', '2', '1', '1', '2', '- К вечеру? Ты что, шутишь? Да мы целых три недели этим бюджетом занимаемся! По регламенту он уже должен быть у Генерального директора. Может, ты сам ему объяснишь, ЧТО ИМЕННО мешает тебе работать по регламенту? Жду файл через три часа – и точка!', '0', '0', 'E1', '3', '0', null, '0', '0', 'E1_3.wav', '13', '-', '', '1');
INSERT INTO `dialogs` VALUES ('14', '1', '1', '2', '2', '2', '- Понял, открываю файл.', '0', '0', 'E1', '3', '1', '104', '0', '0', 'нет', '14', 'D1', '', '1');
INSERT INTO `dialogs` VALUES ('15', '1', '1', '2', '2', '2', '- Понял, уже зову Крутько.', '0', '0', 'E1', '3', '2', '5', '0', '0', 'нет', '15', 'E1.2', '', '1');
INSERT INTO `dialogs` VALUES ('16', '2', '1', '1', '1', '1', 'звук телефонного звонка', '5', '0', 'S1.1', '1', '0', null, '0', '0', '', '16', '-', '', '1');
INSERT INTO `dialogs` VALUES ('17', '1', '1', '2', '1', '1', 'ответить', '0', '0', 'S1.1', '1', '1', '2', '0', '0', '', '17', 'E1', '', '1');
INSERT INTO `dialogs` VALUES ('18', '1', '1', '2', '1', '1', 'не ответить', '0', '0', 'S1.1', '1', '2', '4', '0', '0', '', '18', 'S1.2', '', '1');
INSERT INTO `dialogs` VALUES ('19', '2', '2', '1', '1', '4', '- Мне что, учить тебя элементарным правилам делового общения? Ты почему на мои звонки не отвечаешь? Я тебе все утро трезвоню!', '10', '0', 'S1.2', '1', '0', null, '0', '0', 'S1_2_1_Камера.webm', '19', '-', '', '1');
INSERT INTO `dialogs` VALUES ('20', '1', '1', '2', '2', '4', '- Раиса Романовна, извините, но у меня на телефоне номер почему-то не определяется.', '0', '0', 'S1.2', '1', '1', null, '0', '0', 'S1_2_1_Камера.png', '20', '-', '', '1');
INSERT INTO `dialogs` VALUES ('21', '1', '1', '2', '2', '4', '- Ох, Раиса Романовна, у меня сегодня вообще день не задался: с утра проколол колесо, а дальше так завертелся… Ну все, принимаюсь за работу…', '0', '0', 'S1.2', '1', '2', null, '0', '0', '', '21', '-', '', '1');
INSERT INTO `dialogs` VALUES ('22', '1', '1', '2', '2', '4', '- Раиса Романовна, я же не знал, что это вы звоните! Я просто не хотел, чтобы меня отвлекали.', '0', '0', 'S1.2', '1', '3', null, '0', '0', '', '22', '-', '', '1');
INSERT INTO `dialogs` VALUES ('23', '1', '1', '2', '2', '4', '- Раиса Романовна, кофе хотите?', '0', '0', 'S1.2', '1', '4', null, '0', '0', '', '23', '-', '', '1');
INSERT INTO `dialogs` VALUES ('24', '2', '2', '1', '1', '4', '- А зачем ты мне это говоришь? Рассчитываешь на мое понимание?!Да ты уже на два дня бюджет задержал! Какое уж тут понимание! Чтобы через два часа бюджет был у меня! И ни секундой позже! Ты что, хочешь, чтобы я по твоей милости работы лишилась?! Учти, тебя я уволить все равно успею!', '0', '0', 'S1.2', '2', '0', null, '0', '0', 'S1_2_2_f_Камера.webm', '24', '-', '', '1');
INSERT INTO `dialogs` VALUES ('25', '1', '1', '2', '2', '4', '- А я и сам мечтаю уволиться! Вот только отпуск отгуляю… Да не волнуйтесь вы так, сдам я ваш бюджет.', '0', '0', 'S1.2', '2', '1', '104', '0', '0', 'S1_2_2_f_Камера.png', '25', 'D1', '', '1');
INSERT INTO `dialogs` VALUES ('26', '1', '1', '2', '2', '4', '- Не беспокойтесь, Раиса Романовна, бюджет будет у вас через два часа.', '0', '0', 'S1.2', '2', '2', '104', '0', '0', '', '26', 'D1', '', '1');
INSERT INTO `dialogs` VALUES ('27', '1', '1', '2', '2', '4', '- А в чем я, собственно говоря, виноват? Что работаю и не отвлекаюсь на звонки?', '0', '0', 'S1.2', '2', '3', null, '0', '0', '', '27', '-', '', '1');
INSERT INTO `dialogs` VALUES ('28', '2', '2', '1', '1', '4', '- В чем виноват? Да ты вообще что-нибудь соображаешь? Задержал бюджет – это раз, у нас запарка, а ты на работу опаздываешь – это два, а три - игнорируешь звонки от руководства! Для увольнения и этого хватит, или мне продолжить?', '0', '0', 'S1.2', '3', '0', null, '0', '0', 'S1_2_3e_Камера.webm', '28', '-', '', '1');
INSERT INTO `dialogs` VALUES ('29', '1', '1', '2', '2', '4', '- А я вам бюджет сегодня сдам и буду чист перед КЗОТом.', '0', '0', 'S1.2', '3', '1', '104', '0', '0', 'S1_2_3e_Камера.png', '29', 'D1', '', '1');
INSERT INTO `dialogs` VALUES ('30', '1', '1', '2', '2', '4', '- Хорошо, понял, что не прав, приступаю к бюджету.', '0', '0', 'S1.2', '3', '2', '104', '0', '0', '', '30', 'D1', '', '1');
INSERT INTO `dialogs` VALUES ('31', '1', '1', '4', '1', '4', '- Марина, есть срочная работа.', '0', '0', 'E1.2', '1', '1', null, '0', '0', 'E1_2_2_Камера.png', '31', '-', '', '1');
INSERT INTO `dialogs` VALUES ('32', '1', '1', '4', '1', '4', '- Марина, бросай все свои дела. У нас два часа на то, чтобы изменить ситуацию.', '0', '0', 'E1.2', '1', '2', null, '0', '0', '', '32', '-', '', '1');
INSERT INTO `dialogs` VALUES ('33', '1', '1', '4', '1', '4', '- Марина, мне срочно необходима твоя помощь.', '0', '0', 'E1.2', '1', '3', null, '0', '0', '', '33', '-', '', '1');
INSERT INTO `dialogs` VALUES ('34', '4', '1', '1', '1', '4', '- Но у меня же еще полно работы по презентации Босса! Я не могу, никак не могу. Я вообще тогда ничего не успею.', '0', '0', 'E1.2', '2', '0', null, '0', '0', 'E1_2_2_Камера.webm', '34', '-', '', '1');
INSERT INTO `dialogs` VALUES ('35', '1', '1', '4', '1', '4', '- Закончила? Теперь слушай сюда. Если мы не сдадим бюджет Денежной через два часа, она нас обоих уволит. Пересылаю тебе файл, приступай немедленно.', '0', '0', 'E1.2', '2', '1', '105', '0', '0', 'E1_2_2_Камера.png', '35', 'MS21', 'F3', '1');
INSERT INTO `dialogs` VALUES ('36', '1', '1', '4', '1', '4', '- Ну ладно, придется делать самому. Ты иди, иди, время не ждет.', '0', '0', 'E1.2', '2', '2', '104', '0', '0', '', '36', 'D1', '', '1');
INSERT INTO `dialogs` VALUES ('37', '1', '1', '4', '1', '4', '- А мне что делать? А ты не можешь пока отложить презентацию? Через пару часиков снова ею займешься.', '0', '0', 'E1.2', '2', '3', null, '0', '0', '', '37', '-', '', '1');
INSERT INTO `dialogs` VALUES ('38', '4', '1', '1', '1', '4', '- Вы что, не помните как в прошлом году Босс кричал? Да если мы малейшую ошибку допустим, неприятностей будет намного больше! Он ведь, прежде всего, с Вас спросит, если я не успею.', '0', '0', 'E1.2', '3', '0', null, '0', '0', 'E1_2_3_b_Камера.webm', '38', '-', '', '1');
INSERT INTO `dialogs` VALUES ('39', '1', '1', '4', '1', '4', '- Пусть спрашивает. Пересылаю файл по бюджету, давай-ка, приступай. Если будут вопросы, заходи.', '0', '0', 'E1.2', '3', '1', '105', '0', '0', 'E1_2_3_b_Камера.png', '39', 'MS21', 'F3', '1');
INSERT INTO `dialogs` VALUES ('40', '1', '1', '4', '1', '4', '- Да уж, ситуация... Значит так, быстренько зови сюда Трутнева, попробую его подключить.', '0', '0', 'E1.2', '3', '2', '6', '0', '0', '', '40', 'E1.3', '', '1');
INSERT INTO `dialogs` VALUES ('41', '1', '1', '4', '1', '4', '- Ты же у нас такая талантливая и умная! Вон, сколько раз выручала! Давай напряжемся, тогда и то, и другое сделать успеем.', '0', '0', 'E1.2', '3', '3', null, '0', '0', '', '41', '-', '', '1');
INSERT INTO `dialogs` VALUES ('42', '4', '1', '1', '1', '4', '- Не успеем. Я не могу работать кое-как. И не могу выполнять сразу две задачи.', '0', '0', 'E1.2', '4', '0', null, '0', '0', 'E1_2_4_b_Камера.webm', '42', '-', '', '1');
INSERT INTO `dialogs` VALUES ('43', '1', '1', '4', '1', '4', '- Ладно. Зови Трутнева. Будем с ним бюджетировать.', '0', '0', 'E1.2', '4', '1', '6', '0', '0', 'E1_2_4_b_Камера.png', '43', 'E1.3', '', '1');
INSERT INTO `dialogs` VALUES ('44', '1', '1', '4', '1', '4', '- Выходит, придется все делать самому… Ладно. Спасибо. Иди.', '0', '0', 'E1.2', '4', '2', '104', '0', '0', '', '44', 'D1', '', '1');
INSERT INTO `dialogs` VALUES ('45', '1', '1', '4', '1', '4', '- А ты будешь выполнять только одну задачу – бюджет. И ни о чем больше не думай. Я сейчас перешлю файл. Приступай сразу же.', '0', '0', 'E1.2', '4', '3', '105', '0', '0', '', '45', 'MS21', 'F3', '1');
INSERT INTO `dialogs` VALUES ('46', '1', '1', '3', '3', '4', '- Сергей, привет! Ты не мог бы мне помочь? У меня тут полный аврал. Крутько занята, только на тебя надежда. Будем делать бюджет, сводный.', '0', '0', 'E1.3', '1', '1', null, '0', '0', 'E1_3_2_a_Камера.png', '46', '-', '', '1');
INSERT INTO `dialogs` VALUES ('47', '1', '1', '3', '3', '4', '- Сергей, нужно сделать бюджет. Срочно. Тебе придется этим заняться.', '0', '0', 'E1.3', '1', '2', null, '0', '0', '', '47', '-', '', '1');
INSERT INTO `dialogs` VALUES ('48', '1', '1', '3', '3', '4', '- Привет, Сергей! Я подумал, что неплохо бы тебе научиться работать над бюджетом. Для тебя это будет новой ступенью.', '0', '0', 'E1.3', '1', '3', null, '0', '0', '', '48', '-', '', '1');
INSERT INTO `dialogs` VALUES ('49', '3', '1', '1', '1', '4', '- Да я всегда готов помочь и что-нибудь новенькое... Но бюджет , это что-то не мое. То есть… Я же никогда бюджет не делал. Понятия не имею, как там все пишется, и правила какие-то есть… Посчитать я могу, конечно …А остальное, я не знаю я, не уверен…', '0', '0', 'E1.3', '2', '0', null, '0', '0', 'E1_3_2_a_Камера.webm', '49', '-', '', '1');
INSERT INTO `dialogs` VALUES ('50', '1', '1', '3', '3', '4', '- Я тебе сейчас перешлю файл, ты посмотри, и сразу приходи, если будут вопросы, разберемся.', '0', '0', 'E1.3', '2', '1', '106', '0', '0', 'E1_3_2_a_Камера.png', '50', 'MS22', 'F4', '1');
INSERT INTO `dialogs` VALUES ('51', '1', '1', '3', '3', '4', '- Тебе же все равно рано или поздно придется этим заниматься. Если ты не подключишься, мне придется делать самому, а у меня столько дел перед отпуском!', '0', '0', 'E1.3', '2', '2', null, '0', '0', '', '51', '-', '', '1');
INSERT INTO `dialogs` VALUES ('52', '1', '1', '3', '3', '4', '- В чем именно ты не уверен?', '0', '0', 'E1.3', '2', '3', null, '0', '0', '', '52', '-', '', '1');
INSERT INTO `dialogs` VALUES ('53', '3', '1', '1', '1', '4', '- Не, ну, бюджет… Я не уверен в бюджете… То есть, я в себе не уверен, в смысле бюджета. Можно мне выйти покурить?', '0', '0', 'E1.3', '3', '0', null, '0', '0', 'E1_3_3_a_Камера.webm', '53', '-', '', '1');
INSERT INTO `dialogs` VALUES ('54', '1', '1', '3', '3', '4', '- Я знаю, что ты справишься. Я тебе помогу, отвечу на все вопросы.', '0', '0', 'E1.3', '3', '1', null, '0', '0', 'E1_3_3_a_Камера.png', '54', '-', '', '1');
INSERT INTO `dialogs` VALUES ('55', '1', '1', '3', '3', '4', '- Я уже сказал, что дело срочное и что ты мне нужен. Иди и начинай работать.', '0', '0', 'E1.3', '3', '2', null, '0', '0', '', '55', '-', '', '1');
INSERT INTO `dialogs` VALUES ('56', '1', '1', '3', '3', '4', '- Да ты совсем расклеился! Не бойся! Справимся!', '0', '0', 'E1.3', '3', '3', null, '0', '0', '', '56', '-', '', '1');
INSERT INTO `dialogs` VALUES ('57', '3', '1', '1', '1', '4', '- Но я же никогда этого не делал! Можно посмотреть, конечно … А вообще … Сказка такая есть – пойди туда, не знаю куда, принеси то… В общем, не помню, как там дальше. Вот и я у вас за Иванушку, только не дурачок… Понятия не имею, как делается бюджет. Куда идти, зачем?', '0', '0', 'E1.3', '4', '0', null, '0', '0', 'E1_3_4_a_Камера.webm', '57', '-', '', '1');
INSERT INTO `dialogs` VALUES ('58', '1', '1', '3', '3', '4', '- Однако тебе все-таки придется выполнить это задание. Пересылаю тебе файл. Смотри внимательно и не тяни с вопросами. На все про все у тебя два часа.', '0', '0', 'E1.3', '4', '1', '106', '0', '0', 'E1_3_4_a_Камера.png', '58', 'MS22', 'F4', '1');
INSERT INTO `dialogs` VALUES ('59', '1', '1', '3', '3', '4', '- Ладно. Я понял. Сделаю сам. Спасибо. Можешь идти.', '0', '0', 'E1.3', '4', '2', '104', '0', '0', '', '59', 'D1', '', '1');
INSERT INTO `dialogs` VALUES ('60', '3', '1', '1', '1', '1', 'звук телефонного звонка', '0', '0', 'ET1.3.1', '1', '0', null, '0', '0', '', '60', '-', '', '1');
INSERT INTO `dialogs` VALUES ('61', '1', '1', '3', '1', '1', 'Ответить', '0', '0', 'ET1.3.1', '1', '1', '8', '0', '0', '', '61', 'E1.3.1', '', '1');
INSERT INTO `dialogs` VALUES ('62', '1', '1', '3', '1', '1', 'Не ответить', '0', '0', 'ET1.3.1', '1', '2', '218', '0', '0', '', '62', 'S1.3.1', '', '1');
INSERT INTO `dialogs` VALUES ('63', '3', '1', '1', '1', '1', 'звук телефонного звонка', '5', '0', 'S1.3.1', '1', '0', null, '0', '0', '', '801', '-', '', '1');
INSERT INTO `dialogs` VALUES ('64', '1', '1', '3', '1', '1', 'Ответить', '0', '0', 'S1.3.1', '1', '1', '8', '0', '0', '', '802', 'E1.3.1', '', '1');
INSERT INTO `dialogs` VALUES ('65', '1', '1', '3', '1', '1', 'Не ответить', '0', '0', 'S1.3.1', '1', '2', '107', '0', '0', '', '803', 'T', '', '1');
INSERT INTO `dialogs` VALUES ('66', '3', '1', '1', '1', '2', '- Господи, да ведь там в вашем бюджете данных не хватает…Логисты ничего не прислали. Это все, что у вас есть?', '0', '0', 'E1.3.1', '1', '0', null, '0', '0', 'E1.3.1_1.wav', '63', '-', '', '1');
INSERT INTO `dialogs` VALUES ('67', '1', '1', '3', '1', '2', '- Да, я тебе все переслал. Так в чем проблема, говори толком.', '0', '0', 'E1.3.1', '1', '1', null, '0', '0', 'нет', '64', '-', '', '1');
INSERT INTO `dialogs` VALUES ('68', '1', '1', '3', '1', '2', '- Успокойся. Если чего-то не хватает - добудем.', '0', '0', 'E1.3.1', '1', '2', null, '0', '0', 'нет', '65', '-', '', '1');
INSERT INTO `dialogs` VALUES ('69', '1', '1', '3', '1', '2', '- Так, а при чем тут я? Вот и обращайся в отдел логистики.', '0', '0', 'E1.3.1', '1', '3', null, '0', '0', 'нет', '66', '-', '', '1');
INSERT INTO `dialogs` VALUES ('70', '3', '1', '1', '1', '2', '- Да если я даже поселюсь у логистов в кабинете, на меня все равно никто внимания не обратит. Знаете, какие у них порядки? Встречу за неделю надо согласовывать. Ну все, я отказываюсь делать этот бюджет. Вот. Нереальные сроки.', '0', '0', 'E1.3.1', '2', '0', null, '0', '0', 'E1.3.1_2.wav', '67', '-', '', '1');
INSERT INTO `dialogs` VALUES ('71', '1', '1', '3', '1', '2', '- Берусь – отказываюсь, здесь что, детский сад? Позволь напомнить: это работа! Это важная задача.', '0', '0', 'E1.3.1', '2', '1', null, '0', '0', 'нет', '68', '-', '', '1');
INSERT INTO `dialogs` VALUES ('72', '1', '1', '3', '1', '2', '- Я понял, значит, проблема в том, что нет данных от логиста. Так?', '0', '0', 'E1.3.1', '2', '2', null, '0', '0', 'нет', '69', '-', '', '1');
INSERT INTO `dialogs` VALUES ('73', '1', '1', '3', '1', '2', '- Ну, хорошо, забудь. Занимайся своими делами. Сам разберусь.', '0', '0', 'E1.3.1', '2', '3', '104', '0', '0', 'нет', '70', 'D1', 'F13', '1');
INSERT INTO `dialogs` VALUES ('74', '3', '1', '1', '1', '2', '- Для работы мне данные нужны! А на мой запрос они месяц отвечать будут. Может, Денежную попросить, пусть она им скажет?', '0', '0', 'E1.3.1', '3', '0', null, '0', '0', 'E1.3.1_3.wav', '71', '-', '', '1');
INSERT INTO `dialogs` VALUES ('75', '1', '1', '3', '1', '2', '- Отличная мысль! Сейчас ей позвоню. Успокойся, будут у тебя данные.', '0', '0', 'E1.3.1', '3', '1', '9', '0', '0', 'нет', '72', 'E1.3.1.1', '', '1');
INSERT INTO `dialogs` VALUES ('76', '1', '1', '3', '1', '2', '- Я с ними свяжусь. Наверняка они просто забыли переслать.', '0', '0', 'E1.3.1', '3', '2', '107', '0', '0', 'нет', '73', 'T', '', '1');
INSERT INTO `dialogs` VALUES ('77', '2', '1', '1', '1', '2', '- Я вас слушаю.', '0', '0', 'E1.3.1.1', '1', '0', null, '0', '0', 'E1.3.1.1_1.wav', '74', '-', '', '1');
INSERT INTO `dialogs` VALUES ('78', '1', '1', '2', '1', '2', '- Раиса Романовна, здравствуйте! Помогите мне, пожалуйста.', '0', '0', 'E1.3.1.1', '1', '1', null, '0', '0', 'нет', '75', '-', '', '1');
INSERT INTO `dialogs` VALUES ('79', '1', '1', '2', '1', '2', '- Раиса Романовна, добрый день! Нужна ваша помощь, без этого бюджет закончить невозможно .', '0', '0', 'E1.3.1.1', '1', '2', null, '0', '0', 'нет', '76', '-', '', '1');
INSERT INTO `dialogs` VALUES ('80', '1', '1', '2', '1', '2', '- Раиса Романовна, приветствую! Вы же знаете, у меня бюджет горит, а некоторые забыли свои прямые обязанности!', '0', '0', 'E1.3.1.1', '1', '3', null, '0', '0', 'нет', '77', '-', '', '1');
INSERT INTO `dialogs` VALUES ('81', '2', '1', '1', '1', '2', '- Ты хоть что-нибудь сам выполнить в состоянии? Говори коротко и по делу, что от меня нужно?', '0', '0', 'E1.3.1.1', '2', '0', null, '0', '0', 'E1.3.1.1_2.wav', '78', '-', '', '1');
INSERT INTO `dialogs` VALUES ('82', '1', '1', '2', '1', '2', '- Я уже сделал все, что мог. И письма им писал. Никакой реакции. Логисты зажали данные по своей части бюджета.', '0', '0', 'E1.3.1.1', '2', '1', null, '0', '0', 'нет', '79', '-', '', '1');
INSERT INTO `dialogs` VALUES ('83', '1', '1', '2', '1', '2', '- У меня нет данных от логистики, а без них я ничего сделать не могу.', '0', '0', 'E1.3.1.1', '2', '2', null, '0', '0', 'нет', '80', '-', '', '1');
INSERT INTO `dialogs` VALUES ('84', '1', '1', '2', '1', '2', '- Прошу вас потребовать данные от логистики. Они уже на два дня опаздывают!', '0', '0', 'E1.3.1.1', '2', '3', null, '0', '0', 'нет', '81', '-', '', '1');
INSERT INTO `dialogs` VALUES ('85', '2', '1', '1', '1', '2', '- Что не нравится? Давай, давай, почувствуй, каково это быть в моей шкуре! А то я все кулачками размахиваю, чего-то требую! А результата никакого. Кстати, странная история: с чего это ты только сегодня спохватился? Данные от них должны были поступить два или даже три дня назад! Вот тебе очередное доказательство, что ты не способен следовать регламенту! Или это я за тебя должна сроки по отделам отслеживать? Нет уж, дорогой! Крутись сам, деньги за это ты получаешь!', '0', '0', 'E1.3.1.1', '3', '0', '107', '0', '0', 'E1.3.1.1_3.wav', '82', 'T', '', '1');
INSERT INTO `dialogs` VALUES ('86', '3', '1', '1', '1', '1', 'звук телефонного звонка', '0', '0', 'ET1.3.2', '1', '0', null, '0', '0', '', '83', '-', '', '1');
