INSERT INTO `dialogs` VALUES ('91', '1', '1', '3', '1', '1', 'Не ответить', '0', '0', 'S1.3.2', '1', '2', '107', '0', '0', '', '806', 'T', '', '1');
INSERT INTO `dialogs` VALUES ('92', '3', '1', '1', '1', '2', '- Господи, и что же мне теперь делать? Там сплошная экономика! Страницу-то я как-нибудь вставлю, но это же экономика, формулы какие-то. Там считать надо. А я не умею, не знаю, как это делается. Вот…', '0', '0', 'E1.3.2', '1', '0', null, '0', '0', 'E1.3.2_1.wav', '86', '-', '', '1');
INSERT INTO `dialogs` VALUES ('93', '1', '1', '3', '1', '2', '- Какая экономика?! Сплошная арифметика. Ты в руки-то себя возьми и спокойно взгляни на формулы. С таким и студент справится.', '0', '0', 'E1.3.2', '1', '1', null, '0', '0', 'нет', '87', '-', '', '1');
INSERT INTO `dialogs` VALUES ('94', '1', '1', '3', '1', '2', '- У меня тут методика где-то была по сводному бюджету, сейчас я тебе ее отправлю, изучишь и посчитаешь.', '0', '0', 'E1.3.2', '1', '2', '108', '0', '0', 'нет', '88', 'MS23', '', '1');
INSERT INTO `dialogs` VALUES ('95', '1', '1', '3', '1', '2', '- Ты что, не знаешь, как прибыль считается? Я тебя для чего тут держу?', '0', '0', 'E1.3.2', '1', '3', null, '0', '0', 'нет', '89', '-', '', '1');
INSERT INTO `dialogs` VALUES ('96', '3', '1', '1', '1', '2', '- Да я экономикой никогда не занимался! Все цифры, да цифры, а к чему они относятся… Прибыль какая-то. Нет, ну прибыль-то - это понятно Доходы минус расходы. Это и школьники знают. Но с остальным чего делать?', '0', '0', 'E1.3.2', '2', '0', null, '0', '0', 'E1.3.2_2.wav', '90', '-', '', '1');
INSERT INTO `dialogs` VALUES ('97', '1', '1', '3', '1', '2', '- Вот тебе и вся экономика, плюс да минус. Давай, работай. А если чего не ясно – в методику смотри, сейчас перешлю.', '0', '0', 'E1.3.2', '2', '1', '108', '0', '0', 'нет', '91', 'MS23', '', '1');
INSERT INTO `dialogs` VALUES ('98', '1', '1', '3', '1', '2', '- Да уж … Хорошо, я сам все сделаю, письмо от логистов у меня тоже есть. Занимайся своей работой.', '0', '0', 'E1.3.2', '2', '2', '104', '0', '0', 'нет', '92', 'D1', 'F13', '1');
INSERT INTO `dialogs` VALUES ('99', '3', '1', '1', '1', '2', '- Слушаю, Трутнев.', '0', '0', 'E1.3.3', '1', '0', null, '0', '0', 'E1.3.3_1.wav', '93', '-', '', '1');
INSERT INTO `dialogs` VALUES ('100', '1', '1', '3', '1', '2', '- Как твои дела?', '0', '0', 'E1.3.3', '1', '1', null, '0', '0', 'нет', '94', '-', '', '1');
INSERT INTO `dialogs` VALUES ('101', '1', '1', '3', '1', '2', '- Ну что, закончил?', '0', '0', 'E1.3.3', '1', '2', null, '0', '0', 'нет', '95', '-', '', '1');
INSERT INTO `dialogs` VALUES ('102', '3', '1', '1', '1', '2', '- Вы это о чем?', '0', '0', 'E1.3.3', '2', '0', null, '0', '0', 'E1.3.3_2.wav', '96', '-', '', '1');
INSERT INTO `dialogs` VALUES ('103', '1', '1', '3', '1', '2', '- Вообще-то я про сводный бюджет.', '0', '0', 'E1.3.3', '2', '1', null, '0', '0', 'нет', '97', '-', '', '1');
INSERT INTO `dialogs` VALUES ('104', '3', '1', '1', '1', '2', '- Сижу, читаю! Такая полезная методика. Если б я раньше ее прочел, я бы этот бюджет за полчаса сделал!', '0', '0', 'E1.3.3', '3', '0', null, '0', '0', 'E1.3.3_3.wav', '98', '-', '', '1');
INSERT INTO `dialogs` VALUES ('105', '1', '1', '3', '1', '2', '- Да, отличная методика, я сам ее и составлял. Она тебе помогла?', '0', '0', 'E1.3.3', '3', '1', null, '0', '0', 'нет', '99', '-', '', '1');
INSERT INTO `dialogs` VALUES ('106', '1', '1', '3', '1', '2', '- Прекрасно, а где бюджет-то? Ты знаешь, который сейчас час?', '0', '0', 'E1.3.3', '3', '2', null, '0', '0', 'нет', '100', '-', '', '1');
INSERT INTO `dialogs` VALUES ('107', '1', '1', '3', '1', '2', '- Когда ты закончишь и приступишь к бюджету?', '0', '0', 'E1.3.3', '3', '3', null, '0', '0', 'нет', '101', '-', '', '1');
INSERT INTO `dialogs` VALUES ('108', '3', '1', '1', '1', '2', '- Ну, не знаю… Мне, может, половина осталась. Прочесть, в смысле. Нет, я сделаю бюджет, конечно. Только попозже, к вечеру.', '0', '0', 'E1.3.3', '4', '0', null, '0', '0', 'E1.3.3_4.wav', '102', '-', '', '1');
INSERT INTO `dialogs` VALUES ('109', '1', '1', '3', '1', '2', '- Ясно, сроки мы с тобой провалили. К вечеру - это катастрофа. Буду Денежной звонить, просить отсрочку. Только сегодня обязательно сделай!', '0', '0', 'E1.3.3', '4', '1', '13', '0', '0', 'нет', '103', 'E1.3.3.1', '', '1');
INSERT INTO `dialogs` VALUES ('110', '1', '1', '3', '1', '2', '- Понятно. Сделаю все сам. Логисты, кажется, и меня в копию ставили. Может, успею.', '0', '0', 'E1.3.3', '4', '2', '104', '0', '0', 'нет', '104', 'D1', 'F13', '1');
INSERT INTO `dialogs` VALUES ('111', '2', '1', '1', '1', '2', '- Слушаю!', '0', '0', 'E1.3.3.1', '1', '0', null, '0', '0', 'E1.3.3.1_1.wav', '105', '-', '', '1');
INSERT INTO `dialogs` VALUES ('112', '1', '1', '2', '1', '2', '- Раиса Романовна, еще раз здравствуйте! Ради Бога, извините, что отвлекаю.', '0', '0', 'E1.3.3.1', '1', '1', null, '0', '0', 'нет', '106', '-', '', '1');
INSERT INTO `dialogs` VALUES ('113', '1', '1', '2', '1', '2', '- Раиса Романовна, это я опять, по делу.', '0', '0', 'E1.3.3.1', '1', '2', null, '0', '0', 'нет', '107', '-', '', '1');
INSERT INTO `dialogs` VALUES ('114', '1', '1', '2', '1', '2', '- Раиса Романовна, есть пара минут?', '0', '0', 'E1.3.3.1', '1', '3', null, '0', '0', 'нет', '108', '-', '', '1');
INSERT INTO `dialogs` VALUES ('115', '2', '1', '1', '1', '2', '- Говори, но быстро. У меня люди.', '0', '0', 'E1.3.3.1', '2', '0', null, '0', '0', 'E1.3.3.1_2.wav', '109', '-', '', '1');
INSERT INTO `dialogs` VALUES ('116', '1', '1', '2', '1', '2', '- Вы только не волнуйтесь, бюджет немного задерживается, но это вопрос всего лишь двух-трех дополнительных часов. Просто хочу все проверить, чтобы без ошибок!', '0', '0', 'E1.3.3.1', '2', '1', null, '0', '0', 'нет', '110', '-', '', '1');
INSERT INTO `dialogs` VALUES ('117', '1', '1', '2', '1', '2', '- Знаете, мне бы пару часов еще! Я бы давно уже сдал сводный бюджет, но некоторые не выполняют свою работу.', '0', '0', 'E1.3.3.1', '2', '2', null, '0', '0', 'нет', '111', '-', '', '1');
INSERT INTO `dialogs` VALUES ('118', '1', '1', '2', '1', '2', '- Бюджет задерживается, мне нужно еще два часа. Приношу извинения.', '0', '0', 'E1.3.3.1', '2', '3', null, '0', '0', 'нет', '112', '-', '', '1');
INSERT INTO `dialogs` VALUES ('119', '2', '1', '1', '1', '2', '- Бюджет?…Ах да, бюджет! Да, я жду от тебя сводный бюджет. Работай, работай. У меня тут инвесторы, не до тебя.', '0', '0', 'E1.3.3.1', '3', '0', '107', '0', '0', 'E1.3.3.1_3.wav', '113', 'T', '', '1');
INSERT INTO `dialogs` VALUES ('120', '4', '1', '1', '1', '2', '- Крутько, добрый день!', '0', '0', 'E1.2.1', '1', '0', null, '0', '0', 'E1.2.1_1.wav', '114', '-', '', '1');
INSERT INTO `dialogs` VALUES ('121', '1', '1', '4', '1', '2', '- Марина, ну как у тебя дела?', '0', '0', 'E1.2.1', '1', '1', null, '0', '0', 'нет', '115', '-', '', '1');
INSERT INTO `dialogs` VALUES ('122', '1', '1', '4', '1', '2', '- Привет, Марина, все готово?', '0', '0', 'E1.2.1', '1', '2', null, '0', '0', 'нет', '116', '-', '', '1');
