INSERT INTO `dialogs` VALUES ('126', '1', '1', '4', '1', '2', '- Отлично, и сразу же шли мне файл.', '0', '0', 'E1.2.1', '3', '1', '107', '0', '0', 'нет', '122', 'T', '', '1');
INSERT INTO `dialogs` VALUES ('127', '1', '1', '4', '1', '2', '- Хорошо, если нужна помощь – обращайся. Жду файл.', '0', '0', 'E1.2.1', '3', '2', '107', '0', '0', 'нет', '123', 'T', '', '1');
