INSERT INTO `dialogs` VALUES ('133', '1', '1', '7', '1', '1', 'не ответить', '0', '0', 'ET2.3', '1', '2', '17', '0', '0', '', '129', 'S2', '', '1');
INSERT INTO `dialogs` VALUES ('134', '2', '2', '1', '1', '4', '- У меня нет слов от возмущения! Я трачу свое драгоценное время на жалобы и вопросы только потому, что ты не научился пользоваться телефоном и графиком встреч! Возьми ручку и запиши, раз и на всегда – когда у тебя звонит служебный телефон, ты обязан на него отвечать, это часть твоей работы! Так же как и принимать пришедших посетителей! И не заставлять людей разыскивать тебя через руководителя. Я не за это деньги получаю. Ясно?', '10', '0', 'S2', '1', '0', null, '0', '0', 'S2_1_f_Камера.webm', '130', '-', '', '1');
