INSERT INTO `dialogs` VALUES ('139', '7', '1', '1', '1', '1', 'звук телефонного звонка', '0', '0', 'ET2.4', '1', '0', null, '0', '0', '', '133', '-', '', '1');
INSERT INTO `dialogs` VALUES ('140', '1', '1', '7', '1', '1', 'ответить', '0', '0', 'ET2.4', '1', '1', '19', '0', '0', '', '134', 'E2', '', '1');
INSERT INTO `dialogs` VALUES ('141', '7', '1', '1', '1', '2', '- Соединяю с Валерием Семеновичем!', '0', '0', 'E2', '1', '0', null, '0', '0', 'E2_1.wav', '135', '-', '', '1');
INSERT INTO `dialogs` VALUES ('142', '6', '1', '1', '1', '2', '- Что там у нас с презентацией! Только попробуйте не подготовиться! Не желаю из-за вас краснеть, как в прошлый раз. Готовность не ниже восьмидесяти процентов, с другой не приму. Неделя до выставки, а я еще не знаю, о чем буду говорить.', '0', '0', 'E2', '2', '0', null, '0', '0', 'E2_2.wav', '136', '-', '', '1');
INSERT INTO `dialogs` VALUES ('143', '1', '1', '6', '1', '2', '- Валерий Семенович, так в прошлый раз нам пришлось презентацию за день делать! А аналитика, который тогда напортачил, я уже уволил.', '0', '0', 'E2', '2', '1', null, '0', '0', 'нет', '137', '-', '', '1');
INSERT INTO `dialogs` VALUES ('144', '1', '1', '6', '1', '2', '- Конечно, Валерий Семенович! Буду у Вас в 16.00 с готовой презентаций.', '0', '0', 'E2', '2', '2', null, '0', '0', 'нет', '138', '-', '', '1');
INSERT INTO `dialogs` VALUES ('145', '1', '1', '6', '1', '2', '- Знаете, Валерий Семенович, на нас ведь еще и бюджет, но я все равно постараюсь и сделаю все от меня зависящее.', '0', '0', 'E2', '2', '3', null, '0', '0', 'нет', '139', '-', '', '1');
INSERT INTO `dialogs` VALUES ('146', '6', '1', '1', '1', '2', '- Займись прямо сейчас. Отвечать будешь лично. И файл пришли заранее.', '0', '0', 'E2', '3', '0', null, '0', '0', 'E2_3.wav', '140', '-', '', '1');
INSERT INTO `dialogs` VALUES ('147', '1', '1', '6', '1', '2', '- Да, прямо сейчас проконтролирую, как идет подготовка.', '0', '0', 'E2', '3', '1', '21', '0', '0', 'нет', '141', 'E2.4', '', '1');
INSERT INTO `dialogs` VALUES ('148', '1', '1', '6', '1', '2', '- Да, прямо сейчас проконтролирую, как идет подготовка.', '0', '0', 'E2', '3', '1', '20', '0', '0', 'нет', '142', 'E2.2', '', '1');
INSERT INTO `dialogs` VALUES ('149', '1', '1', '6', '1', '2', '- Да, у меня в графике уже выделено время на проверку', '0', '0', 'E2', '3', '2', '107', '0', '0', 'нет', '143', 'T', '', '1');
INSERT INTO `dialogs` VALUES ('150', '1', '1', '6', '1', '2', '- Непременно, сейчас запланирую время на проверку', '0', '0', 'E2', '3', '3', '109', '0', '0', 'нет', '144', 'P3', '', '1');
INSERT INTO `dialogs` VALUES ('151', '4', '1', '1', '1', '2', '- Крутько, добрый день!', '0', '0', 'E2.2', '1', '0', null, '0', '0', 'E2.2_1.wav', '145', '-', '', '1');
INSERT INTO `dialogs` VALUES ('152', '1', '1', '4', '1', '2', '- Марина, пожалуйста, вышли прямо сейчас все, что есть по презентации для Босса.', '0', '0', 'E2.2', '1', '1', null, '0', '0', 'нет', '146', '-', '', '1');
INSERT INTO `dialogs` VALUES ('153', '1', '1', '4', '1', '2', '- Босс звонил. Требует эту презентацию. Да еще и с максимальной готовностью. Кидай мне все, что у тебя есть. Буду смотреть.', '0', '0', 'E2.2', '1', '2', null, '0', '0', 'нет', '147', '-', '', '1');
INSERT INTO `dialogs` VALUES ('154', '1', '1', '4', '1', '2', '- Надо же такому случиться – все в один день. Выручай, дорогая, что там у тебя с презентацией Босса на выставку?', '0', '0', 'E2.2', '1', '3', null, '0', '0', 'нет', '148', '-', '', '1');
INSERT INTO `dialogs` VALUES ('155', '4', '1', '1', '1', '2', '- Да ничего у меня нет, я ведь бюджетом занимаюсь, а презентацию на вечер отложила. Есть только пара-тройка мыслей. Я даже еще информацию не собирала. Да вы ведь сами просили отложить!', '0', '0', 'E2.2', '2', '0', null, '0', '0', 'E2.2_2.wav', '149', '-', '', '1');
INSERT INTO `dialogs` VALUES ('156', '1', '1', '4', '1', '2', '- Вот это да! Ладно, отложи пока сводный бюджет и займись презентаций. С Денежной я как-нибудь вопрос улажу.', '0', '0', 'E2.2', '2', '1', '24', '0', '0', 'нет', '150', 'E2.8', '', '1');
INSERT INTO `dialogs` VALUES ('157', '1', '1', '4', '1', '2', '- Ах да. Помню. Шли, что есть вместе с твоими мыслями и прошлогодней презентацией. Буду делать сам', '0', '0', 'E2.2', '2', '2', '110', '0', '0', 'нет', '151', 'M11', '???', '1');
INSERT INTO `dialogs` VALUES ('158', '1', '1', '4', '1', '2', '- Точно, как же нам быть, оба вопроса важные и перенести нельзя. Есть идеи?', '0', '0', 'E2.2', '2', '3', null, '0', '0', 'нет', '152', '-', '', '1');
INSERT INTO `dialogs` VALUES ('159', '4', '1', '1', '1', '2', '- А вы попросите его об отсрочке. Выставка же только через неделю. За это время я могу двести презентаций сделать. Чего он дергает? Срочности никакой.', '0', '0', 'E2.2', '3', '0', null, '0', '0', 'E2.2_3.wav', '153', '-', '', '1');
INSERT INTO `dialogs` VALUES ('160', '1', '1', '4', '1', '2', '- Молодчина, Марина! И что бы я без тебя делал? Сейчас позвоню. Это уж лучше, чем идти не готовым. Ты все-таки пришли свои наброски, пожалуйста.', '0', '0', 'E2.2', '3', '1', '25', '0', '0', 'нет', '154', 'E2.9', 'M11', '1');
INSERT INTO `dialogs` VALUES ('161', '1', '1', '4', '1', '2', '- Нет, не выйдет, ты не слышала, как он говорил… Он меня точно съест. Давай-ка все, что у тебя есть, буду делать сам.', '0', '0', 'E2.2', '3', '2', '110', '0', '0', 'нет', '155', 'M11', '???', '1');
INSERT INTO `dialogs` VALUES ('162', '1', '1', '4', '1', '2', '- Берись все-таки за презентацию. А бюджет закончишь к вечеру. Думаю, уговорю Денежную. Это ведь просьба Босса, приоритет.', '0', '0', 'E2.2', '3', '3', '24', '0', '0', 'нет', '156', 'E2.8', '', '1');
INSERT INTO `dialogs` VALUES ('163', '4', '1', '1', '1', '2', '- Марина Крутько, добрый день.', '0', '0', 'E2.4', '1', '0', null, '0', '0', 'E2.4_1.wav', '157', '-', '', '1');
INSERT INTO `dialogs` VALUES ('164', '1', '1', '4', '1', '2', '- Марина, срочно пересылай мне презентацию для Генерального! Босс сам звонил и интересовался!', '0', '0', 'E2.4', '1', '1', null, '0', '0', 'нет', '158', '-', '', '1');
INSERT INTO `dialogs` VALUES ('165', '1', '1', '4', '1', '2', '- Марина, привет! Что там с презентацией для Генерального?', '0', '0', 'E2.4', '1', '2', null, '0', '0', 'нет', '159', '-', '', '1');
INSERT INTO `dialogs` VALUES ('166', '1', '1', '4', '1', '2', '- Марина, бросай все дела и срочно приводи в порядок презентацию для Босса.', '0', '0', 'E2.4', '1', '3', null, '0', '0', 'нет', '160', '-', '', '1');
INSERT INTO `dialogs` VALUES ('167', '4', '1', '1', '1', '2', '- Я над ней работаю. Пока еще мало что готово, но задача мне понятна. Постараюсь, как и обещала, закончить к 15.30.', '0', '0', 'E2.4', '2', '0', null, '0', '0', 'E2.4_2.wav', '161', '-', '', '1');
INSERT INTO `dialogs` VALUES ('168', '1', '1', '4', '1', '2', '- Отлично, одной проблемой меньше. Жду в 15.30', '0', '0', 'E2.4', '2', '1', '111', '0', '0', 'нет', '162', 'M10', 'F14', '1');
INSERT INTO `dialogs` VALUES ('169', '1', '1', '4', '1', '2', '- Это хорошо, что задача ясна. Я бы хотел через час просмотреть промежуточный вариант. Пришли, пожалуйста.', '0', '0', 'E2.4', '2', '2', '112', '0', '0', 'нет', '163', 'M9', 'F9', '1');
INSERT INTO `dialogs` VALUES ('170', '1', '1', '4', '1', '2', '- Давай мы все-таки посмотрим, что у тебя там получается с учетом требований Босса. Шли мне презентацию прямо сейчас.', '0', '0', 'E2.4', '2', '3', null, '0', '0', 'нет', '164', '-', '', '1');
INSERT INTO `dialogs` VALUES ('171', '4', '1', '1', '1', '2', '- Пересылаю. Но смысл-то какой? Это все равно как судить о торте по ингредиентам – мука, масло, яйца там всякие уже имеются, но самого-то торта пока нет!', '0', '0', 'E2.4', '3', '0', null, '0', '0', 'E2.4_3.wav', '165', '-', 'M11', '1');
INSERT INTO `dialogs` VALUES ('172', '1', '1', '4', '1', '2', '- Что такое?! Так ведь она пустая! Срочно зайди ко мне!', '0', '0', 'E2.4', '3', '1', '22', '0', '0', 'нет', '166', 'E2.7', '', '1');
INSERT INTO `dialogs` VALUES ('173', '1', '1', '4', '1', '2', '- Послушай, так здесь и смотреть нечего! И как ты собираешься уложиться в срок?', '0', '0', 'E2.4', '3', '2', '23', '0', '0', 'нет', '167', 'E2.10', '', '1');
INSERT INTO `dialogs` VALUES ('174', '1', '1', '4', '1', '2', '- Ясно, ты не успеваешь…Придется перенести встречу с Боссом на завтра. Уж точно лучше, чем краснеть у него на ковре.', '0', '0', 'E2.4', '3', '3', '25', '0', '0', 'нет', '168', 'E2.9', '', '1');
INSERT INTO `dialogs` VALUES ('175', '1', '1', '4', '4', '4', '- Хотелось бы знать, что ты собираешься делать, чтобы закончить презентацию в срок?!', '0', '0', 'E2.7', '1', '1', null, '0', '0', 'E2_7_2_b_Камера.png', '169', '-', '', '1');
INSERT INTO `dialogs` VALUES ('176', '1', '1', '4', '4', '4', '- Вот уж не ждал от тебя такого легкомыслия! Ведь это не обычный отчет! Это заказ Босса!', '0', '0', 'E2.7', '1', '2', null, '0', '0', '', '170', '-', '', '1');
INSERT INTO `dialogs` VALUES ('177', '1', '1', '4', '4', '4', '- Марина, скажи честно, ты уверена, что справишься?', '0', '0', 'E2.7', '1', '3', null, '0', '0', '', '171', '-', '', '1');
INSERT INTO `dialogs` VALUES ('178', '4', '4', '1', '1', '4', '- Если бы вы не отвлекали меня по пустякам, я бы уже половину сделала. Большое дело – презентация! Обычная работа! Данные имеются – сиди себе копируй, да графики рисуй! И какая мне разница – Босс это или бухгалтерия. Все требуют качественно и в срок!', '0', '0', 'E2.7', '2', '0', null, '0', '0', 'E2_7_2_b_Камера.webm', '172', '-', '', '1');
INSERT INTO `dialogs` VALUES ('179', '1', '1', '4', '4', '4', '- Потрясающая безответственность! Вот уж от тебя никак не ожидал!', '0', '0', 'E2.7', '2', '1', '24', '0', '0', 'E2_7_2_b_Камера.png', '173', 'E2.8', '', '1');
INSERT INTO `dialogs` VALUES ('180', '1', '1', '4', '4', '4', '- Ну, знаешь, раз у нас возник такой прецедент, впредь буду контролировать тебя на каждом шагу. Похоже, ты не можешь верно оценить статус и сложность задачи.', '0', '0', 'E2.7', '2', '2', '24', '0', '0', '', '174', 'E2.8', '', '1');
INSERT INTO `dialogs` VALUES ('181', '1', '1', '4', '4', '4', '- Ладно, раз ты уверена, что справишься – я тебе доверяю. Продолжай! Но жду, что закончишь вовремя!', '0', '0', 'E2.7', '2', '3', '111', '0', '0', '', '175', 'M10', 'F14', '1');
INSERT INTO `dialogs` VALUES ('182', '1', '1', '4', '4', '4', '- У меня нет уверенности, что ты сделаешь презентацию в срок. Я сделаю это сам. Поговорим об этой ситуации позже.', '0', '0', 'E2.7', '2', '4', '107', '0', '0', '', '176', 'T', '???', '1');
INSERT INTO `dialogs` VALUES ('183', '1', '1', '4', '4', '4', '- Пожалуй, самое время звонить Боссу и просить перенести встречу на завтра. Уверенность в себе – дело хорошее, но это не гарантия результата.', '0', '0', 'E2.7', '2', '5', '25', '0', '0', '', '177', 'E2.9', '', '1');
INSERT INTO `dialogs` VALUES ('184', '4', '4', '1', '1', '2', '- Но ведь я сказала, что успею! Обычная работа. Данные есть, перенести их в формат презентации большого труда не требуется. Только не дергайте меня! Я на этот разговор уже столько времени потратила!', '0', '0', 'E2.10', '1', '0', null, '0', '0', 'E2.10_1.wav', '178', '-', '', '1');
INSERT INTO `dialogs` VALUES ('185', '1', '1', '4', '4', '2', '- Не ожидал от тебя такого легкомыслия. Ты хоть понимаешь, для кого ты это делаешь? Да ведь это просто саботаж какой-то!', '0', '0', 'E2.10', '1', '1', '24', '0', '0', 'нет', '179', 'E2.8', '', '1');
INSERT INTO `dialogs` VALUES ('186', '1', '1', '4', '4', '2', '- Ты меня удивила, и на этот раз неприятно. Буду вынужден впредь тебя контролировать.', '0', '0', 'E2.10', '1', '2', '24', '0', '0', 'нет', '180', 'E2.8', '', '1');
INSERT INTO `dialogs` VALUES ('187', '1', '1', '4', '4', '2', '- Раз ты уверена, что задача простая и времени хватит – продолжай работать. Полагаюсь на тебя, жду презентацию вовремя.', '0', '0', 'E2.10', '1', '3', '111', '0', '0', 'нет', '181', 'M10', 'F14', '1');
INSERT INTO `dialogs` VALUES ('188', '1', '1', '4', '4', '2', '- Пожалуй, стоит перенести встречу с Боссом на завтра. С таким материалом я не пойду.', '0', '0', 'E2.10', '1', '4', '25', '0', '0', 'нет', '182', 'E2.9', '', '1');
INSERT INTO `dialogs` VALUES ('189', '1', '1', '4', '4', '2', '- У меня нет уверенности, что ты закончишь презентацию в срок. Сделаю все сам. А позже обсудим, почему так получилось.', '0', '0', 'E2.10', '1', '5', '107', '0', '0', 'нет', '183', 'T', '???', '1');
INSERT INTO `dialogs` VALUES ('190', '4', '2', '1', '1', '4', '- Все, терпение мое кончилось! Я честно старалась войти в положение, не волноваться - ну с кем не бывает, руководитель неопытный, учится. Но то, что происходит сегодня!! Я просто не могу так больше работать! Я не могу сконцентрироваться! Я что, одна работаю в этом отделе? Это просто невыносимо!', '0', '0', 'E2.8', '1', '0', null, '0', '0', 'E2_8_1_a_Камера.webm', '184', '-', '', '1');
INSERT INTO `dialogs` VALUES ('191', '1', '1', '4', '2', '4', '- Марина, что с тобой? Возьми себя в руки! Мне тоже жаль, что все сегодня так складывается, но во многом это не моя вина . Возвращайся и отправь мне все, что есть по презентации.', '0', '0', 'E2.8', '1', '1', null, '0', '0', 'E2_8_1_a_Камера.png', '185', '-', '', '1');
INSERT INTO `dialogs` VALUES ('192', '1', '1', '4', '2', '4', '- Марина, давай обо мне поговорим позже. У нас масса дел, и ко мне сейчас придут. Не время. Иди к себе и пришли мне все, что есть, по презентации.', '0', '0', 'E2.8', '1', '2', '110', '0', '0', '', '186', 'M11', '', '1');
INSERT INTO `dialogs` VALUES ('193', '1', '1', '4', '2', '4', '- Что это с тобой случилось?! Столько агрессии… А я-то считал тебя уравновешенным человеком. Жаль, что ошибся!', '0', '0', 'E2.8', '1', '3', null, '0', '0', '', '187', '-', '', '1');
INSERT INTO `dialogs` VALUES ('194', '4', '2', '1', '1', '4', '- А я уверена, что вам будет полезно меня дослушать! Во-первых, вы не умеете управлять задачами, во-вторых, вы не умеете управлять временем, что своим, что подчиненных, и, в-третьих, вы не умеете управлять людьми. Давно пора было отсюда бежать… Все, я увольняюсь!', '0', '0', 'E2.8', '2', '0', null, '0', '0', 'E2_8_2_a_Камера.webm', '188', '-', '', '1');
INSERT INTO `dialogs` VALUES ('195', '1', '1', '4', '2', '4', '- Прекрасно, сообщи в отдел персонала о своем решении, только дела доведи до конца и пришли мне файлы по презентации.', '0', '0', 'E2.8', '2', '1', '110', '0', '0', 'E2_8_2_a_Камера.png', '189', 'M11', '', '1');
INSERT INTO `dialogs` VALUES ('196', '1', '1', '4', '2', '4', '- А себя ты, кем, ангелом считаешь? Тогда уж и я скажу все, что думаю! Не надо ставить себя выше других! Ты что, считаешь себя самой умной?! Так ты нигде не уживешься! Успокойся и пришли документы.', '0', '0', 'E2.8', '2', '2', '110', '0', '0', '', '190', 'M11', '', '1');
INSERT INTO `dialogs` VALUES ('197', '1', '1', '4', '2', '4', '- Ты что, с ума сошла?! Я охрану позову! Охрана!!!', '0', '0', 'E2.8', '2', '3', '110', '0', '0', '', '191', 'M11', '', '1');
INSERT INTO `dialogs` VALUES ('198', '1', '1', '6', '1', '2', '- Еще раз, добрый день, Валерий Семенович!', '0', '0', 'E2.9', '1', '1', null, '0', '0', 'нет', '192', '-', '', '1');
INSERT INTO `dialogs` VALUES ('199', '6', '1', '1', '1', '2', '- Да!', '0', '0', 'E2.9', '2', '0', null, '0', '0', 'E2.9_2.wav', '193', '-', '', '1');
INSERT INTO `dialogs` VALUES ('200', '1', '1', '6', '1', '2', '- Валерий Семенович, я не смогу сегодня показать Вам презентацию. Она не готова!', '0', '0', 'E2.9', '2', '1', null, '0', '0', 'нет', '194', '-', '', '1');
INSERT INTO `dialogs` VALUES ('201', '1', '1', '6', '1', '2', '- Валерий Семенович, прошу меня извинить, но обстоятельства сильнее меня! Мы не успеем представить презентацию сегодня.', '0', '0', 'E2.9', '2', '2', null, '0', '0', 'нет', '195', '-', '', '1');
INSERT INTO `dialogs` VALUES ('202', '6', '2', '1', '1', '2', '- Что-о-о? Неслыханное дело! И ты набрался наглости мне звонить? Это была моя личная просьба, я лично просил тебя все проконтролировать! Я расцениваю результат как личное неуважение!', '0', '0', 'E2.9', '3', '0', null, '0', '0', 'E2.9_3.wav', '196', '-', '', '1');
INSERT INTO `dialogs` VALUES ('203', '1', '1', '6', '2', '2', '- Валерий Семенович, у меня очень тяжелая пора с бюджетом, который нужен прямо сейчас. А выставка будет только через неделю. И если я предоставлю презентацию завтра утром, то к выставке Вы все равно будете готовы.', '0', '0', 'E2.9', '3', '1', null, '0', '0', 'нет', '197', '-', '', '1');
INSERT INTO `dialogs` VALUES ('204', '1', '1', '6', '2', '2', '- Простите, Валерий Семенович, но если бы наш отдел персонала быстрее подбирал нужных людей, я бы справился и с большей нагрузкой. А так многое приходится делать самому. Естественно, что я не успеваю.', '0', '0', 'E2.9', '3', '2', null, '0', '0', 'нет', '198', '-', '', '1');
INSERT INTO `dialogs` VALUES ('205', '1', '1', '6', '2', '2', '- Не беспокойтесь, Валерий Семенович, я сегодня вечером все сделаю. Завтра к 10 утра презентация будет у Вас.', '0', '0', 'E2.9', '3', '3', null, '0', '0', 'нет', '199', '-', '', '1');
INSERT INTO `dialogs` VALUES ('206', '6', '2', '1', '1', '2', '- Так! Хватит обещаний и объяснений! Завтра в 10.00 жду полностью подготовленную презентацию! Полностью, понял? Иначе я с тебя три шкуры сдеру!', '0', '0', 'E2.9', '4', '0', '107', '0', '0', 'E2.9_4.wav', '200', 'T', 'F15', '1');
INSERT INTO `dialogs` VALUES ('207', '25', '1', '1', '1', '1', 'звук телефонного звонка', '0', '0', 'ET3.1', '1', '0', null, '0', '0', '', '201', '-', '', '0');
INSERT INTO `dialogs` VALUES ('208', '1', '1', '25', '1', '1', 'ответить', '0', '0', 'ET3.1', '1', '1', '27', '0', '0', '', '202', 'E3', '', '0');
INSERT INTO `dialogs` VALUES ('209', '1', '1', '25', '1', '1', 'не ответить', '0', '0', 'ET3.1', '1', '2', '30', '0', '0', '', '203', 'ET3.2', '', '0');
INSERT INTO `dialogs` VALUES ('210', '25', '1', '1', '1', '2', '- Приветствую, это Иван Доброхотов. Мы с тобой сегодня встретиться намечали, помнишь? Слушай, но у меня такой цейтнот, я только из офиса выхожу. В лучшем случае буду у тебя минут через двадцать… Дай посмотреть… Где-то без десяти два.', '0', '0', 'E3', '1', '0', null, '0', '0', 'E3_1.wav', '204', '-', '', '0');
INSERT INTO `dialogs` VALUES ('211', '1', '1', '25', '1', '2', '- Хорошо, Иван, давай через двадцать минут, а то у меня сегодня тоже график ужасный! А пока, может, успею еще что-то поделать…', '0', '0', 'E3', '1', '1', '107', '0', '0', 'нет', '205', 'T', 'F16', '0');
INSERT INTO `dialogs` VALUES ('212', '1', '1', '25', '1', '2', '- Ох, Иван, раз такое дело, может, перенесем встречу? Я тоже сегодня зашиваюсь, сам хотел тебе звонить. Как насчет того, чтобы встретиться через пару недель, после отпуска, а?', '0', '0', 'E3', '1', '2', null, '0', '0', 'нет', '206', '-', '', '0');
INSERT INTO `dialogs` VALUES ('213', '1', '1', '25', '1', '2', '- Через двадцать минут? Тогда времени на разговор совсем не останется. А может, давай перенесем на вечер, а пока займемся срочными делами?', '0', '0', 'E3', '1', '3', null, '0', '0', 'нет', '207', '-', '', '0');
INSERT INTO `dialogs` VALUES ('214', '25', '1', '1', '1', '2', '- А что, отличная мысль! Я тоже посвободней буду. А то эта сдача бюджета, прямо все на части рвут! У меня ведь последние дни для выверки. В среду должен сдать.', '0', '0', 'E3', '2', '0', null, '0', '0', 'E3_2.wav', '208', '-', '', '0');
INSERT INTO `dialogs` VALUES ('215', '1', '1', '25', '1', '2', '- Правда? И у вас бюджет? Я от него устал до смерти. Хоть бы до отпуска дотянуть!', '0', '0', 'E3', '2', '1', null, '0', '0', 'нет', '209', '-', '', '0');
INSERT INTO `dialogs` VALUES ('216', '1', '1', '25', '1', '2', '- Спасибо тебе, значит, через две недели и увидимся. Я как вернусь, сразу же тебе позвоню!', '0', '0', 'E3', '2', '2', '113', '0', '0', 'нет', '210', 'P6', 'F19', '0');
INSERT INTO `dialogs` VALUES ('217', '1', '1', '25', '1', '2', '- Вот спасибо! Выручил! Давай до вечера, часов в шесть жду тебя!', '0', '0', 'E3', '2', '3', '114', '0', '0', 'нет', '211', 'P5', 'F20', '0');
INSERT INTO `dialogs` VALUES ('218', '25', '1', '1', '1', '2', '- Счастливый ты человек. И как правильно подгадал. Сдал бюджет – и на отдых. Надо мне в следующем году воспользоваться! Рискованно, правда: а вдруг с бюджетом не уложишься, придется тогда билетики сдавать!', '0', '0', 'E3', '3', '0', null, '0', '0', 'E3_3.wav', '212', '-', '', '0');
INSERT INTO `dialogs` VALUES ('219', '1', '1', '25', '1', '2', '- Да, об этом я и не подумал. Ладно, все обойдется. Сегодня с бюджетом закончу. Значит, жду тебя часам к шести!', '0', '0', 'E3', '3', '1', '114', '0', '0', 'нет', '213', 'P5', 'F20', '0');
INSERT INTO `dialogs` VALUES ('220', '1', '1', '25', '1', '2', '- Вот и стимул все вовремя сделать! Вернусь из отпуска – сразу же позвоню! До связи!', '0', '0', 'E3', '3', '2', '113', '0', '0', 'нет', '214', 'P6', 'F19', '0');
INSERT INTO `dialogs` VALUES ('221', '26', '1', '1', '1', '1', 'звук телефонного звонка', '0', '0', 'ET3.3', '1', '0', null, '0', '0', '', '215', '-', '', '0');
INSERT INTO `dialogs` VALUES ('222', '1', '1', '26', '1', '1', 'Ответить', '0', '0', 'ET3.3', '1', '1', '28', '0', '0', '', '216', 'E3.1', '', '0');
INSERT INTO `dialogs` VALUES ('223', '1', '1', '26', '1', '1', 'Не ответить', '0', '0', 'ET3.3', '1', '2', '107', '0', '0', '', '217', 'T', '', '0');
INSERT INTO `dialogs` VALUES ('224', '26', '1', '1', '1', '2', '- Мой звонок имеет принципиальную важность! Прошу вас уделить мне несколько минут! Меня зовут Анжела Блеск, я – менеджер стратегического проекта, который начала ваша компания. Надеюсь, вы знакомы с этим проектом?', '0', '0', 'E3.1', '1', '0', null, '0', '0', 'E3.1_1.wav', '218', '-', '', '0');
INSERT INTO `dialogs` VALUES ('225', '1', '1', '26', '1', '2', '- Добрый день! Да, слышал. Важный проект!', '0', '0', 'E3.1', '1', '1', null, '0', '0', 'нет', '219', '-', '', '0');
INSERT INTO `dialogs` VALUES ('226', '1', '1', '26', '1', '2', '- Здравствуйте. Любопытно. И какое отношение этот проект имеет ко мне?', '0', '0', 'E3.1', '1', '2', null, '0', '0', 'нет', '220', '-', '', '0');
INSERT INTO `dialogs` VALUES ('227', '1', '1', '26', '1', '2', '- Здравствуйте, Анжела. Нет, меня не информировали.', '0', '0', 'E3.1', '1', '3', null, '0', '0', 'нет', '221', '-', '', '0');
INSERT INTO `dialogs` VALUES ('228', '26', '1', '1', '1', '2', '- Вот именно об этом я и хотела с вами поговорить! Проект получил самый высокий приоритет. От его успеха зависит успех компании, а значит и ваш! В смысле карьеры, конечно. Мы же все должны думать о будущем росте, не так ли? Ваш руководитель дала мне ваш телефон и сказала, что вы именно тот человек, который мне нужен. Она сказала, что вы - настоящий кладезь информации о компании, все знаете, причем в цифрах! Мне повезло, что удалось застать вас перед отпуском!', '0', '0', 'E3.1', '2', '0', null, '0', '0', 'E3.1_2.wav', '222', '-', '', '0');
INSERT INTO `dialogs` VALUES ('229', '1', '1', '26', '1', '2', '- Благодарю, польщен. Так о чем вы хотели поговорить?', '0', '0', 'E3.1', '2', '1', null, '0', '0', 'нет', '223', '-', '', '0');
INSERT INTO `dialogs` VALUES ('230', '1', '1', '26', '1', '2', '- Извините, давайте созвонимся после отпуска, я сейчас очень занят.', '0', '0', 'E3.1', '2', '2', '115', '0', '0', 'нет', '224', 'P4', 'F21', '0');
INSERT INTO `dialogs` VALUES ('231', '1', '1', '26', '1', '2', '- А мой руководитель не сообщила вам, что я сейчас очень занят? Извините, но у меня нет времени на разговоры.', '0', '0', 'E3.1', '2', '3', null, '0', '0', 'нет', '225', '-', '', '0');
INSERT INTO `dialogs` VALUES ('232', '26', '1', '1', '1', '2', '- Мне жизненно необходимо увидеться с вами до отпуска! Позвольте, я вкратце расскажу вам о проекте. Это совершенно беспрецедентный опыт. На этом рынке такое происходит впервые - чтобы такая крупная компания, как ваша, задумалась о смене стратегии! Этот опыт войдет в историю, и история будет твориться нашими руками! Вашими руками! У вас не только появится опыт совместной разработки стратегических решений, мы вместе пройдем весь процесс! Вы узнаете все секреты самой опытной консалтинговой компании. Не каждому такое дано!', '0', '0', 'E3.1', '3', '0', null, '0', '0', 'E3.1_3.wav', '226', '-', '', '0');
INSERT INTO `dialogs` VALUES ('233', '1', '1', '26', '1', '2', '- Кхе…кхе…', '0', '0', 'E3.1', '3', '1', null, '0', '0', 'нет', '227', '-', '', '0');
INSERT INTO `dialogs` VALUES ('234', '1', '1', '26', '1', '2', '- Извините, но у меня перед отпуском совершенно нет времени.', '0', '0', 'E3.1', '3', '2', null, '0', '0', 'нет', '228', '-', '', '0');
INSERT INTO `dialogs` VALUES ('235', '1', '1', '26', '1', '2', '- Сколько именно времени вам нужно и для чего?', '0', '0', 'E3.1', '3', '3', null, '0', '0', 'нет', '229', '-', '', '0');
INSERT INTO `dialogs` VALUES ('236', '26', '1', '1', '1', '2', '- Поверьте, мы все очень заняты! Но этот приоритет установил сам Босс! Это его проект – он его спонсор. В прямом и переносном смысле. Ха-ха.. К проекту привлекаются только самые перспективные сотрудники, они попадут в кадровый резерв. Не лишайте себя такой возможности! Речь идет о каких-то тридцати минутах на первую встречу – всего несколько вопросов, и вы в команде стратегического комитета! Вы же обладатель уникальной информации, а вас не будет целых две недели. Не могу же я сказать Боссу, что проект буксует только потому, что у одного из менеджеров не нашлось получаса на встречу!', '0', '0', 'E3.1', '4', '0', null, '0', '0', 'E3.1_4.wav', '230', '-', '', '0');
INSERT INTO `dialogs` VALUES ('237', '1', '1', '26', '1', '2', '- Да я не отказываюсь с вами встречаться, хочу только понять цель и сроки!', '0', '0', 'E3.1', '4', '1', null, '0', '0', 'нет', '231', '-', '', '0');
INSERT INTO `dialogs` VALUES ('238', '1', '1', '26', '1', '2', '- Хорошо, если это так важно, вы можете подойти прямо сейчас. Мой кабинет 213. Больше свободного времени до отпуска у меня не будет.', '0', '0', 'E3.1', '4', '2', '29', '0', '0', 'нет', '232', 'E3.5', '', '0');
INSERT INTO `dialogs` VALUES ('239', '1', '1', '26', '1', '2', '- А давайте я позвоню вам в первый же день после отпуска! Я буду гораздо полезней на свежую голову!', '0', '0', 'E3.1', '4', '3', '115', '0', '0', 'нет', '233', 'P4', 'F21', '0');
INSERT INTO `dialogs` VALUES ('240', '26', '1', '1', '1', '2', '- Наша цель – создать стратегию, которая выведет вашу компанию на лидерские позиции. Для этого требуются всего 30 минут вашего времени! Вопросы у меня несложные: устройство компании и ваше видение ее потенциала. Вы ведь наверняка думали о том, что и как можно было бы улучшить! Может, вы и есть тот менеджер, который поведет компанию вперед. Между нами говоря, Босс ведь моложе не становится, ему нужен приемник…', '0', '0', 'E3.1', '5', '0', null, '0', '0', 'E3.1_5.wav', '234', '-', '', '0');
INSERT INTO `dialogs` VALUES ('241', '1', '1', '26', '1', '2', '- Я вас понял. Давайте сегодня после 18.00!', '0', '0', 'E3.1', '5', '1', '29', '0', '0', 'нет', '235', 'E3.5', 'F10', '0');
INSERT INTO `dialogs` VALUES ('242', '1', '1', '26', '1', '2', '- Я вас понял. Давайте договоримся на завтра. Я просмотрю свой план и сообщу вам, когда у меня освободится окошко.', '0', '0', 'E3.1', '5', '2', '115', '0', '0', 'нет', '236', 'P4', 'F11', '0');
INSERT INTO `dialogs` VALUES ('243', '1', '1', '26', '1', '2', '- Я вас понял. Могу выделить минут двадцать прямо сейчас. Мой кабинет 213. Больше у меня до отпуска времени не предвидится.', '0', '0', 'E3.1', '5', '3', '29', '0', '0', 'нет', '237', 'E3.5', '', '0');
INSERT INTO `dialogs` VALUES ('244', '1', '1', '26', '1', '2', '- Теперь ясно! Давайте встретимся для обсуждения в первый же день после отпуска.', '0', '0', 'E3.1', '5', '4', '115', '0', '0', 'нет', '238', 'P4', '', '0');
INSERT INTO `dialogs` VALUES ('245', '26', '1', '1', '1', '4', '- Я вам так благодарна за то, что вы нашли время для нашей встречи! Люди совершенно разучились мыслить стратегически, все сконцентрированы на текущих проблемах, все спешат, спешат. Какое счастье встретить единомышленника!', '30', '0', 'E3.5', '1', '0', null, '0', '0', 'E3_5_1_Камера.webm', '239', '-', '', '0');
INSERT INTO `dialogs` VALUES ('246', '1', '1', '26', '1', '4', '- Здравствуйте, Анжела! У нас 20 минут на обсуждение великих планов.', '30', '0', 'E3.5', '1', '1', null, '0', '0', 'E3_5_1_Камера.png', '240', '-', '', '0');
INSERT INTO `dialogs` VALUES ('247', '1', '1', '26', '1', '4', '- Добрый день, Анжела! Приступайте к вашим вопросам.', '30', '0', 'E3.5', '1', '2', null, '0', '0', '', '241', '-', '', '0');
INSERT INTO `dialogs` VALUES ('248', '26', '1', '1', '1', '4', '- Да, да, времени совсем мало. И все же нам следует получше узнать друг друга, ведь впереди столько работы! Вы же знаете, успех любого проекта на девяносто процентов зависит от слаженности команды! Потому не стесняйтесь – задавайте вопросы и мне, с удовольствием отвечу! Где тут мой блокнот?......Итак… Начнем…Сколько лет вы работаете в компании?', '30', '0', 'E3.5', '2', '0', null, '0', '0', 'E3_5_2_Камера.webm', '242', '-', '', '0');
INSERT INTO `dialogs` VALUES ('249', '1', '1', '26', '1', '4', '- Чуть больше года', '30', '0', 'E3.5', '2', '1', null, '0', '0', 'E3_5_2_Камера.png', '243', '-', '', '0');
INSERT INTO `dialogs` VALUES ('250', '1', '1', '26', '1', '4', '- Не помню, не считал', '30', '0', 'E3.5', '2', '2', null, '0', '0', '', '244', '-', '', '0');
INSERT INTO `dialogs` VALUES ('251', '1', '1', '26', '1', '4', '- А при чем тут мой стаж в компании?', '30', '0', 'E3.5', '2', '3', null, '0', '0', '', '245', '-', '', '0');
INSERT INTO `dialogs` VALUES ('252', '26', '1', '1', '1', '4', '- Второй вопрос: если бы вас назначили Генеральным директором, компании, что бы вы изменили в первую очередь?', '30', '0', 'E3.5', '3', '0', null, '0', '0', 'E3_5_3_Камера.webm', '246', '-', '', '0');
INSERT INTO `dialogs` VALUES ('253', '1', '1', '26', '1', '4', '- Ну, не знаю. Здесь надо подумать.', '30', '0', 'E3.5', '3', '1', null, '0', '0', 'E3_5_3_Камера.png', '247', '-', '', '0');
INSERT INTO `dialogs` VALUES ('254', '1', '1', '26', '1', '4', '- Я бы приказал туалеты мыть трижды в день или чаще – к концу дня зайти не возможно.', '30', '0', 'E3.5', '3', '2', null, '0', '0', '', '248', '-', '', '0');
INSERT INTO `dialogs` VALUES ('255', '1', '1', '26', '1', '4', '- Вероятно, начал бы с команды.', '30', '0', 'E3.5', '3', '3', null, '0', '0', '', '249', '-', '', '0');
INSERT INTO `dialogs` VALUES ('256', '26', '1', '1', '1', '4', '- Да-да, это очень важно. Далее: расскажите об организационной структуре компании. Кстати, вы ведь в структуре Денежной? Ну и как она вам? Между нами, дама не из приятных… Наверное, вам от нее достается? А сама, небось, только указания раздает! Да? Как у вас с ней функционал распределен?', '30', '0', 'E3.5', '4', '0', null, '0', '0', 'E3_5_4_Камера.webm', '250', '-', '', '0');
INSERT INTO `dialogs` VALUES ('257', '1', '1', '26', '1', '4', '- И не говорите, все очень не просто. И ладно бы замечания были по делу. А то так – сплошное настроение!', '30', '0', 'E3.5', '4', '1', null, '0', '0', 'E3_5_4_Камера.png', '251', '-', '', '0');
INSERT INTO `dialogs` VALUES ('258', '1', '1', '26', '1', '4', '- Функционал? Проще простого. Она – начальник, я – исполнитель. Так и распределяется.', '30', '0', 'E3.5', '4', '2', null, '0', '0', '', '252', '-', '', '0');
INSERT INTO `dialogs` VALUES ('259', '1', '1', '26', '1', '4', '- Как вы можете так о ней говорить? Вы ведь ее совсем не знаете! И не боитесь, что я могу ее проинформировать?!', '30', '0', 'E3.5', '4', '3', null, '0', '0', '', '253', '-', '', '0');
INSERT INTO `dialogs` VALUES ('260', '1', '1', '26', '1', '4', '- Простите, но у меня сейчас начинается давно запланированная встреча. Было приятно с вами познакомиться, обращайтесь!', '30', '0', 'E3.5', '4', '4', '107', '0', '0', '', '254', 'T', '???', '0');
INSERT INTO `dialogs` VALUES ('261', '26', '1', '1', '1', '4', '- Да, такое часто случается. Практически в каждой компании с этим сталкиваюсь. А я, между прочим, уже десять лет в консалтинге – совсем девчонкой пришла, такая наивная была… Десять лет - это, знаете ли, срок! На десять жизней хватит… Так о чем это мы? Ах да, мне нужны данные по всем финансово-экономическим показателям за прошедшие пять лет, помесячно. Мы будем строить финансовую модель. Как раз, пока будете отдыхать, и построим…ха-ха-ха.', '30', '0', 'E3.5', '5', '0', null, '0', '0', 'E3_5_5_Камера.webm', '255', '-', '', '0');
INSERT INTO `dialogs` VALUES ('262', '1', '1', '26', '1', '4', '- Хорошо, я попрошу аналитика подготовить для вас данные. Это все?', '30', '0', 'E3.5', '5', '1', null, '0', '0', 'E3_5_5_Камера.png', '256', '-', '', '0');
INSERT INTO `dialogs` VALUES ('263', '1', '1', '26', '1', '4', '- К этой информации у меня доступа нет. Чтобы получить его, Денежная должна выдать письменное разрешение.', '30', '0', 'E3.5', '5', '2', null, '0', '0', '', '257', '-', '', '0');
INSERT INTO `dialogs` VALUES ('264', '1', '1', '26', '1', '4', '- Перешлите запрос в письменном виде, я определю сроки и дам вам знать.', '30', '0', 'E3.5', '5', '3', '107', '0', '0', '', '258', 'T', '???', '0');
INSERT INTO `dialogs` VALUES ('265', '1', '1', '26', '1', '4', '- Как интересно, финансовая модель! Я ведь тоже мог бы ею заняться, а приходится сидеть тут с бюджетами.', '30', '0', 'E3.5', '5', '4', null, '0', '0', '', '259', '-', '', '0');
INSERT INTO `dialogs` VALUES ('266', '26', '1', '1', '1', '4', '- Так когда, говорите, я смогу получить данные? Напоминаю, это проект Босса. Что касается допусков к информации – не волнуйтесь, у меня все есть. А иначе как бы я у вас тут оказалась...ха-ха-ха. Итак, прошу определить сроки подготовки данных и с кем мне контактировать в ваше отсутствие!', '30', '0', 'E3.5', '6', '0', null, '0', '0', 'E3_5_6_Камера.webm', '260', '-', '', '0');
INSERT INTO `dialogs` VALUES ('267', '1', '1', '26', '1', '4', '- Ничего пока сказать не могу. Надо подумать. Звоните мне после отпуска.', '30', '0', 'E3.5', '6', '1', null, '0', '0', 'E3_5_6_Камера.png', '261', '-', '', '0');
INSERT INTO `dialogs` VALUES ('268', '1', '1', '26', '1', '4', '- С Денежной и контактируйте. А сроки – пока не знаю. Пять лет – дело серьезное, надо старые базы доставать. Все вопросы – к ней.', '30', '0', 'E3.5', '6', '2', null, '0', '0', '', '262', '-', '', '0');
INSERT INTO `dialogs` VALUES ('269', '1', '1', '26', '1', '4', '- Данные для вас подготовит Марина Крутько. Сроки - думаю, что не меньше недели потребуется. Свяжитесь с ней.', '30', '0', 'E3.5', '6', '3', null, '0', '0', '', '263', '-', '', '0');
INSERT INTO `dialogs` VALUES ('270', '26', '1', '1', '1', '4', '- Ну и ну, засиделась я у вас! Если собеседник интересный, время просто летит. А ко мне у вас вопросы есть?', '30', '0', 'E3.5', '7', '0', null, '0', '0', 'E3_5_7_Камера.webm', '264', '-', '', '0');
INSERT INTO `dialogs` VALUES ('271', '1', '1', '26', '1', '4', '- Нет, спасибо. Был рад знакомству!', '30', '0', 'E3.5', '7', '1', '107', '0', '0', 'E3_5_7_Камера.png', '265', 'T', '', '0');
INSERT INTO `dialogs` VALUES ('272', '1', '1', '26', '1', '4', '- Конечно, есть. Вы о стратегическом комитете говорили, о совместной работе. Расскажите подробнее, как туда попасть.', '30', '0', 'E3.5', '7', '2', null, '0', '0', '', '266', '-', '', '0');
INSERT INTO `dialogs` VALUES ('273', '1', '1', '26', '1', '4', '- Вопросов у меня много, только времени мало. Знал бы, что встреча будет такой бесполезной – ни за что бы не согласился.', '30', '0', 'E3.5', '7', '3', '107', '0', '0', '', '267', 'T', '', '0');
INSERT INTO `dialogs` VALUES ('274', '26', '1', '1', '1', '4', '- О, стратегический комитет – это мое детище! Пока он состоит из четырех человек – Босс, Денежная, я и мой руководитель. Но это только начало. Мы его планируем расширять за счет перспективных сотрудников, которые возьмут на себя часть функций. Большего пока сказать не могу – все еще только формируется. Да вы не волнуйтесь, ваш профессионализм и молодость говорят за себя. Да и я могу словечко замолвить. Только добром за добро – данные бы мне побыстрей, хорошо? Ну что ж, пора, благодарю за беседу!', '30', '0', 'E3.5', '8', '0', '107', '0', '0', 'E3_5_8_Камера.webm', '268', 'T', '', '0');
INSERT INTO `dialogs` VALUES ('275', '25', '1', '1', '1', '5', 'стук в дверь', '0', '0', 'ET3.2', '1', '0', null, '0', '0', '', '269', '-', '', '0');
INSERT INTO `dialogs` VALUES ('276', '1', '1', '25', '1', '5', 'впустить', '0', '0', 'ET3.2', '1', '1', '31', '0', '0', '', '270', 'E3.2', '', '0');
INSERT INTO `dialogs` VALUES ('277', '1', '1', '25', '1', '5', 'не впустить', '0', '0', 'ET3.2', '1', '2', '17', '0', '0', '', '271', 'S2', 'F12', '0');
INSERT INTO `dialogs` VALUES ('278', '25', '1', '1', '1', '4', '- Хорошо, что все-таки удалось повидаться. Я уж думал, никуда не успею. Ну как там твой бюджет?', '40', '0', 'E3.2', '1', '0', null, '0', '0', 'E3_2_1_Камера.webm', '272', '-', '', '0');
INSERT INTO `dialogs` VALUES ('279', '1', '1', '25', '1', '4', '- Сделал, прямо перед тобой отправил.', '40', '0', 'E3.2', '1', '1', null, '0', '0', 'E3_2_1_Камера.png', '273', '-', '', '0');
INSERT INTO `dialogs` VALUES ('280', '1', '1', '25', '1', '4', '- Да возимся еще, надеюсь, к обеду будет.', '40', '0', 'E3.2', '1', '2', null, '0', '0', '', '274', '-', '', '0');
INSERT INTO `dialogs` VALUES ('281', '1', '1', '25', '1', '4', '- Придется переносить на завтра, можем не успеть.', '40', '0', 'E3.2', '1', '3', null, '0', '0', '', '275', '-', '', '0');
INSERT INTO `dialogs` VALUES ('282', '25', '1', '1', '1', '4', '- Да уж. Может и не лучшее сейчас время долгосрочные вопросы обсуждать. Хотя, весь год так. То бюджет, то отчет, то Новый год и так по кругу… Не будем откладывать в долгий ящик. К делу! Напомни нам обоим, в чем вопрос.', '40', '0', 'E3.2', '2', '0', null, '0', '0', 'E3_2_2_Камера.webm', '276', '-', '', '0');
INSERT INTO `dialogs` VALUES ('283', '1', '1', '25', '1', '4', 'Давай по порядку. Мы получаем от вас данные о продажах в виде простого файла формата word, которые потом мой аналитик вбивает в информационную систему вручную. Так как ассортимент очень широкий, около пяти тысяч наименований, а клиент вы крупный, за что спасибо, конечно, данные от вас приходят каждый день огромными файлами. Не получать их я не могу – эти данные нужны нашим логистам и производственникам, чтобы управлять запасами и планом производства. Но теперешняя скорость обработки данных их не устраивает – они запаздывают с решениями. Резюме, мне бы хотелось получать данные от вас в таком виде, который позволял бы автоматически интегрировать их в нашу информационную систему!', '40', '0', 'E3.2', '2', '1', null, '0', '0', 'E3_2_2_Камера.png', '277', '-', '', '0');
INSERT INTO `dialogs` VALUES ('284', '25', '1', '1', '1', '4', '- Дополню, что информационные системы у нас разные. Мы менять информационную систему не станем, вы тоже не собираетесь, а ведь проблема-то скорее ваша, чем наша! Нас нынешняя модель вполне устраивает!', '40', '0', 'E3.2', '3', '0', null, '0', '0', 'E3_2_3_Камера.webm', '278', '-', '', '0');
INSERT INTO `dialogs` VALUES ('285', '1', '1', '25', '1', '4', '- Это только на первый взгляд проблема наша, а на самом деле она и вас касается. Ведь задержка решений в логистике и производстве – это отсутствие товара у вас в магазинах. Давай прикинем, сколько вы теряете на том, что 5-10 самых продаваемых позиций отсутствуют у вас, скажем, неделю.', '40', '0', 'E3.2', '3', '1', null, '0', '0', 'E3_2_3_Камера.png', '279', '-', '', '0');
INSERT INTO `dialogs` VALUES ('286', '1', '1', '25', '1', '4', '- Ну, знаешь, мы ведь в одной упряжке. Сегодня мне что-то нужно, завтра – тебе. Вот, например, ты просил у меня данные по рынку, которые мы собираем по своим клиентам. Я же готов тебе помочь!', '40', '0', 'E3.2', '3', '2', null, '0', '0', '', '280', '-', '', '0');
INSERT INTO `dialogs` VALUES ('287', '1', '1', '25', '1', '4', '- Что происходит? Ты ведь по телефону говорил, что проблема действительно существует и ты готов ее обсуждать. Мы же только потому нашу встречу и назначили!', '40', '0', 'E3.2', '3', '3', null, '0', '0', '', '281', '-', '', '0');
INSERT INTO `dialogs` VALUES ('288', '25', '1', '1', '1', '4', '- Ха-ха-ха...А ты хитер! Пойми меня правильно, я не отказываюсь помочь. Если бы все зависело только от меня, я бы вообще на вашу информационную систему перешел. Но простого решения мы, скорее всего, не найдем, так что вопрос придется обсуждать на более высоком уровне. А там – сплошные экономические расклады. Такие понятия, как дружба и взаимовыручка, не монетизируешь...ха-ха-ха. Кстати, мне только что пришло в голову… А зачем нам вообще по поводу информационных систем бодаться? Найми ты себе еще с пяток аналитиков, будут укладываться за час. И логист с производственником довольны, и ты большим начальником станешь! Ха-ха-ха...', '40', '0', 'E3.2', '4', '0', null, '0', '0', 'E3_2_4_Камера.webm', '282', '-', '', '0');
INSERT INTO `dialogs` VALUES ('289', '1', '1', '25', '1', '4', '- Да я тоже об этом думал, но, увы, эта идея противоречит современной политике. Я имею в виду сокращение затрат.', '40', '0', 'E3.2', '4', '1', null, '0', '0', 'E3_2_4_Камера.png', '283', '-', '', '0');
INSERT INTO `dialogs` VALUES ('290', '1', '1', '25', '1', '4', '- Если бы все было так просто, я бы давно уже сам все сделал. Только загвоздка в том, что у нас много клиентов и много отчетов, а по мере роста будет еще больше. Не набирать же мне армию аналитиков!', '40', '0', 'E3.2', '4', '2', null, '0', '0', '', '284', '-', '', '0');
INSERT INTO `dialogs` VALUES ('291', '25', '1', '1', '1', '4', '- Смешно экономить на шпильках и упускать большой куш. Ты же сам говоришь, что решения запаздывают, товара в магазинах нет. А сколько вы на этом теряете, вы считали?', '40', '0', 'E3.2', '5', '0', null, '0', '0', 'E3_2_5_a_Камера.webm', '285', '-', '', '0');
INSERT INTO `dialogs` VALUES ('292', '1', '1', '25', '1', '4', '- Чего тут считать! Понятно же, что проблема есть и ее надо решать.', '40', '0', 'E3.2', '5', '1', null, '0', '0', 'E3_2_5_a_Камера.png', '286', '-', '', '0');
INSERT INTO `dialogs` VALUES ('293', '1', '1', '25', '1', '4', '- Нет, не считали…Ты прав, Иван!', '40', '0', 'E3.2', '5', '2', null, '0', '0', '', '287', '-', '', '0');
INSERT INTO `dialogs` VALUES ('294', '25', '1', '1', '1', '4', '- Вот именно! А стоило бы посчитать. Может статься, что пока мы тут разговоры разговариваем и решения изобретаем, вы миллионы теряете. А два дополнительных аналитика обойдутся куда дешевле.', '40', '0', 'E3.2', '6', '0', null, '0', '0', 'E3_2_6_Камера.webm', '288', '-', '', '0');
INSERT INTO `dialogs` VALUES ('295', '1', '1', '25', '1', '4', '- Наверное, ты прав. Может, пока на этом и остановимся? Мне надо подумать-посчитать.', '40', '0', 'E3.2', '6', '1', null, '0', '0', 'E3_2_6_Камера.png', '289', '-', '', '0');
INSERT INTO `dialogs` VALUES ('296', '1', '1', '25', '1', '4', '- Хорошо. Я просчитаю затраты на двух дополнительных аналитиков. Но на самом деле мы таким образом лишь оттянем решение основного вопроса, потому что отчеты от других клиентов тоже надо обрабатывать.', '40', '0', 'E3.2', '6', '2', null, '0', '0', '', '290', '-', '', '0');
INSERT INTO `dialogs` VALUES ('297', '25', '1', '1', '1', '4', '- Хорошо, раз уж я здесь, давай обдумаем и другие варианты. Итак, в идеале я должен вам пересылать данные в некоем электронном формате, который ваша система будет прочитывать и раскладывать по нужным ячейкам, так?', '40', '0', 'E3.2', '7', '0', null, '0', '0', 'E3_2_7_Камера.webm', '291', '-', '', '0');
INSERT INTO `dialogs` VALUES ('298', '1', '1', '25', '1', '4', '- Иван, извини. Время вышло. Давай пока на этом закончим. Я тебе благодарен за встречу, но давай продолжим после отпуска. Я брошу тебе приглашение и подъеду к тебе сам, хорошо?', '40', '0', 'E3.2', '7', '1', '116', '0', '0', 'E3_2_7_Камера.png', '292', 'P1', '', '0');
INSERT INTO `dialogs` VALUES ('299', '1', '1', '25', '1', '4', '- Иван, наши сорок минут прошли. Ты мне отличную идею подкинул! Буду прорабатывать вариант с дополнительными аналитиками! Давай на этом пока и остановимся. Спасибо!', '40', '0', 'E3.2', '7', '2', '33', '0', '0', '', '293', 'E3.3', '', '0');
INSERT INTO `dialogs` VALUES ('300', '1', '1', '25', '1', '4', '- Так! А мысли о том, как можно реализовать эту автоматическую пересылку и перекачку, у тебя есть?', '40', '0', 'E3.2', '7', '3', null, '0', '0', '', '294', '-', '', '0');
INSERT INTO `dialogs` VALUES ('301', '25', '1', '1', '1', '4', '- Мыслей-то много, неясно пока, что из них можно реализовать. Ну, например, я мог бы организовать выгрузку наших данных в файл формата XML. Вы можете организовать перенос данных из такого файла в вашу систему без потерь?', '40', '0', 'E3.2', '8', '0', null, '0', '0', 'E3_2_8_a_Камера.webm', '295', '-', '', '0');
INSERT INTO `dialogs` VALUES ('302', '1', '1', '25', '1', '4', '- Ну нет, это не вариант. Нам нужны данные в формате нашей информационной системы. Можете вы в наш формат данные выгружать?', '40', '0', 'E3.2', '8', '1', null, '0', '0', 'E3_2_8_a_Камера.png', '296', '-', '', '0');
INSERT INTO `dialogs` VALUES ('303', '1', '1', '25', '1', '4', '- Иван, сейчас я не могу тебе ответить, нам потребуется руководитель нашего подразделения информационных технологий. А я его, каюсь, не пригласил!', '40', '0', 'E3.2', '8', '2', null, '0', '0', '', '297', '-', '', '0');
INSERT INTO `dialogs` VALUES ('304', '1', '1', '25', '1', '4', '- Да, наверное, так возможно. Но мне надо переговорить с нашими АйТишниками. Нет ли у них каких-то ограничений.', '40', '0', 'E3.2', '8', '3', null, '0', '0', '', '298', '-', '', '0');
INSERT INTO `dialogs` VALUES ('305', '25', '1', '1', '1', '4', '- Понимаешь, такой вариант был бы самым экономичным и быстрым. Пока его не отработаем, рассматривать другие просто нет смысла. Потому предлагаю пока закруглиться. Жаль, конечно, что ты не пригласил компетентного АйТишника. Могли бы уже сейчас до чего-то договориться…', '40', '0', 'E3.2', '9', '0', '32', '0', '0', 'E3_2_9_Камера.webm', '299', 'E3.4', '', '0');
INSERT INTO `dialogs` VALUES ('306', '25', '1', '1', '1', '4', '- Ладно, мне бежать пора. Я, кстати, рассчитываю данные по рынку от тебя получить. Тяжело без них бюджетировать. Надеюсь, что время зря не потратили. Протокол пришлешь?', '0', '0', 'E3.4', '1', '0', null, '0', '0', 'E3_4_1_Камера.webm', '300', '-', '', '0');
INSERT INTO `dialogs` VALUES ('307', '1', '1', '25', '1', '4', '- А зачем? Мы же пока ничего не решили! Всего хорошего и спасибо!', '0', '0', 'E3.4', '1', '1', '107', '0', '0', 'E3_4_1_Камера.png', '301', 'T', '', '0');
INSERT INTO `dialogs` VALUES ('308', '1', '1', '25', '1', '4', '- Хорошо. Прямо сейчас в план поставлю и пришлю. Удачи, очень тебе благодарен!', '0', '0', 'E3.4', '1', '2', '117', '0', '0', '', '302', 'P2', '', '0');
INSERT INTO `dialogs` VALUES ('309', '1', '1', '25', '1', '4', '- Иван, у меня только день до отпуска! Еще и тебе данные готовить… Сделай сам по дружбе, а?', '0', '0', 'E3.4', '1', '3', null, '0', '0', '', '303', '-', '', '0');
INSERT INTO `dialogs` VALUES ('310', '25', '1', '1', '1', '4', '- Ну ты даешь!!! Мало того, что это я к тебе выбрался, хоть вопрос твой, так я еще и протокол должен составлять!? Удивил!', '0', '0', 'E3.4', '2', '0', '107', '0', '0', 'E3_4_2_Камера.webm', '304', 'T', '', '0');
INSERT INTO `dialogs` VALUES ('311', '25', '1', '1', '1', '4', '- Да-да, непременно посчитай. Я, кстати, рассчитываю данные по рынку от тебя получить. Тяжело без них бюджетировать. Рад, что мое предложение тебе пришлось по душе. Дай знать, что там у вас получится. Ты, протокол-то пришлешь?', '0', '0', 'E3.3', '1', '0', null, '0', '0', 'E3_3_1_Камера.webm', '305', '-', '', '0');
INSERT INTO `dialogs` VALUES ('312', '1', '1', '25', '1', '4', '- А зачем, мы же толком не решили ничего! Всего хорошего и спасибо!', '0', '0', 'E3.3', '1', '1', '107', '0', '0', 'E3_3_1_Камера.png', '306', 'T', '', '0');
INSERT INTO `dialogs` VALUES ('313', '1', '1', '25', '1', '4', '- Хорошо. Прямо сейчас в план поставлю и пришлю. Удачи, очень тебе благодарен!', '0', '0', 'E3.3', '1', '2', '117', '0', '0', '', '307', 'P2', '', '0');
INSERT INTO `dialogs` VALUES ('314', '1', '1', '25', '1', '4', '- Иван, у меня только день до отпуска! Еще и тебе данные готовить… Сделай сам по дружбе, а?', '0', '0', 'E3.3', '1', '3', null, '0', '0', '', '308', '-', '', '0');
INSERT INTO `dialogs` VALUES ('315', '25', '1', '1', '1', '4', '- Ну ты даешь!!! Мало того, что это я к тебе выбрался, хоть вопрос твой, так я еще и протокол должен составлять!? Удивил!', '0', '0', 'E3.3', '2', '0', '107', '0', '0', 'E3_3_2_Камера.webm', '309', 'T', '', '0');
INSERT INTO `dialogs` VALUES ('316', '10', '1', '1', '1', '5', 'стук в дверь', '0', '0', 'ET8', '1', '0', null, '0', '0', '', '310', '-', '', '0');
INSERT INTO `dialogs` VALUES ('317', '1', '1', '10', '1', '5', 'впустить', '0', '0', 'ET8', '1', '1', '35', '0', '0', '', '311', 'E8', '', '0');
INSERT INTO `dialogs` VALUES ('318', '1', '1', '10', '1', '5', 'не впустить', '0', '0', 'ET8', '1', '2', '107', '0', '0', '', '312', 'T', '', '0');
INSERT INTO `dialogs` VALUES ('319', '10', '1', '1', '1', '4', '- Привет, друг! Что, бюджет терзаешь?…Или он тебя? Ох уж мне эта бюрократия…', '5', '0', 'E8', '1', '0', null, '0', '0', 'E8_1_b_Камера.webm', '313', '-', '', '0');
INSERT INTO `dialogs` VALUES ('320', '1', '1', '10', '1', '4', '- Привет, Семен! И не говори. Как обычно – все регламенты построены на подвиге исполнителей.', '5', '0', 'E8', '1', '1', null, '0', '0', 'E8_1_b_Камера.png', '314', '-', '', '0');
INSERT INTO `dialogs` VALUES ('321', '1', '1', '10', '1', '4', '- Привет, Семен! С бюджетом покончено, можешь меня поздравить!', '5', '0', 'E8', '1', '2', null, '0', '0', '', '315', '-', '', '0');
INSERT INTO `dialogs` VALUES ('322', '1', '1', '10', '1', '4', '- Добрый день! Вы по какому вопросу?', '5', '0', 'E8', '1', '3', null, '0', '0', '', '316', '-', '', '0');
INSERT INTO `dialogs` VALUES ('323', '10', '1', '1', '1', '4', '- Судя по твоему замученному облику, обедать ты еще не ходил! Пойдем – бюджетов впереди много, а здоровье – оно одно! Ты уже неделю со мной обедать не ходишь. Или две? Что твоя Раиса скажет, если ты тут на работе и помрешь? Получит она тогда свой бюджет? А?', '5', '0', 'E8', '2', '0', null, '0', '0', 'E8_2_b_Камера.webm', '317', '-', '', '0');
INSERT INTO `dialogs` VALUES ('324', '1', '1', '10', '1', '4', '- По-моему, ей все равно. Незаменимых у нас нет.', '5', '0', 'E8', '2', '1', null, '0', '0', 'E8_2_b_Камера.png', '318', '-', '', '0');
INSERT INTO `dialogs` VALUES ('325', '1', '1', '10', '1', '4', '- Слушай, не могу я обедать, никак не получается. В отпуске пообедаю.', '5', '0', 'E8', '2', '2', null, '0', '0', '', '319', '-', '', '0');
INSERT INTO `dialogs` VALUES ('326', '1', '1', '10', '1', '4', '- А мы в двадцать минут впишемся? Если там очереди нет, то пойдем!', '5', '0', 'E8', '2', '3', null, '0', '0', '', '320', '-', '', '0');
INSERT INTO `dialogs` VALUES ('327', '10', '1', '1', '1', '4', '- Мои ребята только вернулись, говорят, что в кафе нашем полный штиль – выбирай любой столик. Давай, давай, поднимайся!', '5', '0', 'E8', '3', '0', null, '0', '0', 'E8_3_b_Камера.webm', '321', '-', '', '0');
INSERT INTO `dialogs` VALUES ('328', '1', '1', '10', '1', '4', '- Нет, прости Cемен, не могу. После отпуска пообедаем.', '5', '0', 'E8', '3', '1', '36', '0', '0', 'E8_3_b_Камера.png', '322', 'E8.1', '', '0');
INSERT INTO `dialogs` VALUES ('329', '1', '1', '10', '1', '4', '- Хорошо, пойдем, но у меня только двадцать минут.', '5', '0', 'E8', '3', '2', '37', '0', '0', '', '323', 'E8.3', '', '0');
INSERT INTO `dialogs` VALUES ('330', '10', '1', '1', '1', '4', '- Не получится, после твоего отпуска я в отпуск уйду… А там и Новый год на носу. Побежал я, у меня у самого пятнадцать минут. Хотел тебе за обедом результаты теста по серверу рассказать. Ты письмо мое утреннее читал? Так вот, на самом деле все намного хуже. Срочно пиши служебку на выделение средств. Да ты письмо-то почитай! Пока!', '1', '0', 'E8.1', '1', '0', '107', '0', '0', 'E8_1_1_b_Камера.webm', '324', 'T', '', '0');
INSERT INTO `dialogs` VALUES ('331', '10', '1', '1', '1', '4', '- Так вот, слушай и записывай… Или закусывай! Ха-ха-ха...Ситуация с сервером – хуже некуда. Ты мое утреннее письмо читал?', '20', '0', 'E8.3', '1', '0', null, '0', '0', 'E8_3_1_Камера.webm', '325', '-', '', '0');
INSERT INTO `dialogs` VALUES ('332', '1', '1', '10', '1', '4', '- Нет, прости, Мирон. Сегодня просто сумасшедший день. Собирался почту разбирать как только со срочными вопросами разберусь. А им конца и края нет.', '20', '0', 'E8.3', '1', '1', null, '0', '0', 'E8_3_1_Камера.png', '326', '-', '', '0');
INSERT INTO `dialogs` VALUES ('333', '1', '1', '10', '1', '4', '- Конечно читал. Хорошее письмо, обстоятельное!', '20', '0', 'E8.3', '1', '2', null, '0', '0', '', '327', '-', '', '0');
INSERT INTO `dialogs` VALUES ('334', '1', '1', '10', '1', '4', '- Какое письмо? У меня что, почта есть?', '20', '0', 'E8.3', '1', '3', null, '0', '0', '', '328', '-', '', '0');
INSERT INTO `dialogs` VALUES ('335', '10', '1', '1', '1', '4', '- Так вот, все, что в нем было высказано в виде предположений, на деле во много раз ужаснее. Я-то надеялся, что мы приведем твой сервер в чувство, ребята у меня – умельцы. Но как бы не так. По тесту – пациент скорее мертв. Сдаем его в утиль. Долго я тебя на резервном сервере не продержу – у вас же данные со времен царя Гороха. Так что если ты надеешься, что пока ты в отпуске твой отдел будет пахать – срочно проси денег у Денежной. Я тогда на следующей неделе все закуплю и подготовлю.', '20', '0', 'E8.3', '2', '0', null, '0', '0', 'E8_3_2_Камера.webm', '329', '-', '', '0');
INSERT INTO `dialogs` VALUES ('336', '1', '1', '10', '1', '4', '- Да у Денежной снега зимой не выпросишь, а тут деньги вне бюджета! Что же делать?', '20', '0', 'E8.3', '2', '1', null, '0', '0', 'E8_3_2_Камера.png', '330', '-', '', '0');
INSERT INTO `dialogs` VALUES ('337', '1', '1', '10', '1', '4', '- Семен, а у тебя наверняка в бюджете статейка есть на непредвиденные расходы. Это ведь форс-мажор?', '20', '0', 'E8.3', '2', '2', null, '0', '0', '', '331', '-', '', '0');
INSERT INTO `dialogs` VALUES ('338', '1', '1', '10', '1', '4', '- Понял тебя, скажу своему аналитику, чтобы срочно служебку писал.', '20', '0', 'E8.3', '2', '3', '38', '0', '0', '', '332', 'E8.5', '', '0');
INSERT INTO `dialogs` VALUES ('339', '10', '1', '1', '1', '4', '- У меня, конечно, были кое-какие средства заложены на форс-мажор, но только я их на продажи потратил - у них же в последнее время штат просто чудовищно вырос! И ладно бы заранее хоть как-то известили, а то все – по факту. Вынь им и положь компьютер за компьютером! Потому, друг мой, придется тебе своей дорогой начальнице все очень аргументировано изложить! И деньги – добыть! Другого выхода нет!', '20', '0', 'E8.3', '3', '0', null, '0', '0', 'E8_3_3_Камера.webm', '333', '-', '', '0');
INSERT INTO `dialogs` VALUES ('340', '1', '1', '10', '1', '4', '- Хорошо, сейчас вернусь и напишу служебку. Спасибо за информацию!', '20', '0', 'E8.3', '3', '1', '118', '0', '0', 'E8_3_3_Камера.png', '334', 'MS20', '', '0');
INSERT INTO `dialogs` VALUES ('341', '1', '1', '10', '1', '4', '- Я все понял. Запланирую подготовку служебки сегодня-завтра. Спасибо!', '20', '0', 'E8.3', '3', '2', '119', '0', '0', '', '335', 'P17', '', '0');
INSERT INTO `dialogs` VALUES ('342', '1', '1', '10', '1', '4', '- Понял тебя, скажу своему аналитику, чтобы срочно писал служебку. А тебе – спасибо, и за обед, и за информацию!', '20', '0', 'E8.3', '3', '3', '38', '0', '0', '', '336', 'E8.5', '', '0');
INSERT INTO `dialogs` VALUES ('343', '1', '1', '10', '1', '4', '- Да я уже написал! Но все равно спасибо огромное за предупреждение!', '20', '0', 'E8.3', '3', '4', '107', '0', '0', '', '337', 'T', '', '0');
INSERT INTO `dialogs` VALUES ('344', '3', '1', '1', '1', '2', '- Трутнев у аппарата.', '5', '0', 'E8.5', '1', '0', null, '0', '0', 'E8.5_1.wav', '338', '-', '', '0');
INSERT INTO `dialogs` VALUES ('345', '1', '1', '3', '1', '2', '- Сергей, нужна помощь! Возьми ручку и записывай. Готов?', '5', '0', 'E8.5', '1', '1', null, '0', '0', 'нет', '339', '-', '', '0');
INSERT INTO `dialogs` VALUES ('346', '1', '1', '3', '1', '2', '- Сергей, удобно тебе говорить?', '5', '0', 'E8.5', '1', '2', null, '0', '0', 'нет', '340', '-', '', '0');
INSERT INTO `dialogs` VALUES ('347', '1', '1', '3', '1', '2', '- Сергей, запиши задачу. Надо сделать срочно.', '5', '0', 'E8.5', '1', '3', null, '0', '0', 'нет', '341', '-', '', '0');
INSERT INTO `dialogs` VALUES ('348', '3', '1', '1', '1', '2', '- Не-а, на меня тут логисты наседают. Если я им через пять минут итоговый отчет не выгружу, они заявятся с демонстрацией и плакатами. А еще у нас завтра футбол корпоративный, и я не хочу, чтоб мне все ноги перебили – знаете, какие у них бугаи в команде? ха-ха-ха...', '5', '0', 'E8.5', '2', '0', null, '0', '0', 'E8.5_2.wav', '342', '-', '', '0');
INSERT INTO `dialogs` VALUES ('349', '1', '1', '3', '1', '2', '- Ну ладно, набери меня, когда освободишься', '5', '0', 'E8.5', '2', '1', '107', '0', '0', 'нет', '343', 'T', '???', '0');
INSERT INTO `dialogs` VALUES ('350', '1', '1', '3', '1', '2', '- Так, отложи в сторону своих логистов, мне всего пять твоих минут нужно.', '5', '0', 'E8.5', '2', '2', null, '0', '0', 'нет', '344', '-', '', '0');
INSERT INTO `dialogs` VALUES ('351', '1', '1', '3', '1', '2', '- Как всегда у тебя – сплошной аврал. Пять минут для руководителя найдешь?', '5', '0', 'E8.5', '2', '3', null, '0', '0', 'нет', '345', '-', '', '0');
INSERT INTO `dialogs` VALUES ('352', '3', '1', '1', '1', '2', '- Ну хорошо, слушаю. Вот… Ручку уже взял. Только мне сегодня домой надо вовремя.', '5', '0', 'E8.5', '3', '0', null, '0', '0', 'E8.5_3.wav', '346', '-', '', '0');
INSERT INTO `dialogs` VALUES ('353', '1', '1', '3', '1', '2', '- Я тебя не задержу. Надо написать служебку на имя Денежной на выделение средств за рамками бюджета на покупку нового сервера для отдела. Я тебе письмо от АйТишников перешлю – данные возьми оттуда.', '5', '0', 'E8.5', '3', '1', '120', '0', '0', 'нет', '347', 'MS27', '', '0');
INSERT INTO `dialogs` VALUES ('354', '1', '1', '3', '1', '2', '- Уйдешь, когда работу закончишь. Пиши: служебка на имя Денежной. Нам нужны деньги на сервер. Сломался. Форс-мажор. Далее – из письма от Железного, сейчас перешлю.', '5', '0', 'E8.5', '3', '2', '120', '0', '0', 'нет', '348', 'MS27', '', '0');
INSERT INTO `dialogs` VALUES ('355', '1', '1', '3', '1', '2', '- Так, пиши. Подготовить служебку на имя Денежной. Срочно. Деньги на сервер. В бюджете нет. Цена и характеристики сервера – в письме от Железного. Вопросы есть?', '5', '0', 'E8.5', '3', '3', null, '0', '0', 'нет', '349', '-', '', '0');
INSERT INTO `dialogs` VALUES ('356', '3', '1', '1', '1', '2', '- Есть…вот. А служебку-то кому слать – вам или Денежной?', '5', '0', 'E8.5', '4', '0', null, '0', '0', 'E8.5_4.wav', '350', '-', '', '0');
INSERT INTO `dialogs` VALUES ('357', '1', '1', '3', '1', '2', '- Шли мне. Я проверю. Еще вопросы?', '5', '0', 'E8.5', '4', '1', null, '0', '0', 'нет', '351', '-', '', '0');
INSERT INTO `dialogs` VALUES ('358', '1', '1', '3', '1', '2', '- Шли Денежной. Поставишь меня в копию. Еще вопросы есть?', '5', '0', 'E8.5', '4', '2', null, '0', '0', 'нет', '352', '-', '', '0');
INSERT INTO `dialogs` VALUES ('359', '3', '1', '1', '1', '2', '- А почему вы сами не напишете? Тут же делов-то на две минуты!', '5', '0', 'E8.5', '5', '0', null, '0', '0', 'E8.5_5.wav', '353', '-', '', '0');
INSERT INTO `dialogs` VALUES ('360', '1', '1', '3', '1', '2', '- Не учи меня, сам разберусь.', '5', '0', 'E8.5', '5', '1', '107', '0', '0', 'нет', '354', 'T', '', '0');
INSERT INTO `dialogs` VALUES ('361', '1', '1', '3', '1', '2', '- А ты иди - посиди за меня в этом кресле и поймешь.', '5', '0', 'E8.5', '5', '2', '107', '0', '0', 'нет', '355', 'T', '', '0');
INSERT INTO `dialogs` VALUES ('362', '1', '1', '3', '1', '2', '- Я занят. Если все эти мелкие вопросы делать самому – я тут ночевать буду.', '5', '0', 'E8.5', '5', '3', '107', '0', '0', 'нет', '356', 'T', '', '0');
INSERT INTO `dialogs` VALUES ('363', '11', '1', '1', '1', '1', 'звук телефонного звонка', '0', '0', 'ET9', '1', '0', null, '0', '0', '', '357', '-', '', '1');
INSERT INTO `dialogs` VALUES ('364', '1', '1', '11', '1', '1', 'Ответить', '0', '0', 'ET9', '1', '1', '40', '0', '0', '', '358', 'E9', '', '1');
INSERT INTO `dialogs` VALUES ('365', '1', '1', '11', '1', '1', 'Не ответить', '0', '0', 'ET9', '1', '2', '229', '0', '0', '', '359', 'S9', '', '1');
INSERT INTO `dialogs` VALUES ('366', '11', '1', '1', '1', '1', 'звук телефонного звонка', '5', '0', 'S9', '1', '0', null, '0', '0', '', '807', '-', '', '1');
INSERT INTO `dialogs` VALUES ('367', '1', '1', '11', '1', '1', 'Ответить', '0', '0', 'S9', '1', '1', '40', '0', '0', '', '808', 'E9', '', '1');
INSERT INTO `dialogs` VALUES ('368', '1', '1', '11', '1', '1', 'Не ответить', '0', '0', 'S9', '1', '2', '17', '0', '0', '', '809', 'S2', 'F1', '1');
INSERT INTO `dialogs` VALUES ('369', '11', '1', '1', '1', '1', 'звук телефонного звонка', '0', '0', 'S9.1', '1', '0', null, '0', '0', '', '812', '-', '', '1');
INSERT INTO `dialogs` VALUES ('370', '1', '1', '11', '1', '1', 'Ответить', '0', '0', 'S9.1', '1', '1', '40', '0', '0', '', '813', 'E9', '', '1');
INSERT INTO `dialogs` VALUES ('371', '11', '1', '1', '1', '2', '- Господи, как же хорошо, что я вас застал!. Я тут прямо извелся с этим бюджетом. Знаете, что это такое – собрать данные по двум сотням поставщиков? То у них старые цены, то новые, то такая тара, то другая. Алло?', '0', '0', 'E9', '1', '0', null, '0', '0', 'E9_1.wav', '360', '-', '', '1');
INSERT INTO `dialogs` VALUES ('372', '1', '1', '11', '1', '2', '- Василий, вопрос в чем?', '0', '0', 'E9', '1', '1', null, '0', '0', 'нет', '361', '-', '', '1');
INSERT INTO `dialogs` VALUES ('373', '1', '1', '11', '1', '2', '- Да-да, я слушаю.', '0', '0', 'E9', '1', '2', null, '0', '0', 'нет', '362', '-', '', '1');
INSERT INTO `dialogs` VALUES ('374', '11', '1', '1', '1', '2', '- Понимаете, какое дело… Бюджетная пора, такая нервотрепка! У меня, знаете ли, десять сотрудников данные собирают. А я же все потом сам выверяю, чтоб до копеечки. Да мы обычно и не ошибаемся никогда! Так что тут не в нас дело…', '0', '0', 'E9', '2', '0', null, '0', '0', 'E9_2.wav', '363', '-', '', '1');
INSERT INTO `dialogs` VALUES ('375', '1', '1', '11', '1', '2', '- Василий, я-то при чем?', '0', '0', 'E9', '2', '1', null, '0', '0', 'нет', '364', '-', '', '1');
INSERT INTO `dialogs` VALUES ('376', '1', '1', '11', '1', '2', '- Василий, прошу прощения, у меня очень плохо со временем, давайте в другой раз.', '0', '0', 'E9', '2', '2', null, '0', '0', 'нет', '365', '-', '', '1');
INSERT INTO `dialogs` VALUES ('377', '1', '1', '11', '1', '2', '- Василий, давайте ближе к делу!', '0', '0', 'E9', '2', '3', null, '0', '0', 'нет', '366', '-', '', '1');
INSERT INTO `dialogs` VALUES ('378', '11', '1', '1', '1', '2', '- Так я про то и говорю. Можно досказать? Непросто тут все. Без деталей не разберешься. Так вот, есть у меня один поставщик, вообще-то хороший, работаем мы с ним лет пять, а может и больше. Лет шесть, наверное. Он тут неподалеку располагается. Нам и по логистике выгодно – мы прямо от него материалы возим. И объемы на нем приличные. Не шантрапа какая: сегодня есть – завтра нет. Только вот, у них сокращения, людям зарплату снижают. Знаете же, как сейчас не просто в отрасли. Лишних средств ни у кого ведь нету. Вот и у них в продажах - сплошной молодняк. Студентики вчерашние. Они же счет-фактуру от прайс-листа не отличают. И нас ведет такой же. Нет, он старается, конечно, ничего не могу сказать, да и не дурак, только неопытный…', '0', '0', 'E9', '3', '0', null, '0', '0', 'E9_3.wav', '367', '-', '', '1');
INSERT INTO `dialogs` VALUES ('379', '1', '1', '11', '1', '2', '- Кхе-кхе…', '0', '0', 'E9', '3', '1', null, '0', '0', 'нет', '368', '-', '', '1');
INSERT INTO `dialogs` VALUES ('380', '1', '1', '11', '1', '2', '- Все, больше терпения нет. У меня работа горит!', '0', '0', 'E9', '3', '2', null, '0', '0', 'нет', '369', '-', '', '1');
INSERT INTO `dialogs` VALUES ('381', '1', '1', '11', '1', '2', '- Василий, так какое у вас ко мне дело?', '0', '0', 'E9', '3', '3', null, '0', '0', 'нет', '370', '-', '', '1');
INSERT INTO `dialogs` VALUES ('382', '11', '1', '1', '1', '2', '- Но вы же, если все не объяснить, меня винить будете! Нет, ну я, конечно, с себя-то вины не снимаю. Но тут обстоятельства! Сплелось все так. Я пока понял – время и ушло. Это хорошо еще, что кинулись – смотрим, а рост затрат на материалы как-то не вяжется с нашими ожиданиями, давай раскручивать – почему так. Оказывается этот юный продавец, ну я вам о нем говорил, на наш запрос текущую цену дал. А у них цена год от года растет – инфляция, она везде, знаете, щупальца… Прямо страшно иногда делается. Десять лет назад копейку стоило – теперь все три рубля. Куда это годится? Так вот он, этот парнишка, и не понял, что мы перспективные цены запрашиваем. А может и наш закупщик напортачил – пойди, разберись теперь.', '0', '0', 'E9', '4', '0', null, '0', '0', 'E9_4.wav', '371', '-', '', '1');
INSERT INTO `dialogs` VALUES ('383', '1', '1', '11', '1', '2', '- А я-то тут при чем?', '0', '0', 'E9', '4', '1', null, '0', '0', 'нет', '372', '-', '', '1');
INSERT INTO `dialogs` VALUES ('384', '1', '1', '11', '1', '2', '- Василий, прошу прощения, вы к чему все это рассказываете?', '0', '0', 'E9', '4', '2', null, '0', '0', 'нет', '373', '-', '', '1');
INSERT INTO `dialogs` VALUES ('385', '1', '1', '11', '1', '2', '- Послушайте, нет у меня времени слушать все эти истории! Мне работать надо!', '0', '0', 'E9', '4', '3', null, '0', '0', 'нет', '374', '-', '', '1');
INSERT INTO `dialogs` VALUES ('386', '11', '1', '1', '1', '2', '- Так это же ваша работа – бюджеты собирать! А тут такое дело…Ну, в общем, каюсь, я вам прошлые цифры отправил неправильные. Даже и не знаю теперь, сколько вам придется переделывать – у нас ведь все затраты поехали. Честное слово, это недоразумение какое-то. Я вам файлик-то новый уже послал. Уж вы не ругайтесь!', '0', '0', 'E9', '5', '0', '121', '0', '0', 'E9_5.wav', '375', 'M56', '', '1');
INSERT INTO `dialogs` VALUES ('387', '1', '1', '11', '1', '2', '- Как новый файл? Да вы что? У меня все сроки истекли. Нет, звоните Денежной – как она решит, так и будет!', '0', '0', 'E9', '5', '1', '122', '0', '0', 'нет', '376', 'M12', '???', '1');
INSERT INTO `dialogs` VALUES ('388', '1', '1', '11', '1', '2', '- Не могу вам помочь, Василий. По регламенту сроки сдачи бюджета истекли. Теперь только через Генерального директора. Ничего личного, извините.', '0', '0', 'E9', '5', '2', '107', '0', '0', 'нет', '377', 'T', '', '1');
INSERT INTO `dialogs` VALUES ('389', '1', '1', '11', '1', '2', '- Та-а-ак, и что же в вашем бюджете изменилось?', '0', '0', 'E9', '5', '3', null, '0', '0', 'нет', '378', '-', '', '1');
INSERT INTO `dialogs` VALUES ('390', '11', '1', '1', '1', '2', '- Да все наши затраты поползли! Хоть и маленько – но ведь старую-то цифру не оставишь. Где потом денег на закупку брать? Да вы не волнуйтесь – файлик-то посмотрите, там, если чего надо, я быстро поясню – меня теперь среди ночи разбуди, я все цифры помню. Кхы…кхы. Так вы, это… Новую версию принимаете? В общий бюджет она попадет?', '0', '0', 'E9', '6', '0', null, '0', '0', 'E9_6.wav', '379', '-', '', '1');
INSERT INTO `dialogs` VALUES ('391', '1', '1', '11', '1', '2', '- Честно говоря, не знаю. У меня ведь сроки. Вот что, Василий, звоните Денежной. Если она мне время даст – я сделаю.', '0', '0', 'E9', '6', '1', '122', '0', '0', 'нет', '380', 'M12', '???', '1');
INSERT INTO `dialogs` VALUES ('392', '1', '1', '11', '1', '2', '- Принимаю, что же с вами делать. Сейчас посмотрю и внесу изменения.', '0', '0', 'E9', '6', '2', '121', '0', '0', 'нет', '381', 'M56', '', '1');
INSERT INTO `dialogs` VALUES ('393', '1', '1', '11', '1', '2', '- Я сейчас посмотрю ваш файл и запланирую изменения, надеюсь, что успею до отпуска. У меня очень напряженные дни.', '0', '0', 'E9', '6', '3', '123', '0', '0', 'нет', '382', 'P18', '', '1');
