INSERT INTO `dialogs` VALUES ('400', '11', '1', '1', '1', '2', '- День добрый! Слышал, вы в отпуск собираетесь? Есть же счастливые люди на свете, я в отпуске два года не был. Жена запилила совсем! Просьба у меня небольшая. Я тут бюджет прошлогодний в последней версии найти не могу, очень нужен. Динамику затрат проверить. Может, перешлете?', '0', '0', 'E10', '1', '0', null, '0', '0', 'E10_1.wav', '386', '-', '', '1');
