INSERT INTO `dialogs` VALUES ('403', '1', '1', '11', '1', '2', '- Послушайте, у вас точно должна быть эта версия, вы же ее и готовили – ищите у себя!', '0', '0', 'E10', '1', '3', null, '0', '0', 'нет', '389', '-', '', '1');
