INSERT INTO `dialogs` VALUES ('408', '2', '2', '1', '1', '2', '- Это невыносимо! В твоем отчете для Правления снова ошибка! Твой уровень внимательности явно не соответствует твоей позиции! Открой еще раз тот файл, что ты мне прислал! Там же одна цифра настолько очевидно выбивается из общей тенденции по продажам, что это даже студент заметит! Как можно отправлять такие документы? Ты их, что, перед отправкой не просматриваешь?', '10', '0', 'E11', '1', '0', null, '0', '0', 'E11_1.wav', '394', '-', '', '0');
INSERT INTO `dialogs` VALUES ('409', '1', '1', '2', '1', '2', '- Раиса Романовна, файл готовил не я, а Трутнев. Я непременно проверю в следующий раз.', '10', '0', 'E11', '1', '1', null, '0', '0', 'нет', '395', '-', '', '0');
INSERT INTO `dialogs` VALUES ('410', '1', '1', '2', '1', '2', '- Раиса Романовна, приношу извинения. Впредь такого не будет.', '10', '0', 'E11', '1', '2', null, '0', '0', 'нет', '396', '-', '', '0');
INSERT INTO `dialogs` VALUES ('411', '2', '1', '1', '1', '2', '- А ты не задумывался, что следующего раза может не быть? Я хочу себя чувствовать за твоей спиной как за стеной – все данные должны быть железобетонными, аргументы и логика – железными. А вместо этого что? Сплошная сейсмическая зона, никогда не знаешь, где в следующий раз тряхнет. Срочно поправь, жду обновления.', '10', '0', 'E11', '2', '0', null, '0', '0', 'E11_2.wav', '397', '-', '', '0');
INSERT INTO `dialogs` VALUES ('412', '1', '1', '2', '1', '2', '- Слушаюсь, Раиса Романовна, сейчас сделаю.', '10', '0', 'E11', '2', '1', '126', '0', '0', 'нет', '398', 'MS10', '', '0');
