INSERT INTO `dialogs` VALUES ('421', '7', '1', '1', '1', '2', '- Валерий Семенович просит прямо сейчас переслать ему презентацию. Он хочет ее заранее посмотреть. Говорит, что если будет столько же ошибок, как и в прошлом году, он и принимать вас сегодня не будет – вернет на доработку. Шлите прямо ему на почту.', '0', '0', 'ET12.2', '1', '0', null, '0', '0', 'ET12.2_1.wav', '407', '-', '', '1');
INSERT INTO `dialogs` VALUES ('422', '1', '1', '7', '1', '2', '- Нет у меня никакой презентации. У Крутько спрашивайте. Она обещала, а не сделала.', '0', '0', 'ET12.2', '1', '1', '107', '0', '0', 'нет', '408', 'T', '???', '1');
