INSERT INTO `dialogs` VALUES ('425', '1', '1', '7', '1', '2', '- Да в прошлом году презентацию делал аналитик, которого я давно уволил. Так и будут мне этот прошлый год вспоминать всю жизнь! Сейчас перешлю.', '0', '0', 'ET12.2', '1', '3', '48', '0', '0', 'нет', '411', 'ET12.3', 'MS25', '1');
INSERT INTO `dialogs` VALUES ('426', '1', '1', '7', '1', '2', '- Да в прошлом году презентацию делал аналитик, которого я давно уволил. Так и будут мне этот прошлый год вспоминать всю жизнь! Сейчас перешлю.', '0', '0', 'ET12.2', '1', '3', '47', '0', '0', 'нет', '412', 'E12.6', 'MS25', '1');
INSERT INTO `dialogs` VALUES ('427', '7', '1', '1', '1', '2', '- Валерий Семенович сказал, что презентация не готова! Еще хуже прошлогодней. Он очень расстроен. Требует доработки к завтрашнему утру. Хочет видеть ее в 10.00', '10', '0', 'E12.6', '1', '0', null, '0', '0', 'E12.6_1.wav', '413', '-', '', '1');
INSERT INTO `dialogs` VALUES ('428', '1', '1', '7', '1', '2', '- А чего там дорабатывать? Все, что мог, я уже сделал. Все прошлые замечания учел.', '0', '0', 'E12.6', '1', '1', null, '0', '0', 'нет', '414', '-', '', '1');
INSERT INTO `dialogs` VALUES ('429', '1', '1', '7', '1', '2', '- Знаете, это мой аналитик делала. Она еще не очень опытная. Что ей исправить?', '0', '0', 'E12.6', '1', '2', null, '0', '0', 'нет', '415', '-', '', '1');
INSERT INTO `dialogs` VALUES ('430', '1', '1', '7', '1', '2', '- Хорошо, доработаю. Что именно?', '0', '0', 'E12.6', '1', '3', null, '0', '0', 'нет', '416', '-', '', '1');
INSERT INTO `dialogs` VALUES ('431', '7', '1', '1', '1', '2', '- Этого я не знаю. Передаю только то, что просили. Можете ему позвонить или написать для уточнения. Но лучше не сейчас – настроение у него ужасное!', '0', '0', 'E12.6', '2', '0', '107', '0', '0', 'E12.6_2.wav', '417', 'T', '', '1');
