INSERT INTO `dialogs` VALUES ('435', '7', '1', '1', '1', '2', '- Ваша встреча переносится с 16.00 на 18.00. У Генерального директора незапланированный посетитель. Клиент.', '0', '0', 'E12', '1', '0', null, '0', '0', 'E12_1.wav', '421', '-', '', '1');
INSERT INTO `dialogs` VALUES ('436', '1', '1', '7', '1', '2', '- Как же так! Он же сам настаивал! Согласуйте этот перенос с моим руководителем, пожалуйста.', '0', '0', 'E12', '1', '1', '54', '0', '0', 'нет', '422', 'ST12.3', '', '1');
INSERT INTO `dialogs` VALUES ('437', '1', '1', '7', '1', '2', '- Хорошо, сейчас внесу в план новое время.', '0', '0', 'E12', '1', '2', '51', '0', '0', 'нет', '423', 'E12.4', '!!!', '1');
INSERT INTO `dialogs` VALUES ('438', '1', '1', '7', '1', '2', '- Я вас очень прошу, найдите сегодня любое время до 18.00, или, может, завтра в течение дня? Я не могу быть сегодня в 18.00', '0', '0', 'E12', '1', '3', null, '0', '0', 'нет', '424', '-', '', '1');
