INSERT INTO `dialogs` VALUES ('440', '7', '1', '1', '1', '2', '- Нет, Босс завтра на выезде. Либо сегодня в 18.00, либо понедельник, пока любое время.', '5', '0', 'E12.1', '1', '0', null, '0', '0', 'E12.1_1.wav', '426', '-', '', '1');
INSERT INTO `dialogs` VALUES ('441', '1', '1', '7', '1', '2', '- Но я с понедельника в отпуске! Разве что Крутько прислать? Подскажите, это принципиально, чтобы с пояснениями явился я?', '0', '0', 'E12.1', '1', '1', null, '0', '0', 'нет', '427', '-', '', '1');
INSERT INTO `dialogs` VALUES ('442', '1', '1', '7', '1', '2', '- Может мой аналитик подойти вместо меня?', '0', '0', 'E12.1', '1', '2', null, '0', '0', 'нет', '428', '-', '', '1');
INSERT INTO `dialogs` VALUES ('443', '7', '1', '1', '1', '2', '- Нам все равно, если человек в состоянии дать комментарии и доделать презентацию. Так что вы решаете?', '0', '0', 'E12.1', '2', '0', null, '0', '0', 'E12.1_2.wav', '429', '-', '', '1');
