INSERT INTO `dialogs` VALUES ('445', '1', '1', '7', '1', '2', '- В понедельник, скажем в 10.00, будет моя сотрудница Марина Крутько.', '0', '0', 'E12.1', '2', '2', '52', '0', '0', 'нет', '431', 'E12.5', '', '1');
INSERT INTO `dialogs` VALUES ('446', '7', '1', '1', '1', '2', '- Клиент ушел также внезапно как и появился. Считайте, что вам повезло. Берите презентацию и бегом к Боссу. У него есть 20 минут.', '15', '0', 'E12.4', '1', '0', null, '0', '0', 'E12.4_1.wav', '432', '-', '', '1');
INSERT INTO `dialogs` VALUES ('447', '1', '1', '7', '1', '2', '- Давайте в 18.00, как договорились, я уже успел поменять мой график.', '0', '0', 'E12.4', '1', '1', null, '0', '0', 'нет', '433', '-', '', '1');
INSERT INTO `dialogs` VALUES ('448', '1', '1', '7', '1', '2', '- Действительно, повезло! Уже бегу!', '0', '0', 'E12.4', '1', '2', '53', '0', '0', 'нет', '434', 'ET12.4', '', '1');
INSERT INTO `dialogs` VALUES ('449', '7', '1', '1', '1', '2', '- Это не ко мне. Босс требует быть. Прошу явиться незамедлительно.', '0', '0', 'E12.4', '2', '0', '53', '0', '0', 'E12.4_2.wav', '435', 'ET12.4', '', '1');
INSERT INTO `dialogs` VALUES ('450', '7', '1', '1', '1', '2', '- Клиент ушел также внезапно как и появился. Считайте, что вам повезло. Берите презентацию и бегом к Боссу. У него есть 20 минут.', '15', '0', 'E12.5', '1', '0', null, '0', '0', 'E12.5_1.wav', '436', '-', '', '1');
INSERT INTO `dialogs` VALUES ('451', '1', '1', '7', '1', '2', '- Но мы ведь уже договорились, и я успел поменять мой график. Крутько придет в понедельник!', '0', '0', 'E12.5', '1', '1', null, '0', '0', 'нет', '437', '-', '', '1');
INSERT INTO `dialogs` VALUES ('452', '1', '1', '7', '1', '2', '- Действительно, повезло! Уже бегу!', '0', '0', 'E12.5', '1', '2', '53', '0', '0', 'нет', '438', 'ET12.4', '', '1');
INSERT INTO `dialogs` VALUES ('453', '7', '1', '1', '1', '2', '- Хмм.. Ну, вам решать.', '0', '0', 'E12.5', '2', '0', '107', '0', '0', 'E12.5_2.wav', '439', 'T', '', '1');
INSERT INTO `dialogs` VALUES ('454', '1', '1', '6', '1', '4', '- Кхе-кхе…', '0', '0', 'ET12.4', '1', '1', null, '0', '0', 'ET12_4_2_Камера.png', '440', '-', '', '1');
INSERT INTO `dialogs` VALUES ('455', '1', '1', '6', '1', '4', '- Добрый день, Валерий Семенович!', '0', '0', 'ET12.4', '1', '2', null, '0', '0', '', '441', '-', '', '1');
INSERT INTO `dialogs` VALUES ('456', '1', '1', '6', '1', '4', '- Ну как?', '0', '0', 'ET12.4', '1', '3', null, '0', '0', '', '442', '-', '', '1');
INSERT INTO `dialogs` VALUES ('457', '6', '1', '1', '1', '4', '- Что, ты сам-то доволен?', '0', '0', 'ET12.4', '2', '0', null, '0', '0', 'ET12_4_2_Камера.webm', '443', '-', '', '1');
INSERT INTO `dialogs` VALUES ('458', '1', '1', '6', '1', '4', '- Да, доволен', '0', '0', 'ET12.4', '2', '1', null, '0', '0', 'ET12_4_2_Камера.png', '444', '-', '', '1');
INSERT INTO `dialogs` VALUES ('459', '1', '1', '6', '1', '4', '- В этот раз точно лучше, чем в прошлый. Я ведь того аналитика уволил.', '0', '0', 'ET12.4', '2', '2', null, '0', '0', '', '445', '-', '', '1');
INSERT INTO `dialogs` VALUES ('460', '1', '1', '6', '1', '4', '- Есть, конечно, что еще улучшить. Но в целом неплохо, как Вы считаете?', '0', '0', 'ET12.4', '2', '3', null, '0', '0', '', '446', '-', '', '1');
INSERT INTO `dialogs` VALUES ('461', '6', '1', '1', '1', '4', '- Прошлая ваша презентация заставила меня краснеть. Мало того, что люди половины графиков не поняли, так еще и ошибки в цифрах… Было очень неприятно!', '0', '0', 'ET12.4', '3', '0', null, '0', '0', 'ET12_4_3_Камера.webm', '447', '-', '', '1');
INSERT INTO `dialogs` VALUES ('462', '1', '1', '6', '1', '4', '- Валерий Семенович, в прошлый раз презентацию делал аналитик, который у нас уже не работает. Ваша презентация была не единственным его промахом.', '0', '0', 'ET12.4', '3', '1', null, '0', '0', 'ET12_4_3_Камера.png', '448', '-', '', '1');
INSERT INTO `dialogs` VALUES ('463', '1', '1', '6', '1', '4', '- Валерий Семенович, мы все ваши замечания учли. Очень старались. В этот раз таких проблем возникнуть не должно.', '0', '0', 'ET12.4', '3', '2', null, '0', '0', '', '449', '-', '', '1');
INSERT INTO `dialogs` VALUES ('464', '1', '1', '6', '1', '4', '- Валерий Семенович, я вам гарантирую, что в этой презентации все верно и выверено.', '0', '0', 'ET12.4', '3', '3', null, '0', '0', '', '450', '-', '', '1');
INSERT INTO `dialogs` VALUES ('465', '6', '1', '1', '1', '4', '- Да. В этот раз лучше. Должен признать. Мне не очень нравятся цвета, которые вы выбрали…', '0', '0', 'ET12.4', '4', '0', null, '0', '0', 'ET12_4_4_Камера.webm', '451', '-', '', '1');
INSERT INTO `dialogs` VALUES ('466', '1', '1', '6', '1', '4', '- Это наши корпоративные цвета.', '0', '0', 'ET12.4', '4', '1', null, '0', '0', 'ET12_4_4_Камера.png', '452', '-', '', '1');
INSERT INTO `dialogs` VALUES ('467', '1', '1', '6', '1', '4', '- Цветовая гамма – это не проблема. Вам какой больше цвет нравится?', '0', '0', 'ET12.4', '4', '2', null, '0', '0', '', '453', '-', '', '1');
INSERT INTO `dialogs` VALUES ('468', '6', '1', '1', '1', '4', '- Хотя…Это ведь наши корпоративные цвета. Оставь как есть. Ты сам делал, что ли?', '0', '0', 'ET12.4', '5', '0', null, '0', '0', 'ET12_4_5_Камера.webm', '454', '-', '', '1');
INSERT INTO `dialogs` VALUES ('469', '1', '1', '6', '1', '4', '- Мы вместе с сотрудниками. Они готовили – я проверял.', '0', '0', 'ET12.4', '5', '1', null, '0', '0', 'ET12_4_5_Камера.png', '455', '-', '', '1');
INSERT INTO `dialogs` VALUES ('470', '1', '1', '6', '1', '4', '- Нет, работу делала Марина Крутько. Я проверял, конечно.', '0', '0', 'ET12.4', '5', '2', null, '0', '0', '', '456', '-', '', '1');
INSERT INTO `dialogs` VALUES ('471', '1', '1', '6', '1', '4', '- Да, сам. Это ведь высший приоритет. Особенно после прошлого года.', '0', '0', 'ET12.4', '5', '3', null, '0', '0', '', '457', '-', '', '1');
INSERT INTO `dialogs` VALUES ('472', '6', '1', '1', '1', '4', '- Ну что же, уважил. Запомню. Вот еще что – добавьте побольше фотографий – народ любит! Можешь идти. Спроси у секретаря, к какому числу и сколько копий. Да, и не скупитесь – сделайте в цвете.', '0', '0', 'ET12.4', '6', '0', null, '0', '0', 'ET12_4_6_Камера.webm', '458', '-', '', '1');
INSERT INTO `dialogs` VALUES ('473', '1', '1', '6', '1', '4', '- Валерий Семенович, а можно вопрос не по теме? Моему отделу давно зарплату не повышали, мы в следующем году можем рассчитывать?', '0', '0', 'ET12.4', '6', '1', null, '0', '0', 'ET12_4_6_Камера.png', '459', '-', '', '1');
INSERT INTO `dialogs` VALUES ('474', '1', '1', '6', '1', '4', '- Правильно я понял, в презентации оставляем все как есть, добавляем фото, печатаем в цвете? Количество и дату уточнить у секретаря! Всего доброго!', '0', '0', 'ET12.4', '6', '2', '107', '0', '0', '', '460', 'T', '', '1');
INSERT INTO `dialogs` VALUES ('475', '1', '1', '6', '1', '4', '- Хорошего вам выступления, Валерий Семенович! В этом году краснеть не придется!', '0', '0', 'ET12.4', '6', '3', '107', '0', '0', '', '461', 'T', '', '1');
INSERT INTO `dialogs` VALUES ('476', '6', '1', '1', '1', '4', '- Иди-иди, с такими вопросами – к твоему руководителю! Она у нас деньгами распоряжается.', '0', '0', 'ET12.4', '7', '0', '107', '0', '0', 'ET12_4_7_Камера.webm', '462', 'T', '', '1');
INSERT INTO `dialogs` VALUES ('477', '2', '1', '1', '1', '1', 'звук телефонного звонка', '5', '0', 'ST12.3', '1', '0', null, '0', '0', '', '463', '-', '', '1');
INSERT INTO `dialogs` VALUES ('478', '1', '1', '2', '1', '1', 'Ответить', '0', '0', 'ST12.3', '1', '1', '55', '0', '0', '', '464', 'S12.3', '', '1');
INSERT INTO `dialogs` VALUES ('479', '1', '1', '2', '1', '1', 'Не ответить', '0', '0', 'ST12.3', '1', '2', '107', '0', '0', '', '465', 'T', '', '1');
INSERT INTO `dialogs` VALUES ('480', '2', '1', '1', '1', '2', '- Ты зачем это секретаря Босса ко мне направил? Или тебе снова хочется выслушивать мои речи по поводу приоритетов? Отлично! Повторяю: все, что касается Босса, есть первейший и безусловный приоритет. Захочет ночью встретиться – будешь встречаться ночью. Теперь это окончательно ясно? И не смей свои вопросы на меня вешать, я загружена много больше твоего.', '0', '0', 'S12.3', '1', '0', '50', '0', '0', 'S12.3_1.wav', '466', 'E12.1', '', '1');
INSERT INTO `dialogs` VALUES ('481', '4', '1', '1', '1', '5', 'стук в дверь', '0', '0', 'ET13', '1', '0', null, '0', '0', '', '467', '-', '', '0');
INSERT INTO `dialogs` VALUES ('482', '1', '1', '4', '1', '5', 'впустить', '0', '0', 'ET13', '1', '1', '57', '0', '0', '', '468', 'E13', '', '0');
INSERT INTO `dialogs` VALUES ('483', '1', '1', '4', '1', '5', 'не впустить', '0', '0', 'ET13', '1', '2', '107', '0', '0', '', '469', 'T', '', '0');
INSERT INTO `dialogs` VALUES ('484', '1', '1', '4', '1', '4', '- Марина, что у тебя, только быстро – я на совещание опаздываю.', '30', '0', 'E13', '1', '1', null, '0', '0', 'E13_2_Камера.png', '470', '-', '', '0');
INSERT INTO `dialogs` VALUES ('485', '1', '1', '4', '1', '4', '- Марина, могу я чем-то помочь?', '30', '0', 'E13', '1', '2', null, '0', '0', '', '471', '-', '', '0');
INSERT INTO `dialogs` VALUES ('486', '4', '1', '1', '1', '4', '- Я немного времени у вас отниму. Я долго думала, и это решение далось мне не просто. Но если я не сделаю этот шаг, то в моей жизни ничего не поменяется.', '30', '0', 'E13', '2', '0', null, '0', '0', 'E13_2_Камера.webm', '472', '-', '', '0');
INSERT INTO `dialogs` VALUES ('487', '1', '1', '4', '1', '4', '- Кхе….кхе…', '30', '0', 'E13', '2', '1', null, '0', '0', 'E13_2_Камера.png', '473', '-', '', '0');
INSERT INTO `dialogs` VALUES ('488', '1', '1', '4', '1', '4', '- Марина, а мы можем о твоих размышлениях поговорить в другой раз?', '30', '0', 'E13', '2', '2', null, '0', '0', '', '474', '-', '', '0');
INSERT INTO `dialogs` VALUES ('489', '1', '1', '4', '1', '4', '- А что именно должно поменяться и почему?', '30', '0', 'E13', '2', '3', null, '0', '0', '', '475', '-', '', '0');
INSERT INTO `dialogs` VALUES ('490', '4', '1', '1', '1', '4', '- Я решила оставить эту работу. Даже не смотря на то, что работаю здесь всего год. Это, конечно, не самая красивая картина для резюме, но еще хуже – оставаться здесь и не развиваться.', '30', '0', 'E13', '3', '0', null, '0', '0', 'E13_3_Камера.webm', '476', '-', '???', '0');
INSERT INTO `dialogs` VALUES ('491', '1', '1', '4', '1', '4', '- Вот это новость! Ты, наверное, устала. Я понимаю, что бюджетная пора не из легких. Потому давай мы все обсудим после моего отпуска. Ты пока остынешь, отдохнешь и поразмыслишь как следует. Извини, мне на совещание.', '30', '0', 'E13', '3', '1', '107', '0', '0', 'E13_3_Камера.png', '477', 'T', 'CS3', '0');
INSERT INTO `dialogs` VALUES ('492', '1', '1', '4', '1', '4', '- Да, это серьезный разговор. На ходу такие вещи не обсуждаются. Давай запланируем встречу на завтра и все обстоятельно обсудим, а сейчас мне надо бежать.', '30', '0', 'E13', '3', '2', '107', '0', '0', '', '478', 'T', 'CS3', '0');
INSERT INTO `dialogs` VALUES ('493', '1', '1', '4', '1', '4', '- Что же именно привело тебя к такому решению?', '30', '0', 'E13', '3', '3', null, '0', '0', '', '479', '-', '', '0');
INSERT INTO `dialogs` VALUES ('494', '4', '1', '1', '1', '4', '- Причина не одна – их много. С одной я бы как-нибудь справилась. А потому стоит ли об этом говорить? Ведь все эти причины все равно не исправишь. Да и решение я уже приняла.', '30', '0', 'E13', '4', '0', null, '0', '0', 'E13_4_Камера.webm', '480', '-', '', '0');
INSERT INTO `dialogs` VALUES ('495', '1', '1', '4', '1', '4', '- Ну что же, если решение окончательное, то не стоит терять время. Мне очень жаль. Пойду – еще успею на совещание.', '30', '0', 'E13', '4', '1', '107', '0', '0', 'E13_4_Камера.png', '481', 'T', 'CS3', '0');
INSERT INTO `dialogs` VALUES ('496', '1', '1', '4', '1', '4', '- Я уважаю твое решение, но мне важно знать, что именно на него повлияло.', '30', '0', 'E13', '4', '2', null, '0', '0', '', '482', '-', '', '0');
INSERT INTO `dialogs` VALUES ('497', '1', '1', '4', '1', '4', '- Да брось, Марина, мы ведь работаем бок о бок целый год. Все, конечно, бывает, но мы двигаемся, работа интересная, ты на хорошем счету, чего еще не хватает?', '30', '0', 'E13', '4', '3', null, '0', '0', '', '483', '-', '', '0');
INSERT INTO `dialogs` VALUES ('498', '4', '1', '1', '1', '4', '- Ладно, только не обижайтесь. Основная причина – в вас. Я привыкла работать с руководителем, у которого есть чему научиться, который ведет меня вперед. Такой руководитель ставит новые интересные задачи, ты сначала боишься, потом преодолеваешь себя, выполняешь и развиваешься. А здесь – что нового и интересного я сделала за этот год? Презентации? Бюджеты подразделений? Этой компании не нужны сильные аналитики, я сделала глупость, что ушла в производственный сектор из консалтинга. Здесь я и половины своих умений не использую, а уж про наработку новых и говорить не приходится!', '30', '0', 'E13', '5', '0', null, '0', '0', 'E13_5_Камера.webm', '484', '-', '', '0');
INSERT INTO `dialogs` VALUES ('499', '1', '1', '4', '1', '4', '- Послушай, тебя никто не заставлял приходить в нашу компанию, чего уж теперь меня винить? Давай остановимся на этом, чтобы сохранить нормальные отношения. Надеюсь, ты понимаешь, две недели-то все равно придется отработать. Вернемся к этому завтра, а сейчас - за работу.', '30', '0', 'E13', '5', '1', '107', '0', '0', 'E13_5_Камера.png', '485', 'T', '', '0');
INSERT INTO `dialogs` VALUES ('500', '1', '1', '4', '1', '4', '- Так причина все-таки во мне, в компании или типе задач?', '30', '0', 'E13', '5', '2', null, '0', '0', '', '486', '-', '', '0');
INSERT INTO `dialogs` VALUES ('501', '1', '1', '4', '1', '4', '- Да, проблема серьезная. Я начинаю понимать, почему ты такая замкнутая, отстраненная. Очень жаль, изменить род задач я не могу… Но я подумаю о твоих словах… Побегу – еще успею на совещание', '30', '0', 'E13', '5', '3', '107', '0', '0', '', '487', 'T', 'CS3', '0');
INSERT INTO `dialogs` VALUES ('502', '4', '1', '1', '1', '4', '- Причина в задачах… Да и рынок, и вы… Я не знаю! Мне только совсем неинтересно ходить на работу. Просыпаюсь каждый день, и заставляю себя тащиться в офис.', '30', '0', 'E13', '6', '0', null, '0', '0', 'E13_6_Камера.webm', '488', '-', '', '0');
INSERT INTO `dialogs` VALUES ('503', '1', '1', '4', '1', '4', '- Ну вот видишь… Ты и сама не знаешь. Разве можно в такой ситуации принимать решения? Ты вот про резюме вспоминала, а что ты будешь рассказывать своему новому работодателю? Что ошиблась? Понравится ему это? Давай-ка годик еще потрудись – а там и решишь, спешки нет никакой.', '30', '0', 'E13', '6', '1', '107', '0', '0', 'E13_6_Камера.png', '489', 'T', '', '0');
INSERT INTO `dialogs` VALUES ('504', '1', '1', '4', '1', '4', '- А ты можешь рассказать подробнее, какие задачи для тебя интересны? Что вызывает желание работать?', '30', '0', 'E13', '6', '2', null, '0', '0', '', '490', '-', '', '0');
INSERT INTO `dialogs` VALUES ('505', '1', '1', '4', '1', '4', '- Интересно – не интересно… Человек сам делает свою работу интересной. Все зависит от твоего настроя. Вот ты себя настроила, что неинтересно – и теперь мучаешься. А ты попробуй по-другому. Я тебе помогу, буду задачи давать другие. Давай я из отпуска вернусь, и обсудим еще раз. Хорошо?', '30', '0', 'E13', '6', '3', '107', '0', '0', '', '491', 'T', '', '0');
INSERT INTO `dialogs` VALUES ('506', '4', '1', '1', '1', '4', '- Мне очень важно, чтобы это был вызов моим способностям. Чтобы в самом начале я даже побаивалась задачи и думала, что не справлюсь. А потом шаг за шагом подбиралась к решению. Еще важно, чтобы было с кем посоветоваться, чтобы был какой-то авторитет, который, может, знает и не больше моего, но умеет думать. Вы вот тоже думать умеете, только не часто пользуетесь… Ой…', '30', '0', 'E13', '7', '0', null, '0', '0', 'E13_7_Камера.webm', '492', '-', '', '0');
INSERT INTO `dialogs` VALUES ('507', '1', '1', '4', '1', '4', '- Давай-ка не будем переходить на личности – это вряд ли нам поможет.', '30', '0', 'E13', '7', '1', null, '0', '0', 'E13_7_Камера.png', '493', '-', '', '0');
INSERT INTO `dialogs` VALUES ('508', '1', '1', '4', '1', '4', '- Хорошо, что мы об этом поговорили, думаю, что у нас есть шанс все поправить!', '30', '0', 'E13', '7', '2', null, '0', '0', '', '494', '-', '', '0');
INSERT INTO `dialogs` VALUES ('509', '1', '1', '4', '1', '4', '- Что же ты раньше об этом не говорила? Довела себя до такого состояния.', '30', '0', 'E13', '7', '3', null, '0', '0', '', '495', '-', '', '0');
INSERT INTO `dialogs` VALUES ('510', '4', '1', '1', '1', '4', '- Ну не знаю…Знаете, я как решила - сразу легче на душе стало. Это ведь верный признак?!', '30', '0', 'E13', '8', '0', null, '0', '0', 'E13_8_Камера.webm', '496', '-', '', '0');
INSERT INTO `dialogs` VALUES ('511', '1', '1', '4', '1', '4', '- Ну что же, раз так… Я честно попытался разобраться. Если ты настаиваешь – так тому и быть. Хотя мне очень жаль!', '30', '0', 'E13', '8', '1', '107', '0', '0', 'E13_8_Камера.png', '497', 'T', '', '0');
INSERT INTO `dialogs` VALUES ('512', '1', '1', '4', '1', '4', '- Давай так договоримся. Ты дашь мне второй шанс. Мне, и компании, и рынку. Мы с тобой вместе завтра проведем анализ всех задач отдела и выберем для тебя самые интересные. Вот, например, новая система показателей эффективности. Определим срок исправления ситуации и после него вернемся к этому разговору. Договорились?', '30', '0', 'E13', '8', '2', null, '0', '0', '', '498', '-', '', '0');
INSERT INTO `dialogs` VALUES ('513', '4', '1', '1', '1', '4', '- Давайте попробуем… И спасибо вам, я не думала, что вот так запросто можно все обсудить и даже решение какое-то найти!', '30', '0', 'E13', '9', '0', '130', '0', '0', 'E13_9_Камера.webm', '499', 'P10', '', '0');
INSERT INTO `dialogs` VALUES ('514', '2', '1', '1', '1', '5', 'стук в дверь', '0', '0', 'ET15', '1', '0', null, '0', '0', '', '500', '-', '', '0');
INSERT INTO `dialogs` VALUES ('515', '1', '1', '2', '1', '5', 'впустить', '0', '0', 'ET15', '1', '1', '59', '0', '0', '', '501', 'E15', '', '0');
INSERT INTO `dialogs` VALUES ('516', '1', '1', '2', '1', '5', 'не впустить', '0', '0', 'ET15', '1', '2', '107', '0', '0', '', '502', 'T', '', '0');
INSERT INTO `dialogs` VALUES ('517', '2', '1', '1', '1', '4', '- Ну что, дружок, день-то в результате неплохо сложился, а? Я очень довольна встречей с инвесторами, столько возможностей… Они нас правильно оценили, после того, как проанализировали все документы. Ай да я, ай да молодец! Да, пока не забыла, я тут на днях была в нашем банке и наблюдала, как работает их процесс бюджетирования. Думаю, нам стоит взять его на вооружение, у них полная автоматизация – никаких файлов, все в одной системе, которая дальше сама сводку делает, каково, а? Так ты, смотри, и без работы останешься.', '0', '0', 'E15', '1', '0', null, '0', '0', 'E15_1_g_Камера.webm', '503', '-', '', '0');
INSERT INTO `dialogs` VALUES ('518', '1', '1', '2', '1', '4', '- Это то, что нам надо, Раиса Романовна! А вы у них узнали, что это за система и как работает?', '0', '0', 'E15', '1', '1', null, '0', '0', 'E15_1_g_Камера.png', '504', '-', '', '0');
INSERT INTO `dialogs` VALUES ('519', '1', '1', '2', '1', '4', '- Да, нам пока до автоматизации бюджетного процесса далеко – представляете какая дисциплина и аккуратность должна быть во всех звеньях!', '0', '0', 'E15', '1', '2', null, '0', '0', '', '505', '-', '', '0');
INSERT INTO `dialogs` VALUES ('520', '1', '1', '2', '1', '4', '- Раиса Романовна, прошу прощения, но я планирую завтрашний день, который у меня последний перед отпуском. Можем мы поговорить об этом в другой раз?', '0', '0', 'E15', '1', '3', '60', '0', '0', '', '506', 'E15.1', '', '0');
INSERT INTO `dialogs` VALUES ('521', '2', '1', '1', '1', '4', '- Да! Система сложная, держится на жесточайшей дисциплине! У них окошко для переноса данных подразделениями открыто только двое суток: не успел – все, больше шанса не будет. Жди следующего бюджета. Уверена, что только такая система дисциплинирует людей и упрощает процедуру. Сколько мы сейчас сил и времени тратим на обзвоны и уговоры? Ты логистам сколько раз звонил?', '0', '0', 'E15', '2', '0', null, '0', '0', 'E15_2_g_Камера.webm', '507', '-', '', '0');
INSERT INTO `dialogs` VALUES ('522', '1', '1', '2', '1', '4', '- Раз пять минимум, я уже не говорю про продажи. Там с каждого региона приходится отдельно требовать.', '0', '0', 'E15', '2', '1', null, '0', '0', 'E15_2_g_Камера.png', '508', '-', '', '0');
INSERT INTO `dialogs` VALUES ('523', '1', '1', '2', '1', '4', '- Звонил много, и не только им. Но сейчас по-другому быть и не может – нет ведь санкций никаких за нарушение регламента.', '0', '0', 'E15', '2', '2', null, '0', '0', '', '509', '-', '', '0');
INSERT INTO `dialogs` VALUES ('524', '2', '1', '1', '1', '4', '- Вот я и говорю – система! Она позволит нам ввести тот уровень контроля и санкций, который требуется для выполнения регламента. Надо бы все это как следует обдумать и поискать программные решения. Займись этим не откладывая – не успеешь оглянуться, а уже новый бюджет на носу. Давай обсудим, что я хочу видеть в этой системе!', '0', '0', 'E15', '3', '0', null, '0', '0', 'E15_3_g_Камера.webm', '510', '-', '', '0');
INSERT INTO `dialogs` VALUES ('525', '1', '1', '2', '1', '4', '- Раиса Романовна, а давайте я сейчас срочные дела закончу и позвоню вам, чтобы продолжить обсуждение?', '0', '0', 'E15', '3', '1', '61', '0', '0', 'E15_3_g_Камера.png', '511', 'E15.2', '', '0');
INSERT INTO `dialogs` VALUES ('526', '1', '1', '2', '1', '4', '- К какому времени я должен подготовить подборку разных программ?', '0', '0', 'E15', '3', '2', null, '0', '0', '', '512', '-', '', '0');
INSERT INTO `dialogs` VALUES ('527', '2', '1', '1', '1', '4', '- Чем раньше, тем лучше. Нам же надо еще все согласовать, предусмотреть деньги на покупку, провести тестирование. В общем – давай к Новому году! Так вот, мои требования к этой системе. Во-первых, она должна просто интегрировать данные из текущей. Во-вторых, удобный интерфейс. В-третьих… (звонит ее телефон)…обсудим еще. Ты мне свой план на завтра перешли!', '0', '0', 'E15', '4', '0', '131', '0', '0', 'E15_4_g_Камера.webm', '513', 'P', '', '0');
INSERT INTO `dialogs` VALUES ('528', '2', '1', '1', '1', '4', 'Ах да, твой отпуск…забыла совсем. А план – это похвально! Мне копию брось!', '0', '0', 'E15.1', '1', '0', '131', '0', '0', 'E15_1_1_g_Камера.webm', '514', 'P', '', '0');
INSERT INTO `dialogs` VALUES ('529', '2', '1', '1', '1', '4', 'Срочные дела?… А обсуждение системных вопросов с руководителем не дело что ли? Хорошо, побеседуем на аттестации! У тебя ведь завтра последний день перед отпуском? Эх, зря я тебя отпустила – бюджет-то сырой. Да… Ну что уж теперь... Я хочу видеть твой завтрашний день – что ты планируешь успеть. Пришли план, и срочно!', '0', '0', 'E15.2', '1', '0', '131', '0', '0', 'E15_2_1_g_Камера.webm', '515', 'P', '', '0');
INSERT INTO `dialogs` VALUES ('530', '25', '1', '1', '1', '2', '- Доброхотов! Слушаю!', '5', '0', 'T2', '1', '0', null, '0', '0', 'T2_1.wav', '516', '-', '', '0');
INSERT INTO `dialogs` VALUES ('531', '1', '1', '25', '1', '2', '- Иван, привет! Это Федоров. У нас с тобой была договоренность о встрече. Сегодня около часа-двух дня. Помнишь?', '5', '0', 'T2', '1', '1', null, '0', '0', 'нет', '517', '-', '', '0');
INSERT INTO `dialogs` VALUES ('532', '1', '1', '25', '1', '2', '- Иван, доброе утро! Как дела? Ты про нашу встречу не забыл?', '5', '0', 'T2', '1', '2', null, '0', '0', 'нет', '518', '-', '', '0');
INSERT INTO `dialogs` VALUES ('533', '25', '1', '1', '1', '2', '- Конечно, помню. Спасибо Аутлуку! Ха-ха-ха. Так ты встречу подтверждаешь?', '5', '0', 'T2', '2', '0', null, '0', '0', 'T2_2.wav', '519', '-', '', '0');
INSERT INTO `dialogs` VALUES ('534', '1', '1', '25', '1', '2', '- Да, давай как договаривались, у меня в 13.30. Хотя и не лучший сегодня день, но для важных дел я время найду.', '5', '0', 'T2', '2', '1', '107', '0', '0', 'нет', '520', 'T', '', '0');
INSERT INTO `dialogs` VALUES ('535', '1', '1', '25', '1', '2', '- Давай встретимся вечером, после 18.00', '5', '0', 'T2', '2', '2', '114', '0', '0', 'нет', '521', 'P5', '', '0');
INSERT INTO `dialogs` VALUES ('536', '1', '1', '25', '1', '2', '- Послушай, Иван, а мы можем встретиться, когда я вернусь из отпуска? Через две недели? У меня два дня осталось, приходится концентрироваться на срочном!', '5', '0', 'T2', '2', '3', null, '0', '0', 'нет', '522', '-', '', '0');
INSERT INTO `dialogs` VALUES ('537', '25', '1', '1', '1', '2', '- Ну прямо гора с плеч! Я сегодня в жутком цейтноте. Не хотел тебя подводить, но, честно говоря, мне не до встреч – последняя неделя подготовки бюджета. Так что, спасибо! Только ты про данные по рынку не забудь! Письмо мое помнишь? И хорошего тебе отдыха! Буду ждать твоего звонка через пару недель.', '5', '0', 'T2', '3', '0', '113', '0', '0', 'T2_3.wav', '523', 'P6', '', '0');
INSERT INTO `dialogs` VALUES ('538', '12', '1', '1', '1', '2', '- Трудякин слушает!', '0', '0', 'T3.1', '1', '0', null, '0', '0', 'T3.1_1.wav', '524', '-', '', '1');
INSERT INTO `dialogs` VALUES ('539', '1', '1', '12', '1', '2', '- Егор, приветствую! Вынужден напомнить про ваш бюджет. У меня 3 часа для завершения сводного. Жду только вас.', '0', '0', 'T3.1', '1', '1', null, '0', '0', 'нет', '525', '-', '', '1');
INSERT INTO `dialogs` VALUES ('540', '1', '1', '12', '1', '2', '- Егор, доброе утро! Как же так, я ведь уже третий раз напоминаю, а бюджета все нет.', '0', '0', 'T3.1', '1', '2', null, '0', '0', 'нет', '526', '-', '', '1');
INSERT INTO `dialogs` VALUES ('541', '12', '1', '1', '1', '2', '- Дай мне несколько минут закончить проверку. Я вчера вернул бюджет на доработку, новые тарифы были учтены неверно. Уже заканчиваю.', '0', '0', 'T3.1', '2', '0', null, '0', '0', 'T3.1_2.wav', '527', '-', '', '1');
INSERT INTO `dialogs` VALUES ('542', '1', '1', '12', '1', '2', '- Хорошо, пять минут и приступаю к сводке. Если данных от вас не будет, использую прошлогодний вариант. Объясняйте потом Генеральному сами.', '0', '0', 'T3.1', '2', '1', '107', '0', '0', 'нет', '528', 'T', '', '1');
INSERT INTO `dialogs` VALUES ('543', '1', '1', '12', '1', '2', '- Отлично, но у тебя не больше пяти минут! Я на тебя полагаюсь и жду!', '0', '0', 'T3.1', '2', '2', '107', '0', '0', 'нет', '529', 'T', '', '1');
INSERT INTO `dialogs` VALUES ('544', '4', '1', '1', '1', '2', '- Крутько Марина, добрый день!', '0', '0', 'T5.2', '1', '0', null, '0', '0', 'T5.2_1.wav', '530', '-', '', '1');
INSERT INTO `dialogs` VALUES ('545', '1', '1', '4', '1', '2', '- Марина, я посмотрел презентацию, все по делу. Замечаний у меня нет. Продолжай.', '0', '0', 'T5.2', '1', '1', null, '0', '0', 'нет', '531', '-', '', '1');
INSERT INTO `dialogs` VALUES ('546', '1', '1', '4', '1', '2', '- Марина, я по поводу презентации. Спасибо, что прислала вовремя, как договаривались. Работа полностью соответствует требованиям. Мне и корректировать нечего.', '0', '0', 'T5.2', '1', '2', null, '0', '0', 'нет', '532', '-', '', '1');
INSERT INTO `dialogs` VALUES ('547', '4', '1', '1', '1', '2', '- Спасибо, рада, что не надо ничего переделывать.', '0', '0', 'T5.2', '2', '0', null, '0', '0', 'T5.2_2.wav', '533', '-', '', '1');
INSERT INTO `dialogs` VALUES ('548', '1', '1', '4', '1', '2', '- Я дам тебе знать, что думает Босс, после встречи с ним.', '0', '0', 'T5.2', '2', '1', '107', '0', '0', 'нет', '534', 'T', '', '1');
INSERT INTO `dialogs` VALUES ('549', '4', '1', '1', '1', '2', '- Крутько Марина, добрый день!', '0', '0', 'T5.3', '1', '0', null, '0', '0', 'T5.3_1.wav', '535', '-', '', '1');
INSERT INTO `dialogs` VALUES ('550', '1', '1', '4', '1', '2', '- Марина, я только что от Босса. Он все принял! Ты – молодчина! Ему даже придраться было не к чему! Просил только добавить побольше фото там, где это уместно!', '0', '0', 'T5.3', '1', '1', null, '0', '0', 'нет', '536', '-', '', '1');
INSERT INTO `dialogs` VALUES ('551', '1', '1', '4', '1', '2', '- Марина, поздравляю, Босс принял презентацию. Добавь побольше фото в подходящих местах.', '0', '0', 'T5.3', '1', '2', null, '0', '0', 'нет', '537', '-', '', '1');
INSERT INTO `dialogs` VALUES ('552', '4', '1', '1', '1', '2', '- Фух, очень хорошо! Я так рада! Даже не предполагала, что получится с первого раза.', '0', '0', 'T5.3', '2', '0', null, '0', '0', 'T5.3_2.wav', '538', '-', '', '1');
INSERT INTO `dialogs` VALUES ('553', '1', '1', '4', '1', '2', '- У него не было шанса не принять – у меня ведь большой опыт презентаций.', '0', '0', 'T5.3', '2', '1', '107', '0', '0', 'нет', '539', 'T', '', '1');
INSERT INTO `dialogs` VALUES ('554', '1', '1', '4', '1', '2', '- А я не сомневался в успехе. Ведь это ты делала. За твою работу я спокоен.', '0', '0', 'T5.3', '2', '2', '107', '0', '0', 'нет', '540', 'T', '', '1');
INSERT INTO `dialogs` VALUES ('555', '7', '1', '1', '1', '2', '- Помощник Генерального Директора!', '0', '0', 'T6.1', '1', '0', null, '0', '0', 'T6.1_1.wav', '541', '-', '', '0');
INSERT INTO `dialogs` VALUES ('556', '1', '1', '7', '1', '2', '- Валерий Семенович просил уточнить сколько копий презентаций и к какому числу необходимо сделать.', '0', '0', 'T6.1', '1', '1', null, '0', '0', 'нет', '542', '-', '', '0');
INSERT INTO `dialogs` VALUES ('557', '1', '1', '7', '1', '2', '- Милочка, подскажите, что мне дальше делать с презентацией Босса? Он сказал у вас уточнить!', '0', '0', 'T6.1', '1', '2', null, '0', '0', 'нет', '543', '-', '', '0');
INSERT INTO `dialogs` VALUES ('558', '1', '1', '7', '1', '2', '- Скажите, сколько копий презентаций я должен распечатать?', '0', '0', 'T6.1', '1', '3', null, '0', '0', 'нет', '544', '-', '', '0');
INSERT INTO `dialogs` VALUES ('559', '7', '1', '1', '1', '2', '- Хм. Одну секунду, уточняю. Заявлено участников – тридцать шесть. Распечатайте сорок, на всякий случай. Выступление будет в четверг на следующей неделе. В среду к 17.00 презентации должны быть у меня в коробках, готовые к отправке.', '0', '0', 'T6.1', '2', '0', null, '0', '0', 'T6.1_2.wav', '545', '-', '', '0');
INSERT INTO `dialogs` VALUES ('560', '1', '1', '7', '1', '2', '- Спасибо, понял, сорок копий.', '0', '0', 'T6.1', '2', '1', '107', '0', '0', 'нет', '546', 'T', '', '0');
INSERT INTO `dialogs` VALUES ('561', '1', '1', '7', '1', '2', '- Среда, 17.00, у вас в коробках, сорок копий. Спасибо!', '0', '0', 'T6.1', '2', '2', '107', '0', '0', 'нет', '547', 'T', '', '0');
INSERT INTO `dialogs` VALUES ('562', '1', '1', '7', '1', '2', '- Среда, у вас в коробках, тридцать шесть копий. Спасибо!', '0', '0', 'T6.1', '2', '3', '107', '0', '0', 'нет', '548', 'T', '', '0');
INSERT INTO `dialogs` VALUES ('563', '4', '1', '1', '1', '2', '- Крутько Марина, добрый день!', '0', '0', 'T6.2', '1', '0', null, '0', '0', 'T6.2_1.wav', '549', '-', '', '0');
INSERT INTO `dialogs` VALUES ('564', '1', '1', '4', '1', '2', '- Марина, запиши, пожалуйста, важную информацию по презентации.', '0', '0', 'T6.2', '1', '1', null, '0', '0', 'нет', '550', '-', '', '0');
INSERT INTO `dialogs` VALUES ('565', '1', '1', '4', '1', '2', '- Марина, надо еще кое-что сделать по презентациям.', '0', '0', 'T6.2', '1', '2', null, '0', '0', 'нет', '551', '-', '', '0');
INSERT INTO `dialogs` VALUES ('566', '4', '1', '1', '1', '2', '- О нет, только не говорите, что он передумал!!!', '0', '0', 'T6.2', '2', '0', null, '0', '0', 'T6.2_2.wav', '552', '-', '', '0');
INSERT INTO `dialogs` VALUES ('567', '1', '1', '4', '1', '2', '- Ну что ты! Конечно нет. Он просит распечатать презентации. Передай, пожалуйста, его секретарю сорок экземпляров к пяти вечера в среду', '0', '0', 'T6.2', '2', '1', null, '0', '0', 'нет', '553', '-', '', '0');
INSERT INTO `dialogs` VALUES ('568', '1', '1', '4', '1', '2', '- Нет-нет. Ее надо распечатать. Запиши, пожалуйста. Сорок экземпляров в цвете распечатать, уложить в коробки и передать секретарю ГД в среду, к семнадцати часам.', '0', '0', 'T6.2', '2', '2', null, '0', '0', 'нет', '554', '-', '', '0');
INSERT INTO `dialogs` VALUES ('569', '1', '1', '4', '1', '2', '- Нет, не передумал. Все в порядке. Презентации нужно распечатать на тридцать шесть участников. Босс просил в цвете. Передай распечатки его секретарю в среду.', '0', '0', 'T6.2', '2', '3', null, '0', '0', 'нет', '555', '-', '', '0');
INSERT INTO `dialogs` VALUES ('570', '4', '1', '1', '1', '2', '- Подождите, не так быстро. Я не успеваю. В среду в семнадцать или в семь?', '0', '0', 'T6.2', '3', '0', null, '0', '0', 'T6.2_3.wav', '556', '-', '', '0');
INSERT INTO `dialogs` VALUES ('571', '1', '1', '4', '1', '2', '- По-моему, в семнадцать.', '0', '0', 'T6.2', '3', '1', null, '0', '0', 'нет', '557', '-', '', '0');
INSERT INTO `dialogs` VALUES ('572', '1', '1', '4', '1', '2', '- По-моему, в семь.', '0', '0', 'T6.2', '3', '2', null, '0', '0', 'нет', '558', '-', '', '0');
INSERT INTO `dialogs` VALUES ('573', '1', '1', '4', '1', '2', '- Главное, чтобы хватило. Сорок копий.', '0', '0', 'T6.2', '3', '3', null, '0', '0', 'нет', '559', '-', '', '0');
INSERT INTO `dialogs` VALUES ('574', '4', '1', '1', '1', '2', '- Хорошо, записала. Знаете, я обычно такую информацию по почте отправляю, чтобы не было разночтений.', '0', '0', 'T6.2', '4', '0', '107', '0', '0', 'T6.2_4.wav', '560', 'T', '', '0');
INSERT INTO `dialogs` VALUES ('575', '3', '1', '1', '1', '2', '- У аппарата', '0', '0', 'T7.1', '1', '0', null, '0', '0', 'T7.1_1.wav', '561', '-', '', '1');
INSERT INTO `dialogs` VALUES ('576', '1', '1', '3', '1', '2', '- Я по поводу задания от логистов по выгрузке данных. Трудякин просил сегодня! Ты его сделал?', '0', '0', 'T7.1', '1', '1', null, '0', '0', 'нет', '562', '-', '', '1');
INSERT INTO `dialogs` VALUES ('577', '3', '1', '1', '1', '2', '- Пока нет. Но это не моя вина. Они мне сами задание не шлют. Я даже не понимаю точно, чего они от меня хотят.', '0', '0', 'T7.1', '2', '0', null, '0', '0', 'T7.1_2.wav', '563', '-', '', '1');
INSERT INTO `dialogs` VALUES ('578', '1', '1', '3', '1', '2', '- Ну кто же так делает? Что же ты молчишь? У тебя задание уже два дня висит!', '0', '0', 'T7.1', '2', '1', null, '0', '0', 'нет', '564', '-', '', '1');
INSERT INTO `dialogs` VALUES ('579', '1', '1', '3', '1', '2', '- Так, прекрасно! Сроки опять летят!', '0', '0', 'T7.1', '2', '2', null, '0', '0', 'нет', '565', '-', '', '1');
INSERT INTO `dialogs` VALUES ('580', '1', '1', '3', '1', '2', '- В таких случаях надо сразу же спрашивать у меня или у заказчика.', '0', '0', 'T7.1', '2', '3', null, '0', '0', 'нет', '566', '-', '', '1');
INSERT INTO `dialogs` VALUES ('581', '3', '1', '1', '1', '2', '- Вы бюджетом заняты – я и звонить-то боюсь. А у них тоже никто ничего толком сказать не может. Я у ребят спрашивал, они на Трудякина кивают. Я ему письмо написал, уточните, мол, задание. Еще позавчера. Ни ответа, ни привета.', '0', '0', 'T7.1', '3', '0', null, '0', '0', 'T7.1_3.wav', '567', '-', '', '1');
INSERT INTO `dialogs` VALUES ('582', '1', '1', '3', '1', '2', '- Мы же говорили, что в письмах людям выше тебя статусом я должен стоять в копии!', '0', '0', 'T7.1', '3', '1', null, '0', '0', 'нет', '568', '-', '', '1');
INSERT INTO `dialogs` VALUES ('583', '1', '1', '3', '1', '2', '- Не ответил? А ты ему звонил?', '0', '0', 'T7.1', '3', '2', null, '0', '0', 'нет', '569', '-', '', '1');
INSERT INTO `dialogs` VALUES ('584', '3', '1', '1', '1', '2', '- Я, правда, вас в «Копии» забыл поставить… Но звонить ему – совсем уж не мое дело. Я ему кто? Он и говорить-то со мной не будет. Вы же его знаете!', '0', '0', 'T7.1', '4', '0', null, '0', '0', 'T7.1_4.wav', '570', '-', '', '1');
INSERT INTO `dialogs` VALUES ('585', '1', '1', '3', '1', '2', '- Сергей, это твое задание! Ты должен выяснить детали у заказчика! Прямо сейчас и звони. Результат доложишь!', '0', '0', 'T7.1', '4', '1', '69', '0', '0', 'нет', '571', 'TT7.1.1', '', '1');
INSERT INTO `dialogs` VALUES ('586', '1', '1', '3', '1', '2', '- Хорошо, сейчас поговорю с ним и уточню задание! Но впредь учти – детализация задачи – часть твоей работы!', '0', '0', 'T7.1', '4', '2', '107', '0', '0', 'нет', '572', 'T', '', '1');
INSERT INTO `dialogs` VALUES ('587', '3', '1', '1', '1', '1', 'звук телефонного звонка', '10', '0', 'TT7.1.1', '1', '0', null, '0', '0', '', '573', '-', '', '1');
INSERT INTO `dialogs` VALUES ('588', '1', '1', '3', '1', '1', 'Ответить', '0', '0', 'TT7.1.1', '1', '1', '70', '0', '0', '', '574', 'T7.1.1', '', '1');
INSERT INTO `dialogs` VALUES ('589', '1', '1', '3', '1', '1', 'Не ответить', '0', '0', 'TT7.1.1', '1', '2', '107', '0', '0', '', '575', 'T', '', '1');
INSERT INTO `dialogs` VALUES ('590', '3', '1', '1', '1', '2', '- Ну вот, я же говорил, что звонить ему бесполезно! Он просто трубку не берет. Я уже 3 раза пытался. Ребята говорят, что он у себя, но занят и ни с кем не разговаривает.', '0', '0', 'T7.1.1', '1', '0', null, '0', '0', 'T7.1.1_1.wav', '576', '-', '', '1');
INSERT INTO `dialogs` VALUES ('591', '1', '1', '3', '1', '2', '- Я сказал доложить о результате! А пока результата нет. Сообщишь мне задание, когда уточнишь его у Трудякина.', '0', '0', 'T7.1.1', '1', '1', '107', '0', '0', 'нет', '577', 'T', '', '1');
INSERT INTO `dialogs` VALUES ('592', '1', '1', '3', '1', '2', '- Ладно, я понял! Позвоню сам и уточню для тебя задание!', '0', '0', 'T7.1.1', '1', '2', '107', '0', '0', 'нет', '578', 'T', '', '1');
INSERT INTO `dialogs` VALUES ('593', '12', '1', '1', '1', '2', '- Трудякин слушает!', '0', '0', 'T7.2', '1', '0', null, '0', '0', 'T7.2_1.wav', '579', '-', '', '1');
INSERT INTO `dialogs` VALUES ('594', '1', '1', '12', '1', '2', '- Егор, ты хотел сегодня получить выгрузку данных! Она тебе все еще нужна?', '0', '0', 'T7.2', '1', '1', null, '0', '0', 'нет', '580', '-', '', '1');
INSERT INTO `dialogs` VALUES ('595', '1', '1', '12', '1', '2', '- Привет Егор, как поживаешь? Ждешь от нас выгрузку данных?', '0', '0', 'T7.2', '1', '2', null, '0', '0', 'нет', '581', '-', '', '1');
INSERT INTO `dialogs` VALUES ('596', '12', '1', '1', '1', '2', '- Конечно! Очень жду! У меня без этих данных работа стоит.', '0', '0', 'T7.2', '2', '0', null, '0', '0', 'T7.2_2.wav', '582', '-', '', '1');
INSERT INTO `dialogs` VALUES ('597', '1', '1', '12', '1', '2', '- Но от вас не поступило никакой детализации задания. Это значит, что его нет! И мы ничего не делаем!', '0', '0', 'T7.2', '2', '1', null, '0', '0', 'нет', '583', '-', '', '1');
INSERT INTO `dialogs` VALUES ('598', '1', '1', '12', '1', '2', '- Но что именно ты ждешь? Я об этом ничего не знаю, исполнитель – Трутнев – тоже. Он тебе два дня назад письмо отправил с уточнениями, ответа не получил!', '0', '0', 'T7.2', '2', '2', null, '0', '0', 'нет', '584', '-', '', '1');
INSERT INTO `dialogs` VALUES ('599', '12', '1', '1', '1', '2', '- Какая детализация?! Вы эту выгрузку уже в третий раз делаете. Я тебе все четко объяснил по телефону, когда просил сделать к сегодняшнему дню. Если возникли вопросы после – спрашивайте, чего же вы молчите?!', '0', '0', 'T7.2', '3', '0', null, '0', '0', 'T7.2_3.wav', '585', '-', '', '1');
INSERT INTO `dialogs` VALUES ('600', '1', '1', '12', '1', '2', '- Именно об этом я и говорю. Трутнев два дня назад написал тебе письмо с уточнениями, но ты не ответил.', '0', '0', 'T7.2', '3', '1', null, '0', '0', 'нет', '586', '-', '', '1');
INSERT INTO `dialogs` VALUES ('601', '1', '1', '12', '1', '2', '- Постановка четкой задачи – ответственность заказчика. Впредь задания буду принимать только в письменной форме! Пиши запрос на выгрузку!', '0', '0', 'T7.2', '3', '2', '107', '0', '0', 'нет', '587', 'T', '???', '1');
INSERT INTO `dialogs` VALUES ('602', '12', '1', '1', '1', '2', '- Дай посмотреть…. Да, есть письмо от твоего Трутнева. Знаешь, что у него в «Теме» написано? «Про ваш запрос». У нашего отдела сотни запросов в разные подразделения. Я как должен понять, что это срочно и по нужной мне теме? Ладно. Предлагаю считать инцидент исчерпанным! Я тебе сейчас перешлю форму. Нам нужны данные в том же виде. Только за прошедшие девять месяцев.', '0', '0', 'T7.2', '4', '0', null, '0', '0', 'T7.2_4.wav', '588', '-', '', '1');
INSERT INTO `dialogs` VALUES ('603', '1', '1', '12', '1', '2', '- Только ты и Трутнева в копию поставь – ему делать.', '0', '0', 'T7.2', '4', '1', null, '0', '0', 'нет', '589', '-', '', '1');
INSERT INTO `dialogs` VALUES ('604', '1', '1', '12', '1', '2', '- Когда тебе нужны данные?', '0', '0', 'T7.2', '4', '2', null, '0', '0', 'нет', '590', '-', '', '1');
INSERT INTO `dialogs` VALUES ('605', '12', '1', '1', '1', '2', '- Запрос остается срочным. Я хочу получить данные сегодня, как можно раньше! Форма уже у тебя в почте. Пожалуйста, помоги!', '0', '0', 'T7.2', '5', '0', '132', '0', '0', 'T7.2_5.wav', '591', 'M41', '', '1');
INSERT INTO `dialogs` VALUES ('606', '3', '1', '1', '1', '2', '- Слушаю!', '0', '0', 'T7.3', '1', '0', null, '0', '0', 'T7.3_1.wav', '592', '-', '', '1');
INSERT INTO `dialogs` VALUES ('607', '1', '1', '3', '1', '2', '- Я по поводу задания от логистов. Поговорил с Трудякиным. Им нужно заполнить данными определенную форму за прошедшие девять месяцев. Она у тебя в почте. Если будут вопросы – звони не откладывая.', '0', '0', 'T7.3', '1', '1', null, '0', '0', 'нет', '593', '-', '', '1');
INSERT INTO `dialogs` VALUES ('608', '3', '1', '1', '1', '2', '- Хорошо, форму вижу. Сроки-то поменяли?', '0', '0', 'T7.3', '2', '0', null, '0', '0', 'T7.3_2.wav', '594', '-', '', '1');
INSERT INTO `dialogs` VALUES ('609', '1', '1', '3', '1', '2', '- Нет, нужно сегодня и срочно. У тебя есть два часа. Поставь меня в копию при отправке Трудякину.', '0', '0', 'T7.3', '2', '1', '107', '0', '0', 'нет', '595', 'T', '', '1');
INSERT INTO `dialogs` VALUES ('610', '1', '1', '3', '1', '2', '- Нет, отложи все дела и сделай срочно. Думаю, двух часов тебе хватит. Перед отправкой перешли мне для проверки.', '0', '0', 'T7.3', '2', '2', '107', '0', '0', 'нет', '596', 'T', 'F22', '1');
INSERT INTO `dialogs` VALUES ('611', '3', '1', '1', '1', '2', '- Слушаю!', '0', '0', 'T7.4', '1', '0', null, '0', '0', 'T7.4_1.wav', '597', '-', '', '1');
INSERT INTO `dialogs` VALUES ('612', '1', '1', '3', '1', '2', '- Я по поводу задания от логистов. Ты его сделал?', '0', '0', 'T7.4', '1', '1', null, '0', '0', 'нет', '598', '-', '', '1');
INSERT INTO `dialogs` VALUES ('613', '1', '1', '3', '1', '2', '- Где результат твоей работы по заданию от логистов?', '0', '0', 'T7.4', '1', '2', null, '0', '0', 'нет', '599', '-', '', '1');
INSERT INTO `dialogs` VALUES ('614', '3', '1', '1', '1', '2', '- Данные у вас в почте. Только что отправил.', '0', '0', 'T7.4', '2', '0', '133', '0', '0', 'T7.4_2.wav', '600', 'M43', '', '1');
INSERT INTO `dialogs` VALUES ('615', '3', '1', '1', '1', '2', '- Данные у вас в почте. Только что отправил.', '0', '0', 'T7.4', '2', '0', '134', '0', '0', 'T7.4_2.wav', '601', 'M44', '', '1');
INSERT INTO `dialogs` VALUES ('616', '12', '1', '1', '1', '2', '- Слушаю, Трудякин.', '0', '0', 'T7.5', '1', '0', null, '0', '0', 'T7.5_1.wav', '602', '-', '', '1');
INSERT INTO `dialogs` VALUES ('617', '1', '1', '12', '1', '2', '- Егор, ты посмотрел файл по твоему заданию? Трутнев тебе отправил.', '0', '0', 'T7.5', '1', '1', null, '0', '0', 'нет', '603', '-', '', '1');
INSERT INTO `dialogs` VALUES ('618', '1', '1', '12', '1', '2', '- Егор, я тебе переслал готовый по твоему заданию файл. Видел?', '0', '0', 'T7.5', '1', '2', null, '0', '0', 'нет', '604', '-', '', '1');
INSERT INTO `dialogs` VALUES ('619', '12', '1', '1', '1', '2', '- Уже сделали? Здорово! Спасибо! Помог! Я обязательно посмотрю, но пока занят. Я позвоню тебе, если что не так. Спасибо, еще раз!', '0', '0', 'T7.5', '2', '0', '107', '0', '0', 'T7.5_2.wav', '605', 'T', '', '1');
INSERT INTO `dialogs` VALUES ('620', '36', '1', '1', '1', '1', 'звук телефонного звонка', '0', '0', 'RST1', '1', '0', null, '0', '0', '', '606', '-', '', '1');
