INSERT INTO `dialogs` VALUES ('625', '1', '1', '36', '1', '2', '- Вы по какому вопросу?', '0', '0', 'RS1', '1', '2', null, '0', '0', 'нет', '611', '-', '', '1');
INSERT INTO `dialogs` VALUES ('626', '36', '1', '1', '1', '2', '- Это Федоров?', '0', '0', 'RS1', '2', '0', null, '0', '0', 'RS1_2.wav', '612', '-', '', '1');
INSERT INTO `dialogs` VALUES ('627', '1', '1', '36', '1', '2', '- Да, а вы кто?', '0', '0', 'RS1', '2', '1', null, '0', '0', 'нет', '613', '-', '', '1');
INSERT INTO `dialogs` VALUES ('628', '1', '1', '36', '1', '2', '- Да, чем могу помочь?', '0', '0', 'RS1', '2', '2', null, '0', '0', 'нет', '614', '-', '', '1');
INSERT INTO `dialogs` VALUES ('629', '36', '1', '1', '1', '2', '- Вы машину-то свою заберите. Мы работы закончили. Стоянки у нас не предусмотрено!', '0', '0', 'RS1', '3', '0', null, '0', '0', 'RS1_3.wav', '615', '-', '', '1');
INSERT INTO `dialogs` VALUES ('630', '1', '1', '36', '1', '2', '- Слушайте, у меня времени нет, я смогу только в обед!', '0', '0', 'RS1', '3', '1', null, '0', '0', 'нет', '616', '-', '', '1');
INSERT INTO `dialogs` VALUES ('631', '1', '1', '36', '1', '2', '- Послушайте, я не могу уйти с работы, заберу только вечером!', '0', '0', 'RS1', '3', '2', '107', '0', '0', 'нет', '617', 'T', '', '1');
INSERT INTO `dialogs` VALUES ('632', '1', '1', '36', '1', '2', '- Я не могу уйти, мне надо отпрашиваться у руководителя!', '0', '0', 'RS1', '3', '3', null, '0', '0', 'нет', '618', '-', '', '1');
INSERT INTO `dialogs` VALUES ('633', '36', '1', '1', '1', '2', '- Как времени нет, как не могу? Что за привычка – ключи бросят и исчезают. Я же не нанимался ваши машины по дворам распихивать. А потом отвечай за них! Я монтажом занимаюсь, а не охраной! Прямо сейчас и забирайте, а не то – пеняйте на себя!', '0', '0', 'RS1', '4', '0', null, '0', '0', 'RS1_4.wav', '619', '-', '', '1');
INSERT INTO `dialogs` VALUES ('634', '1', '1', '36', '1', '2', '- Хорошо, сейчас заберу!', '0', '0', 'RS1', '4', '1', '107', '0', '0', 'нет', '620', 'T', 'CS3', '1');
INSERT INTO `dialogs` VALUES ('635', '1', '1', '36', '1', '2', '- Хорошо, сейчас от меня придет человек.', '0', '0', 'RS1', '4', '2', '77', '0', '0', 'нет', '621', 'RS1.1', '', '1');
INSERT INTO `dialogs` VALUES ('636', '1', '1', '36', '1', '2', '- Все понимаю, но смогу только в обед!', '0', '0', 'RS1', '4', '3', '135', '0', '0', 'нет', '622', 'P12', '', '1');
INSERT INTO `dialogs` VALUES ('637', '1', '1', '36', '1', '2', '- Ну помогите, поставьте ее куда-нибудь до вечера! Вечером непременно заберу!', '0', '0', 'RS1', '4', '4', '107', '0', '0', 'нет', '623', 'T', '', '1');
INSERT INTO `dialogs` VALUES ('638', '3', '1', '1', '1', '2', '- Слушаю, Трутнев, Сергей', '0', '0', 'RS1.1', '1', '0', null, '0', '0', 'RS1.1_1.wav', '624', '-', '', '1');
INSERT INTO `dialogs` VALUES ('639', '1', '1', '3', '1', '2', '- Привет, Сергей! Ты очень занят?', '0', '0', 'RS1.1', '1', '1', null, '0', '0', 'нет', '625', '-', '', '1');
INSERT INTO `dialogs` VALUES ('640', '1', '1', '3', '1', '2', '- Доброе утро, Сергей! Нужна твоя помощь!', '0', '0', 'RS1.1', '1', '2', null, '0', '0', 'нет', '626', '-', '', '1');
INSERT INTO `dialogs` VALUES ('641', '3', '1', '1', '1', '2', '- Доброе утро! Да я же по вашему заданию работаю!!! Мы тут всегда заняты, как известно!', '0', '0', 'RS1.1', '2', '0', null, '0', '0', 'RS1.1_2.wav', '627', '-', '', '1');
INSERT INTO `dialogs` VALUES ('642', '1', '1', '3', '1', '2', '- Конечно, мое задание. А что именно я просил сделать?', '0', '0', 'RS1.1', '2', '1', null, '0', '0', 'нет', '628', '-', '', '1');
INSERT INTO `dialogs` VALUES ('643', '1', '1', '3', '1', '2', '- Понимаю. Много времени моя просьба не займет.', '0', '0', 'RS1.1', '2', '2', null, '0', '0', 'нет', '629', '-', '', '1');
INSERT INTO `dialogs` VALUES ('644', '3', '1', '1', '1', '2', '- А мне казалось, что эти данные, что я выгружаю для разных отделов по бюджету, нужны срочно.', '0', '0', 'RS1.1', '3', '0', null, '0', '0', 'RS1.1_3.wav', '630', '-', '', '1');
INSERT INTO `dialogs` VALUES ('645', '1', '1', '3', '1', '2', '- Да, ты прав, продолжай свою работу!', '0', '0', 'RS1.1', '3', '1', '107', '0', '0', 'нет', '631', 'T', '', '1');
INSERT INTO `dialogs` VALUES ('646', '1', '1', '3', '1', '2', '- Это так. Но речь идет всего о пятнадцати минутах. Сбегай в шиномонтаж на нашей улице – забери мою машину, пожалуйста. Я совсем никак не могу вырваться.', '0', '0', 'RS1.1', '3', '2', null, '0', '0', 'нет', '632', '-', '', '1');
INSERT INTO `dialogs` VALUES ('647', '3', '1', '1', '1', '2', '- А, это – пожалуйста. Заодно и покурю, я тут с утра сижу без воздуха! А можно я еще в магазин заскочу – у нас как раз кофе кончился, а аналитикам без кофе нельзя!', '0', '0', 'RS1.1', '4', '0', null, '0', '0', 'RS1.1_4.wav', '633', '-', '', '1');
INSERT INTO `dialogs` VALUES ('648', '1', '1', '3', '1', '2', '- Хорошо, заскочи, только быстро! Работа не должна страдать.', '0', '0', 'RS1.1', '4', '1', '78', '0', '0', 'нет', '634', 'RST1.2 ', '', '1');
INSERT INTO `dialogs` VALUES ('649', '1', '1', '3', '1', '2', '- Ну что ты, Сергей! За кофе по дороге на работу зайдешь! Дело – прежде всего!', '0', '0', 'RS1.1', '4', '2', '78', '0', '0', 'нет', '635', 'RST1.2 ', '', '1');
