INSERT INTO `dialogs` VALUES ('653', '3', '1', '1', '1', '2', '- Это я, Трутнев! Машину забрал – целехонька! Только вы к ним больше не обращайтесь – там уровень сервиса как при царе Горохе. Я бегу, спешу, а меня еще и отчитали!', '0', '0', 'RS1.2', '1', '0', null, '0', '0', 'RS1.2_1.wav', '639', '-', '', '1');
