INSERT INTO `dialogs` VALUES ('658', '12', '1', '1', '1', '2', '- Приветствую, Егор Трудякин! Удобно говорить?', '0', '0', 'RS2', '1', '0', null, '0', '0', 'RS2_1.wav', '644', '-', '', '1');
INSERT INTO `dialogs` VALUES ('659', '1', '1', '12', '1', '2', '- Доброе утро, Егор. Не совсем – я бюджетом занят.', '0', '0', 'RS2', '1', '1', null, '0', '0', 'нет', '645', '-', '', '1');
INSERT INTO `dialogs` VALUES ('660', '1', '1', '12', '1', '2', '- Приветствую, Егор! У тебя что-то срочное?', '0', '0', 'RS2', '1', '2', null, '0', '0', 'нет', '646', '-', '', '1');
INSERT INTO `dialogs` VALUES ('661', '12', '1', '1', '1', '2', '- Да, я коротенько! Меня моя загрузка волнует во время твоего отпуска! Мы с тобой в одной команде по проекту интеграции данных от клиентов, помнишь? Я сегодня план открыл и понял – ничего про это не знаю! А ведь там огромная часть работы на мне!', '0', '0', 'RS2', '2', '0', null, '0', '0', 'RS2_2.wav', '647', '-', '', '1');
INSERT INTO `dialogs` VALUES ('662', '1', '1', '12', '1', '2', '- Какой план?', '0', '0', 'RS2', '2', '1', null, '0', '0', 'нет', '648', '-', '', '1');
INSERT INTO `dialogs` VALUES ('663', '1', '1', '12', '1', '2', '- Егор, я сегодня встречаюсь с первым клиентом!', '0', '0', 'RS2', '2', '2', null, '0', '0', 'нет', '649', '-', '', '1');
INSERT INTO `dialogs` VALUES ('664', '1', '1', '12', '1', '2', '- Егор, я начну работу по проекту только после отпуска.', '0', '0', 'RS2', '2', '3', null, '0', '0', 'нет', '650', '-', '', '1');
INSERT INTO `dialogs` VALUES ('665', '12', '1', '1', '1', '2', '- Ну ты даешь! Ты квартальный план давно открывал? Нет, свой личный график можешь организовывать как угодно – тебе видней. Только тут ведь кросс функциональный проект! Мне-то что делать? Я в нем, как всегда, замыкающий! Все сроки с меня требовать будут. Нам надо срочно увидеться и все обсудить! Давай-ка, поищи для меня тридцать минут!', '0', '0', 'RS2', '3', '0', null, '0', '0', 'RS2_3.wav', '651', '-', '', '1');
INSERT INTO `dialogs` VALUES ('666', '1', '1', '12', '1', '2', '- Нет, Егор! До отпуска времени у меня нет.', '0', '0', 'RS2', '3', '1', null, '0', '0', 'нет', '652', '-', '', '1');
INSERT INTO `dialogs` VALUES ('667', '1', '1', '12', '1', '2', '- Хорошо, но я могу только вечером, после шести!', '0', '0', 'RS2', '3', '2', '136', '0', '0', 'нет', '653', 'P13', '', '1');
INSERT INTO `dialogs` VALUES ('668', '1', '1', '12', '1', '2', '- Я могу тебе предложить достойную альтернативу – повидайся с моим лучшим аналитиком Мариной Крутько! Я планирую ее в проект вовлекать.', '0', '0', 'RS2', '3', '3', null, '0', '0', 'нет', '654', '-', '', '1');
INSERT INTO `dialogs` VALUES ('669', '12', '1', '1', '1', '2', '- Так не пойдет! Да будь ты хоть королевой австрийской, для своего коллеги тридцать минут всегда выкроить можно! Я ведь не часто тебя прошу! Ты представляешь, какой объем работ за мной по этому проекту? Если мы решим вносить изменения в информационную систему и документы – работы на пол года минимум! Найди время!', '0', '0', 'RS2', '4', '0', null, '0', '0', 'RS2_4.wav', '655', '-', '', '1');
INSERT INTO `dialogs` VALUES ('670', '1', '1', '12', '1', '2', '- Хорошо, сегодня вечером, после шести!', '0', '0', 'RS2', '4', '1', '136', '0', '0', 'нет', '656', 'P13', '', '1');
INSERT INTO `dialogs` VALUES ('671', '1', '1', '12', '1', '2', '- Егор, ты совершенно напрасно волнуешься. По графику у нас еще несколько месяцев! Давай после отпуска!', '0', '0', 'RS2', '4', '2', null, '0', '0', 'нет', '657', '-', '', '1');
INSERT INTO `dialogs` VALUES ('672', '12', '1', '1', '1', '2', '- Такое ощущение, что мы с тобой разными планами пользуемся. Брось-ка мне свою версию, а там и решим!', '0', '0', 'RS2', '5', '0', '137', '0', '0', 'RS2_5.wav', '658', 'D2', '', '1');
