INSERT INTO `dialogs` VALUES ('676', '40', '1', '1', '1', '2', '- Александр Васильевич, добрый день! Как хорошо, что застала! Вы наши короба получили? Я тут прямо места себе не нахожу! Вдруг опять какой сбой!', '5', '0', 'RS3', '1', '0', null, '0', '0', 'RS3_1.wav', '662', '-', '', '0');
INSERT INTO `dialogs` VALUES ('677', '1', '1', '40', '1', '2', '- Извините, вы ошиблись номером!', '5', '0', 'RS3', '1', '1', '107', '0', '0', 'нет', '663', 'T', '', '0');
INSERT INTO `dialogs` VALUES ('678', '1', '1', '40', '1', '2', '- Простите, вы кому звоните?', '5', '0', 'RS3', '1', '2', null, '0', '0', 'нет', '664', '-', '', '0');
INSERT INTO `dialogs` VALUES ('679', '40', '1', '1', '1', '2', '- Александру Васильевичу, снабжение! А вы кто?', '5', '0', 'RS3', '2', '0', null, '0', '0', 'RS3_2.wav', '665', '-', '', '0');
INSERT INTO `dialogs` VALUES ('680', '1', '1', '40', '1', '2', '- Я – начальник отдела анализа, набирайте номер внимательно!', '5', '0', 'RS3', '2', '1', null, '0', '0', 'нет', '666', '-', '', '0');
INSERT INTO `dialogs` VALUES ('681', '1', '1', '40', '1', '2', '- Я – Федоров, и точно не Александр Васильевич', '5', '0', 'RS3', '2', '2', null, '0', '0', 'нет', '667', '-', '', '0');
INSERT INTO `dialogs` VALUES ('682', '40', '1', '1', '1', '2', '- Ой, любезный, а вы можете меня на снабжение переключить? Очень вас прошу – я уже два часа на телефоне. Невозможно дозвониться – все номера подряд набираю от безысходности!', '5', '0', 'RS3', '3', '0', null, '0', '0', 'RS3_3.wav', '668', '-', '', '0');
