INSERT INTO `dialogs` VALUES ('687', '1', '1', '16', '1', '1', 'Не ответить', '0', '0', 'RST4', '1', '2', '107', '0', '0', '', '673', 'T', '', '0');
INSERT INTO `dialogs` VALUES ('688', '16', '1', '1', '1', '2', '- Семенова, отдел кадров. Вы на месте? Я к вам сейчас с табелем подойду!', '5', '0', 'RS4', '1', '0', null, '0', '0', 'RS4_1.wav', '674', '-', '', '0');
