INSERT INTO `dialogs` VALUES ('691', '1', '1', '16', '1', '2', '- Хорошо, подходите.', '5', '0', 'RS4', '1', '3', '107', '0', '0', 'нет', '677', 'T', '', '0');
INSERT INTO `dialogs` VALUES ('692', '16', '1', '1', '1', '2', '- Я вам уже неделю звоню. Я обязана подписать у вас табель посещения рабочих мест сотрудниками вашего отдела. Регламент Вам известен. Вот ваша подпись на документе.', '5', '0', 'RS4', '2', '0', null, '0', '0', 'RS4_2.wav', '678', '-', '', '0');
