INSERT INTO `dialogs` VALUES ('694', '1', '1', '16', '1', '2', '- Прошу вас, давайте в другое время. И согласуем его заранее.', '5', '0', 'RS4', '2', '2', null, '0', '0', 'нет', '680', '-', '', '0');
INSERT INTO `dialogs` VALUES ('695', '1', '1', '16', '1', '2', '- Вы правы, известен! Давайте согласуем время для вашего визита. Могу предложить понедельник через две недели.', '5', '0', 'RS4', '2', '3', null, '0', '0', 'нет', '681', '-', '', '0');
INSERT INTO `dialogs` VALUES ('696', '16', '1', '1', '1', '2', '- Знаете, я своему руководителю буду жаловаться, а она – вашему. У нас в компании сотни сотрудников находят время подписать важные документы, а вы регулярно нарушаете!', '5', '0', 'RS4', '3', '0', null, '0', '0', 'RS4_3.wav', '682', '-', '', '0');
INSERT INTO `dialogs` VALUES ('697', '1', '1', '16', '1', '2', '- Ну что же – жалуйтесь, это ваше право! Времени от этого больше не станет! Сейчас я занят!', '5', '0', 'RS4', '3', '1', '107', '0', '0', 'нет', '683', 'T', '', '0');
INSERT INTO `dialogs` VALUES ('698', '1', '1', '16', '1', '2', '- Я тоже пожалуюсь своему руководителю на методы исполнения ваших процедур! Сказано же, я занят!', '5', '0', 'RS4', '3', '2', '138', '0', '0', 'нет', '684', 'MS50', '', '0');
INSERT INTO `dialogs` VALUES ('699', '1', '1', '16', '1', '2', '- Странно, что вы не знаете порядка назначения встреч и являетесь, когда вам угодно! Сейчас я занят!', '5', '0', 'RS4', '3', '3', '107', '0', '0', 'нет', '685', 'T', '', '0');
