INSERT INTO `dialogs` VALUES ('706', '1', '1', '14', '1', '2', '- Отлично, я как раз собирался вам звонить!', '0', '0', 'RS5', '1', '2', null, '0', '0', 'нет', '692', '-', '', '1');
INSERT INTO `dialogs` VALUES ('707', '14', '1', '1', '1', '2', '- Прелюбопытно! К вам ремонтники мои приходили? Вы почему их выгнали? Как же я вам прохладу к весне обеспечу? Бригада на этой неделе сворачивает свои работы у нас в офисе. Прошу обеспечить доступ к кондиционерам в ближайшее время!', '0', '0', 'RS5', '2', '0', null, '0', '0', 'RS5_2.wav', '693', '-', '', '1');
INSERT INTO `dialogs` VALUES ('708', '1', '1', '14', '1', '2', '- Ремонт надо заранее согласовывать. У меня вот отпуск через два дня. Приходите и ремонтируйте все, что угодно!', '0', '0', 'RS5', '2', '1', null, '0', '0', 'нет', '694', '-', '', '1');
INSERT INTO `dialogs` VALUES ('709', '1', '1', '14', '1', '2', '- Прошу вас согласовать свой ремонт с моим руководителем, она вам разъяснит, почему именно я ваших работников выгнал!', '0', '0', 'RS5', '2', '2', null, '0', '0', 'нет', '695', '-', '', '1');
