INSERT INTO `dialogs` VALUES ('713', '1', '1', '2', '1', '1', 'Ответить', '0', '0', 'RST6', '1', '1', '89', '0', '0', '', '699', 'RS6', '', '0');
INSERT INTO `dialogs` VALUES ('714', '1', '1', '2', '1', '1', 'Не ответить', '0', '0', 'RST6', '1', '2', '107', '0', '0', '', '700', 'T', '', '0');
INSERT INTO `dialogs` VALUES ('715', '2', '1', '1', '1', '2', '- Так, у меня срочная просьба! Открой-ка факт прошлого года и скажи мне, какова была доля производственных издержек в объеме продаж! Что они мне голову морочат…', '10', '0', 'RS6', '1', '0', null, '0', '0', 'RS6_1.wav', '701', '-', '', '0');
INSERT INTO `dialogs` VALUES ('716', '1', '1', '2', '1', '2', '- Секундочку, Раиса Романовна! Открываю!', '10', '0', 'RS6', '1', '1', null, '0', '0', 'нет', '702', '-', '', '0');
INSERT INTO `dialogs` VALUES ('717', '1', '1', '2', '1', '2', '- Раиса Романовна, так ведь у вас есть эти отчеты?!', '10', '0', 'RS6', '1', '2', null, '0', '0', 'нет', '703', '-', '', '0');
INSERT INTO `dialogs` VALUES ('718', '1', '1', '2', '1', '2', '- Раиса Романовна, давайте я вам перешлю этот показатель!', '10', '0', 'RS6', '1', '3', null, '0', '0', 'нет', '704', '-', '', '0');
INSERT INTO `dialogs` VALUES ('719', '2', '1', '1', '1', '2', '- Давай-давай, открывай, не трать мое время! И новый бюджет посмотри… Какая там динамика от года к году? Открыл?', '10', '0', 'RS6', '2', '0', null, '0', '0', 'RS6_2.wav', '705', '-', '', '0');
INSERT INTO `dialogs` VALUES ('720', '1', '1', '2', '1', '2', '- Да, открыл. Доля производственных издержек в объеме продаж в первом году была сорок пять процентов. Теперь мне надо открыть бюджет второго года и посчитать динамику, вы подождете на телефоне?', '10', '0', 'RS6', '2', '1', null, '0', '0', 'нет', '706', '-', '', '0');
INSERT INTO `dialogs` VALUES ('721', '1', '1', '2', '1', '2', '- Раиса Романовна, дайте мне немного времени. Через пять минут данные будут у вас в почте.', '10', '0', 'RS6', '2', '2', null, '0', '0', 'нет', '707', '-', '', '0');
