INSERT INTO `dialogs` VALUES ('726', '27', '1', '1', '1', '2', '- Привет, милый! Хорошо, что ты на месте!', '0', '0', 'RS7', '1', '0', null, '0', '0', 'RS7_1.wav', '712', '-', '', '1');
INSERT INTO `dialogs` VALUES ('727', '1', '1', '27', '1', '2', '- Люба, извини, я не могу говорить!', '0', '0', 'RS7', '1', '1', null, '0', '0', 'нет', '713', '-', '', '1');
INSERT INTO `dialogs` VALUES ('728', '1', '1', '27', '1', '2', '- Люба, у тебя что-то срочное?', '0', '0', 'RS7', '1', '2', null, '0', '0', 'нет', '714', '-', '', '1');
INSERT INTO `dialogs` VALUES ('729', '1', '1', '27', '1', '2', '- Я слушаю тебя, дорогая!', '0', '0', 'RS7', '1', '3', null, '0', '0', 'нет', '715', '-', '', '1');
INSERT INTO `dialogs` VALUES ('730', '27', '1', '1', '1', '2', '- Понимаешь, мне очень нужен совет, я никак не могу решить, что же лучше. Я уже полдня в магазине. И ничего стоящего нет... Но ведь без подарка не пойдешь... Я тут подобрала варианты, но никак не решусь. Ты ведь можешь пять минут мне уделить? Мне всего-то несколько слов от тебя нужно!', '0', '0', 'RS7', '2', '0', null, '0', '0', 'RS7_2.wav', '716', '-', '', '1');
INSERT INTO `dialogs` VALUES ('731', '1', '1', '27', '1', '2', '- Прости, пожалуйста, но сейчас никак не могу! Уверен, что ты выберешь очень хороший подарок!', '0', '0', 'RS7', '2', '1', '107', '0', '0', 'нет', '717', 'T', '', '1');
INSERT INTO `dialogs` VALUES ('732', '1', '1', '27', '1', '2', '- Прости, я не смогу за тебя решить. Это ведь твоя мама, ты ее лучше знаешь!', '0', '0', 'RS7', '2', '2', null, '0', '0', 'нет', '718', '-', '', '1');
INSERT INTO `dialogs` VALUES ('733', '1', '1', '27', '1', '2', '- Конечно, могу! Много у тебя вариантов?', '0', '0', 'RS7', '2', '3', null, '0', '0', 'нет', '719', '-', '', '1');
INSERT INTO `dialogs` VALUES ('734', '27', '1', '1', '1', '2', '- Мне нужен только совет! … Мне понравились часы настенные, зонт и роскошная напольная ваза. Лучше всего выглядит ваза, но это как-то банально! А часы мы ей уже дарили несколько лет назад. Остается зонт. Ну это совсем несерьезно для подарка. Хотя он ей нужен…старый у нее сломался.', '0', '0', 'RS7', '3', '0', null, '0', '0', 'RS7_3.wav', '720', '-', '', '1');
INSERT INTO `dialogs` VALUES ('735', '1', '1', '27', '1', '2', '- Я не знаю, честно, я ведь не вижу этих предметов – как я могу решить?', '0', '0', 'RS7', '3', '1', null, '0', '0', 'нет', '721', '-', '', '1');
INSERT INTO `dialogs` VALUES ('736', '1', '1', '27', '1', '2', '- Бери зонт! Полезный подарок всегда лучше бесполезного.', '0', '0', 'RS7', '3', '2', null, '0', '0', 'нет', '722', '-', '', '1');
INSERT INTO `dialogs` VALUES ('737', '1', '1', '27', '1', '2', '- Бери вазу! Мама ведь любит красивые вещи!', '0', '0', 'RS7', '3', '3', null, '0', '0', 'нет', '723', '-', '', '1');
INSERT INTO `dialogs` VALUES ('738', '27', '1', '1', '1', '2', '- Хорошо, сейчас пойду посмотрю на них еще раз и куплю либо зонт, либо вазу. Спасибо тебе, что не отказался меня поддержать! Иногда мне так тебя не хватает! Чувствую себя совершенно беспомощной! Ой, самое главное забыла! Я уже не успеваю домой, я обещала маме помочь с сервировкой и салатами. Ты можешь мое платье новое с коричневыми цветами захватить – тебе же по дороге?', '0', '0', 'RS7', '4', '0', null, '0', '0', 'RS7_4.wav', '724', '-', '', '1');
INSERT INTO `dialogs` VALUES ('739', '1', '1', '27', '1', '2', '- Я очень постараюсь, но могу опоздать! С трудом к шести завершу дела!', '0', '0', 'RS7', '4', '1', null, '0', '0', 'нет', '725', '-', '', '1');
INSERT INTO `dialogs` VALUES ('740', '1', '1', '27', '1', '2', '- Знаешь, раньше восьми часов я точно не приду, у меня очень много дел!', '0', '0', 'RS7', '4', '2', null, '0', '0', 'нет', '726', '-', '', '1');
INSERT INTO `dialogs` VALUES ('741', '1', '1', '27', '1', '2', '- Понимаешь, мне для этого придется уйти раньше и у Денежной отпрашиваться, а она сегодня в ужасном настроении!', '0', '0', 'RS7', '4', '3', null, '0', '0', 'нет', '727', '-', '', '1');
INSERT INTO `dialogs` VALUES ('742', '27', '1', '1', '1', '2', '- Так я и думала! На тебя не возможно положиться с этой работой! Как мне теперь быть? Я ведь в обычных джинсах…Мама будет в шоке от такого праздничного наряда! У нее столько приглашенных! Ну что уж теперь! Захвати мое платье, во сколько бы ты не ехал!', '0', '0', 'RS7', '5', '0', '107', '0', '0', 'RS7_5.wav', '728', 'T', '', '1');
INSERT INTO `dialogs` VALUES ('743', '21', '1', '1', '1', '1', 'звук телефонного звонка', '0', '0', 'RST8', '1', '0', null, '0', '0', '', '729', '-', '', '0');
INSERT INTO `dialogs` VALUES ('744', '1', '1', '21', '1', '1', 'Ответить', '0', '0', 'RST8', '1', '1', '93', '0', '0', '', '730', 'RS8', '', '0');
INSERT INTO `dialogs` VALUES ('745', '1', '1', '21', '1', '1', 'Не ответить', '0', '0', 'RST8', '1', '2', '107', '0', '0', '', '731', 'T', '', '0');
INSERT INTO `dialogs` VALUES ('746', '21', '1', '1', '1', '2', '- Здравствуйте, Васильев моя фамилия. Мы не знакомы. Уделите мне пару минут.', '10', '0', 'RS8', '1', '0', null, '0', '0', 'RS8_1.wav', '732', '-', '', '0');
INSERT INTO `dialogs` VALUES ('747', '1', '1', '21', '1', '2', '- Нет, извините, я занят!', '10', '0', 'RS8', '1', '1', null, '0', '0', 'нет', '733', '-', '', '0');
INSERT INTO `dialogs` VALUES ('748', '1', '1', '21', '1', '2', '- Добрый день, а вы по какому вопросу?', '10', '0', 'RS8', '1', '2', null, '0', '0', 'нет', '734', '-', '', '0');
INSERT INTO `dialogs` VALUES ('749', '1', '1', '21', '1', '2', '- Слушаю!', '10', '0', 'RS8', '1', '3', null, '0', '0', 'нет', '735', '-', '', '0');
INSERT INTO `dialogs` VALUES ('750', '21', '1', '1', '1', '2', '- Я по вопросу бюджета. Вы ведь за него в компании отвечаете? А я отвечаю за продажи в регионе А. Тут вот какое дело….даже не знаю с чего начать. Как-то не приходилось до сих пор на своих руководителей жаловаться…', '10', '0', 'RS8', '2', '0', null, '0', '0', 'RS8_2.wav', '736', '-', '', '0');
INSERT INTO `dialogs` VALUES ('751', '1', '1', '21', '1', '2', '- Послушайте, я отвечаю за бюджет, но только технически. С жалобами вам лучше к моему руководителю – Денежной Раисе Романовне.', '10', '0', 'RS8', '2', '1', null, '0', '0', 'нет', '737', '-', '', '0');
INSERT INTO `dialogs` VALUES ('752', '1', '1', '21', '1', '2', '- Вероятно, вы плохо себе структуру представляете. Вам нужен директор по продажам.', '10', '0', 'RS8', '2', '2', null, '0', '0', 'нет', '738', '-', '', '0');
INSERT INTO `dialogs` VALUES ('753', '1', '1', '21', '1', '2', '- Да, я отвечаю за итоговую версию бюджета. Чем я могу вам помочь?', '10', '0', 'RS8', '2', '3', null, '0', '0', 'нет', '739', '-', '', '0');
INSERT INTO `dialogs` VALUES ('754', '21', '1', '1', '1', '2', '- Честно говоря, я не уверен, что мне кто-то может помочь. Но молчать тоже не могу. Да вы не думайте, я не кляузник. Я говорил об этом с директором и ни раз! Только проку нет – ей так удобно, она такой порядок и завела!', '10', '0', 'RS8', '3', '0', null, '0', '0', 'RS8_3.wav', '740', '-', '', '0');
INSERT INTO `dialogs` VALUES ('755', '1', '1', '21', '1', '2', '- Это дело политическое. Я такими вопросами не занимаюсь!', '10', '0', 'RS8', '3', '1', '107', '0', '0', 'нет', '741', 'T', '', '0');
INSERT INTO `dialogs` VALUES ('756', '1', '1', '21', '1', '2', '- Так в чем же проблема?', '10', '0', 'RS8', '3', '2', null, '0', '0', 'нет', '742', '-', '', '0');
INSERT INTO `dialogs` VALUES ('757', '1', '1', '21', '1', '2', '- Серьезный вопрос, давайте я вам после отпуска позвоню!', '10', '0', 'RS8', '3', '3', '139', '0', '0', 'нет', '743', 'P14', '', '0');
INSERT INTO `dialogs` VALUES ('758', '21', '1', '1', '1', '2', '- Дело в том, что бюджет у вас по продажам липовый! Его не собирал никто! Каждый год одно и тоже: факт прошлого года плюс десять процентов равно бюджет нового года. Ни какой тебе работы с клиентами, ни понимания рынка – ничего! Говорит, руководство устраивает! Мы, конечно, не в обиде, если рынок хороший, пару лет назад мы такие премии получали – ого-го! Только время-то идет! Надо какие-то новые ходы предпринимать, а на них деньги нужны! Я без денег ни один новый город освоить не могу. А денег нет – они тоже как фиксированный процент от продаж планируются. Только-только на старую структуру и хватает!', '10', '0', 'RS8', '4', '0', null, '0', '0', 'RS8_4.wav', '744', '-', '', '0');
INSERT INTO `dialogs` VALUES ('759', '1', '1', '21', '1', '2', '- Да, я понимаю. Но вряд ли смогу вам помочь. Вы пишите служебную записку на имя Денежной, а еще лучше – самому Боссу, они непременно разберутся!', '10', '0', 'RS8', '4', '1', '107', '0', '0', 'нет', '745', 'T', '', '0');
INSERT INTO `dialogs` VALUES ('760', '1', '1', '21', '1', '2', '- Понимаю. Давайте на цифрах посмотрим, серьезно ли расходится бюджет и ваши представления!', '10', '0', 'RS8', '4', '2', null, '0', '0', 'нет', '746', '-', '', '0');
INSERT INTO `dialogs` VALUES ('761', '1', '1', '21', '1', '2', '- Важная информация. Только поздно уже в этом году. Бюджет сверстан.', '10', '0', 'RS8', '4', '3', null, '0', '0', 'нет', '747', '-', '', '0');
INSERT INTO `dialogs` VALUES ('762', '21', '1', '1', '1', '2', '- Ну, если мой регион брать, то расхождения в этом году не большие. Только ведь это система. Как в других регионах? А как следующий год? Тут проблему в корне решать нужно! Поверьте, меня не моя премия волнует! Хотя и она, конечно! Но после такого звонка я и работы лишиться могу. Можете помочь?', '10', '0', 'RS8', '5', '0', null, '0', '0', 'RS8_5.wav', '748', '-', '', '0');
INSERT INTO `dialogs` VALUES ('763', '1', '1', '21', '1', '2', '- Думаю, нет. Не мой статус. Вы пишите служебную записку на имя Денежной, а еще лучше – самому Боссу, они непременно разберутся!', '10', '0', 'RS8', '5', '1', '107', '0', '0', 'нет', '749', 'T', '', '0');
INSERT INTO `dialogs` VALUES ('764', '1', '1', '21', '1', '2', '- Я попробую. Поговорю с вашим руководителем. Может быть удастся ее убедить. Спасибо вам за информацию!', '10', '0', 'RS8', '5', '2', null, '0', '0', 'нет', '750', '-', '', '0');
INSERT INTO `dialogs` VALUES ('765', '21', '1', '1', '1', '2', '- Что вы, вам спасибо! Так вы дайте мне знать, получилось чего или нет! Васильев моя фамилия.', '10', '0', 'RS8', '6', '0', '140', '0', '0', 'RS8_6.wav', '751', 'P15', '', '0');
INSERT INTO `dialogs` VALUES ('766', '9', '1', '1', '1', '2', '- Слушаю!', '2', '0', 'RS8.1', '1', '0', null, '0', '0', 'RS8.1_1.wav', '752', '-', '', '0');
INSERT INTO `dialogs` VALUES ('767', '1', '1', '9', '1', '2', '- Добрый день! Федоров. У меня есть к вам важный вопрос по теме бюджета. Давайте встретимся завтра. Минут на тридцать.', '2', '0', 'RS8.1', '1', '1', null, '0', '0', 'нет', '753', '-', '', '0');
INSERT INTO `dialogs` VALUES ('768', '1', '1', '9', '1', '2', '- Добрый день! Федоров. Я бы хотел обсудить с вами важный вопрос по поводу бюджета. Вам удобно говорить?', '2', '0', 'RS8.1', '1', '2', null, '0', '0', 'нет', '754', '-', '', '0');
INSERT INTO `dialogs` VALUES ('769', '9', '1', '1', '1', '2', '- Говорить не могу! Давайте встретимся. Завтра в два дня вам удобно?', '2', '0', 'RS8.1', '2', '0', '141', '0', '0', 'RS8.1_2.wav', '755', 'P16', '', '0');
INSERT INTO `dialogs` VALUES ('770', '34', '1', '1', '1', '1', 'звук телефонного звонка', '0', '0', 'RST9', '1', '0', null, '0', '0', '', '756', '-', '', '0');
INSERT INTO `dialogs` VALUES ('771', '1', '1', '34', '1', '1', 'Ответить', '0', '0', 'RST9', '1', '1', '96', '0', '0', '', '757', 'RS9', '', '0');
INSERT INTO `dialogs` VALUES ('772', '1', '1', '34', '1', '1', 'Не ответить', '0', '0', 'RST9', '1', '2', '107', '0', '0', '', '758', 'T', '', '0');
INSERT INTO `dialogs` VALUES ('773', '34', '1', '1', '1', '2', '- Федоров, посетитель к вам. В документах его нет. Спускайтесь и разбирайтесь сами. Я его без служебной не пущу.', '2', '0', 'RS9', '1', '0', null, '0', '0', 'RS9_1.wav', '759', '-', '', '0');
INSERT INTO `dialogs` VALUES ('774', '1', '1', '34', '1', '2', '- Я никого не жду. Спасибо!', '2', '0', 'RS9', '1', '1', '107', '0', '0', 'нет', '760', 'T', '', '0');
INSERT INTO `dialogs` VALUES ('775', '1', '1', '34', '1', '2', '- А как его фамилия?', '2', '0', 'RS9', '1', '2', null, '0', '0', 'нет', '761', '-', '', '0');
INSERT INTO `dialogs` VALUES ('776', '34', '1', '1', '1', '2', '- Тимофеев, страховой фонд.', '2', '0', 'RS9', '2', '0', null, '0', '0', 'RS9_2.wav', '762', '-', '', '0');
INSERT INTO `dialogs` VALUES ('777', '1', '1', '34', '1', '2', '- Я его не приглашал! Извините!', '2', '0', 'RS9', '2', '1', '107', '0', '0', 'нет', '763', 'T', '', '0');
