INSERT INTO `dialogs` VALUES ('779', '28', '1', '1', '1', '1', 'звук телефонного звонка', '0', '0', 'RST10', '1', '0', null, '0', '0', '', '765', '-', '', '0');
INSERT INTO `dialogs` VALUES ('780', '1', '1', '28', '1', '1', 'Ответить', '0', '0', 'RST10', '1', '1', '98', '0', '0', '', '766', 'RS10', '', '0');
INSERT INTO `dialogs` VALUES ('781', '1', '1', '28', '1', '1', 'Не ответить', '0', '0', 'RST10', '1', '2', '107', '0', '0', '', '767', 'T', '', '0');
INSERT INTO `dialogs` VALUES ('782', '28', '1', '1', '1', '2', '- Привет, друг! Ты жив? Надеюсь, до отпуска дотянешь?', '5', '0', 'RS10', '1', '0', null, '0', '0', 'RS10_1.wav', '768', '-', '', '0');
INSERT INTO `dialogs` VALUES ('783', '1', '1', '28', '1', '2', '- Петр, прости, я не могу говорить, перезвоню!', '5', '0', 'RS10', '1', '1', null, '0', '0', 'нет', '769', '-', '', '0');
INSERT INTO `dialogs` VALUES ('784', '1', '1', '28', '1', '2', '- Привет, Петр. У тебя что-то срочное?', '5', '0', 'RS10', '1', '2', null, '0', '0', 'нет', '770', '-', '', '0');
INSERT INTO `dialogs` VALUES ('785', '1', '1', '28', '1', '2', '- Петр, привет! Рад тебя слышать! Только отпуском и жив ! Как ты?', '5', '0', 'RS10', '1', '3', null, '0', '0', 'нет', '771', '-', '', '0');
INSERT INTO `dialogs` VALUES ('786', '28', '1', '1', '1', '2', '- Я коротенько! Сам со встречи на встречу перебегаю. Хотел тебе напомнить, что нам с негабаритным грузом надо в аэропорту быть заранее. Помнишь, сколько мы в прошлый раз байдарки отправляли? Так что, будь на месте не позже половины шестого.', '5', '0', 'RS10', '2', '0', null, '0', '0', 'RS10_2.wav', '772', '-', '', '0');
INSERT INTO `dialogs` VALUES ('787', '1', '1', '28', '1', '2', '- Хорошо, понял тебя, спасибо! Значит, с работы выходить буду в 15.45. До завтра!', '5', '0', 'RS10', '2', '1', '107', '0', '0', 'нет', '773', 'T', '', '0');
INSERT INTO `dialogs` VALUES ('788', '1', '1', '28', '1', '2', '- Половина шестого? Это во сколько же мне надо с работы уйти? В четыре уже может быть поздно…Как же быть?', '5', '0', 'RS10', '2', '2', null, '0', '0', 'нет', '774', '-', '', '0');
INSERT INTO `dialogs` VALUES ('789', '1', '1', '28', '1', '2', '- О, нет! Я ничего не успею завтра… И половины дел…Слушай, а ты можешь мой багаж забрать сегодня вечером и отправить завтра. А я подъеду к половине седьмого, как и планировал!', '5', '0', 'RS10', '2', '3', null, '0', '0', 'нет', '775', '-', '', '0');
INSERT INTO `dialogs` VALUES ('790', '28', '1', '1', '1', '2', '- Извини, в этот раз помочь не могу! Мне в эти дни не легче! Послушай, у тебя ведь целая команда аналитиков работает – делегируй! Пока!', '5', '0', 'RS10', '3', '0', '107', '0', '0', 'RS10_3.wav', '776', 'T', '', '0');
