INSERT INTO `mail_box` VALUES ('14035', '1', '823', '1', '4', '1', 'По ценовой политике', '1349260320', '1348608180', 'Добрый день! \n\nЯ немного с опережением сделала работу по ценовой политике (вчера выдался свободный вечер). Мне кажется, что я отразила все мысли, которые мы обсуждали на установочной встрече. Будет время в отпуске - посмотрите. \n\nС уважением, Марина Крутько  \nАналитик Отдела аналитики', '1', null, 'MY1', null);
INSERT INTO `mail_box` VALUES ('14036', '2', '823', '1', '11', '1', 'Форма отчетности для производства', '1349262120', '1348608180', 'Доброго вам времени суток! \nПроизводственный отдел просит вас рассмотреть возможность внесения изменеий в текущую форму отчетности по объемам производства и производственным мощностям. На текущий момент в отчетности не достает развернутого анализа остатков на всех наших складах, включая торговые. Это приводит к тому, что мы периодически производим товар, который уже есть в регионах. Логисты говорят, что вполне могли бы обеспечить перебросу товара из одного региона в другой. Таким образом, нам удалось бы сэкономить на производственных издержках без снижения объемов продаж. Прошу вас оценить сроки, тродоемкость и наличие возможности добавить в производственный отчет данные по складским остаткам.\nЗаранее благодарю, Бобр В.,  \nНач. производственного отдела.', '0', null, 'MY2', null);
INSERT INTO `mail_box` VALUES ('14037', '3', '823', '1', '13', '1', 'Новая система мотивации', '1348857900', '1348608180', 'Коллеги, добрый день!        \nПосле нескольких продуктивных совещаний с вами (отдельное спасибо Федорову А. за регулярное участие!) мы подготовили итоговую версию системы мотивации для менеджеров первого и второго уровня. Мы планируем вводить ее в действие с начала 02 года (именно она и будет забюджетирована). Ждем ваших окончательных комментариев и корректировок. Если не участвуете в обсуждении - потом не сетуйте на то, что система была принята без вашего весомого голоса! Благодарю за оперативность! \nС наилучшими пожеланиями, Людовкина С.', '0', null, 'MY3', null);
INSERT INTO `mail_box` VALUES ('14038', '4', '823', '1', '18', '1', 'Трудовой договор', '1349109000', '1348608180', 'Коллеги! В связи с изменениями трудового законодательства юридический отдел вынужден внести в трудовой договор, действующий в данный момент в компании как основной, ряд корректив. Просим вас ознакомиться с ними и донести до своих сотрудников, что с 01 января 02 года будет запущена кампания по подписанию такого варианта трудового договора со всеми актуальными и вновь пришедшими сотрудниками компании. Просим отнестить к этой работе со всей ответственностью и должным вниманием. \nС уважением, Адвокатов Ю.', '0', null, 'MY4', null);
INSERT INTO `mail_box` VALUES ('14039', '5', '823', null, '9', '1', 'срочно! Отчетность', '1349364600', '1348608180', 'Добрый день, коллеги! \nЯ, как всегда, по срочному вопросу. Ни у кого ведь нет сомнений, что продажи крайне важны для компании?! Судя по тому, как у нас работает аналитически отдел - этот приоритет ему не ясен. Дело в том, что у нас регулярно запаздвает отчетность, я так работать не могу - данные приходят тогда, когдя я уже все продала, и планировать поздно. Таким образом, я и мои люди постоянно действуем вслепую!  И это по трем тысячам клиентов!  Какие у вас есть мнения, что с этим делать. ', '0', null, 'M1', null);
INSERT INTO `mail_box` VALUES ('14040', '6', '823', null, '9', '1', 'срочно! Требования клиентов', '1349359500', '1348608180', 'Без комментариев - читайте сами!  Прошу ответ срочно!\nДиректор по продажам Скоробей А.М.     \n\nFwd:\n Уважаемая Алевтина Михайловна! Несколько раз обращался к вашим менеджерам, но воз и ныне там.  Нам очень не удобно работать с вашим текущим прайс-листом! Формат, выбранный вами, не позволяет закачивать цены автоматически и все приходится вбивать вручную. Это серьезно замедляет приемку товара и постановку его в продажи! Хочу отметить, что у всех ваших конкурентов прайс-листы сделаны современым способом и не требуют от нас таких трудозатрат. \n\nПрошу вас решить эту проблему как можно скорее, иначе со следующего месяца нам придется выставлять вам счет за работу людей, вбивающих ваши цены в нашу систему. \n\nС уважением, Горбатюк Е.Д. \nДиректор ООО \"Луч\"', '0', null, 'M2', null);
INSERT INTO `mail_box` VALUES ('14041', '7', '823', null, '13', '1', 'твои аналитики', '1349357400', '1348608180', 'Алексей! \nЯ засекла всех твоих аналитиков на ресурсе по поиску работы. Даже новенького. Ну он еще пока может и не снимал своего объявления - ждет окончания испытательного срока, но вот другие… Что ты с ними делаешь? Бьешь что-ли? Тебе надо с ними поговорить. Я тебе трех аналитиков за 2 дня не найду!  \nВсего доброго, Людовкина С.', '0', null, 'M3', null);
INSERT INTO `mail_box` VALUES ('14042', '8', '823', null, '8', '1', 'предложения', '1349352060', '1348608180', 'Привет, Леша! У нас началась подготовка к годовой стратегической сессии. Ты вечно не доволен форматом нашей презентации, которую заполняют все подразделения для отчета и планов. Шли свои предложения заранее, чтобы ничего не переделывать в пожарном режиме. Удачи, Олег', '0', null, 'M4', null);
INSERT INTO `mail_box` VALUES ('14043', '9', '823', null, '16', '37', 'график отпусков срочно!', '1349355000', '1348608180', 'Срочно! Подготовить и переслать график отпусков на следующий год. Кто не шлет - в отпуск не идет!  \nОтдел кадров.', '0', null, 'M5', null);
INSERT INTO `mail_box` VALUES ('14044', '10', '823', null, '7', '37', 'консультанты и новый проект', '1349348520', '1348608180', 'Внимание! Важно!\n \nУ нас начали работу консультанты по стратегии. Проект большой и важный, требует участия каждого! Просьба всем, как можно скорее, согласовать свои встречи с консультантами! \n\nЭто просьба Генерального Директора. \n\nС уважением, ассистент ГД Долгова Н.Т.', '0', null, 'M6', null);
INSERT INTO `mail_box` VALUES ('14045', '11', '823', null, '14', '37', 'пришлите срочно пожелания!', '1349350800', '1348608180', 'Коллеги! \nТретий раз прошу всех переслать свои пожелания по закупке офисной мебели и планы по ремонту, я из-за вас не могу бюджет сдать нормальный. Всем, кто уже прислал - спасибо! Жду до конца сегодняшнего дня.  \nС уваженим, Хозин.', '0', null, 'M7', null);
INSERT INTO `mail_box` VALUES ('14046', '12', '823', null, '10', '1', '!проблема с сервером!', '1349348460', '1348608180', 'Алексей, срочный вопрос! \n\nМы протестировали ваш сервер на предмет восстановления и ап-грейда. Ребята возились с ним почти неделю, к сожалению, восстановлению и ремонту он не подлежит! Нужно менять срочно! \n\nВ нашем бюджете денег на смену сервера не предусмотрено. Я так понимаю, ты тоже такого форс-мажора не предвидел?!\n\nПиши служебку на деньги. Надо ХХ тыс. на ЕХ5 сервер (менее мощный покупать бессмысслено). \n\nПротянешь - будем разгребать проблемы с потерей информации. Мне ваши объемы информации хранить негде. \n\nВсего, Семен', '0', null, 'M8', null);
INSERT INTO `mail_box` VALUES ('14047', '13', '823', null, '4', '1', 'Презентация для ГД_рабочая версия', '1349308800', '1348608180', 'Добрый день! \n\nПересылаю пока сырую презентацию для ГД.  Что делать дальше мне ясно. Устраивает ли вас структура? Все данные для ее заполнения у меня готовы. Постараюсь завершить работу к 15.30. \n\nС уважением, Марина Крутько \nАналитик Отдела аналитики.', '0', null, 'M9', null);
INSERT INTO `mail_box` VALUES ('14048', '14', '823', null, '4', '1', 'Презентация для ГД_итог', '1349364600', '1348608180', 'Алексей, пересылаю итоговую версию презентации для ГД. Я бы еще поработала над оформлением, но суть уже закончена и можно показывать. Жду обратной связи. С уважением, Марина Крутько Аналитик Отдела аналитики.', '0', null, 'M10', null);
INSERT INTO `mail_box` VALUES ('14049', '15', '823', null, '4', '1', 'Презентация для ГД_драфт версия', '1349308800', '1348608180', 'Отправляю все, что есть. Версия черновая. \n\nС уважением, Марина Крутько Аналитик Отдела аналитики.', '0', null, 'M11', null);
INSERT INTO `mail_box` VALUES ('14050', '16', '823', null, '2', '1', 'Звонок нач.производства Бобра В.', '1349308800', '1348608180', 'Прошу не отвлекать меня от работы по вопросам, относящимся к твоей зоне ответственности.  Спроси у меня еще как цифры в excel поменять! \nДенежная Р.Р.', '0', null, 'M12', null);
INSERT INTO `mail_box` VALUES ('14051', '17', '823', '1', '12', '1', 're: бюджет от логистики', '1349308800', '1348608180', 'Привет, Алексей! Проверяю. Как будет готов - перешлю. \nУдачи, Трудякин', '0', null, 'M31', null);
INSERT INTO `mail_box` VALUES ('14052', '18', '823', '1', '12', '1', 're:re:re: бюджет от логистики', '1349308800', '1348608180', 'Прекрати отвлекать от работы! \nТрудякин.', '0', null, 'M33', null);
INSERT INTO `mail_box` VALUES ('14053', '19', '823', '1', '12', '1', 'бюджет логистики', '1349308800', '1348608180', 'Алексей! Пересылаю бюджет логистики на 02 год. \nС уважением, Трудякин.', '0', null, 'M34', null);
INSERT INTO `mail_box` VALUES ('14054', '20', '823', '1', '12', '1', 'форма по задаче от логистики, срочно!', '1349308800', '1348608180', 'Алексей, прикрепляю форму для выгрузки данных. \nСделайте точно в этом разрезе по прошедшим девяти месяцам 01 года. \nСпасибо за помощь! \nТрудякин.', '0', null, 'M41', null);
INSERT INTO `mail_box` VALUES ('14055', '21', '823', '1', '3', '12', 'выгрузка для логистов', '1349308800', '1348608180', 'Добрый день! Заполнил вашу форму. Есть ли вопросы? \nВсего доброго, Трутнев С.', '0', null, 'M43', null);
INSERT INTO `mail_box` VALUES ('14056', '22', '823', '1', '3', '1', 'выгрузка для логистов', '1349308800', '1348608180', 'Вот, сделал. Смотрите. \nС уваженим, Трутнев С.', '1', null, 'M44', null);
INSERT INTO `mail_box` VALUES ('14057', '23', '823', null, '25', '1', 'данные по рынку, срочно нужна помощь!', '1349349300', '1348608180', 'Привет, Алексей! \n\nУ меня просьба, срочная! \nПришли, пожалуйста, данные по динамике рынка за 00 - 01 год (рост объемов продаж). Даже если вы исследований не делаете, то у вас процентов 50% всего рынка представлено в закупках. Легко можно экстраполировать на весь рынок. \n\nБез этих данных я не могу проверить корректность нашего бюджета. У меня на все осталось пять дней. \n\nОчень нужно, не подведи! \n\nЗаранее благодарю, Иван Доброхотов \nНач.отдела аналитики ОАО \"Терминал\"', '0', null, 'M47', null);
INSERT INTO `mail_box` VALUES ('14058', '24', '823', null, '11', '1', 'новый бюджет по производству', '1349363100', '1348608180', 'Уважаемый Алексей! \nПриношу извинения еще раз! Как я сказал по телефону, здесь нет нашей прямой вины. Очень постараемся не допускать такого в будущем году. Прошу Вас рассмотреть и включить новую версию в сводный бюджет. \nС глубочайшим уважением, Бобр В.', '0', null, 'M56', null);
INSERT INTO `mail_box` VALUES ('14059', '25', '823', null, '19', '1', 'обновление информации', '1349366460', '1348608180', 'Коллеги!         \nПросим всех сотрудников обновить информацию о номерах своих пенсионных свидетельтв. Часть из вас не сдала свидетельства еще с прошлого года!\nОбращаем ваше внимание, что следующая зп не будет начислена, если данные не будут представлены или обновлены.  \nБухгалтерия.\n', '0', null, 'M60', null);
INSERT INTO `mail_box` VALUES ('14060', '26', '823', null, '24', '1', 're:обновление информации', '1349369100', '1348608180', 'Уважаемая бухгалтерия!  \nЯ передал вам информацию дважды, и вы все время ее теряете! Больше давать данные не стану - это дело принципа! Каждый должен выполнять свою работу: моя работа - заниматься производством, ваша - хранить данные!\nСерков А.Т.', '0', null, 'M61', null);
INSERT INTO `mail_box` VALUES ('14061', '27', '823', null, '19', '1', 're:re:обновление информации', '1349370180', '1348608180', 'Уважаемый Г-н Серков! \nВаши данные у нас есть. Можете не предоставлять. Однако не все в офисе столь же сознательные и ответственные. А данные ваша были утрачены не по вине бухгалтерии, а по причине отвратительно организованного переезда в новый офис. \nБухгалтерия.', '0', null, 'M62', null);
INSERT INTO `mail_box` VALUES ('14062', '28', '823', null, '14', '1', 're:re:re:обновление информации', '1349371020', '1348608180', 'Уважаемая бухгалтерия! \nДавайте не поднимать давно забытый скандал! Вы же даже сами тогда извинялись за свои необоснованные претензии. Для того, чтобы сохранить важные данные, их надо складывать в отведенные для этого места! \nНач.АХО, Хозин.', '0', null, 'M63', null);
INSERT INTO `mail_box` VALUES ('14063', '29', '823', null, '29', '1', 'есть лишний билет ', '1349367000', '1348608180', 'Леша, здорово!\nЕсть лишний билет на матч Лиги чемпионов Спартак-Барселона в сектор С. Поедешь с нами? Давно не виделись. Ответь срочно! \nОлег \n', '0', null, 'M64', null);
INSERT INTO `mail_box` VALUES ('14064', '30', '823', null, '17', '1', 'вакцинация! ', '1349371380', '1348608180', 'Уважаемые коллеги, \nв понедельник в офисе будет проведена вакцинация. Время вакцинации вашего отдела с 10 до 12 в большой переговорной. Стоимость вакцинации включена в вашу страховку. Всем, кто не пройдет вакцинацию, больничный оплачиваться не будет.  \nОтдел персонала ', '0', null, 'M65', null);
INSERT INTO `mail_box` VALUES ('14065', '31', '823', null, '17', '1', 'новый сотрудник ', '1349362980', '1348608180', 'Уважаемые коллеги, \nк нашей компании присоединился новый сотрудник - - главный экономист - Сергей Иванович. Сергей Иванович работал в компании “LTD” более 10 лет. Прошу вас найти время и встретиться с ним, чтобы познакомиться и помочь войти в курс дела. \nОтдел  персонала', '0', null, 'M66', null);
INSERT INTO `mail_box` VALUES ('14066', '32', '823', null, '30', '1', 'ДР отца', '1349367420', '1348608180', 'Леха, привет, братан!  Ты не забыл, что отцу 60 в конце этого месяца? Надо придумать подарок и организовать ресторан. Ты дернешь в отпуск - а я все буду делать один? Так не пойдет! Подарок я куплю, а ресторан бери на себя! Нам надо разместить человек двадцать, лучше без музыки и рядом с домом родителей - чтобы пешком. Найдешь - пиши адрес, я всех приглашу, так уж и быть!  \nСерый. \nP.S.Как думаешь, дядю Андрея приглашать? Он же брат, только вот они с отцом не очень...', '0', null, 'M67', null);
INSERT INTO `mail_box` VALUES ('14067', '33', '823', null, '19', '1', 'срок действия карты', '1349369100', '1348608180', 'Коллеги,  просим вас проверить дату истечения ваших кредитных карт. Сообщите нам, если ваша карта истекает в этом месяце, чтобы мы могли во время заняться перевыпуском. Напоминаем, если данные от вас не поступают, мы считаем, что ваша карта не нуждается в перевыпуске! \nБухгалтерия', '0', null, 'M68', null);
INSERT INTO `mail_box` VALUES ('14068', '34', '823', null, '31', '1', 'вакансия ', '1349372880', '1348608180', 'Алексей, приветствую.\n\nМы не знакомы лично. Ваш адрес мне дал наш общий знакомый с самыми лучшими рекомендациями вашего профессионализма.\n \nЯ руковожу фирмой “Легкий полет”, мы ищем опытного аналитика и менеджера для нашего планового отдела из 5 человек. \n\nБыло бы вам интересно обсудить возможность другой работы? \n\nС уважением,\nСтепанов Сергей ', '0', null, 'M69', null);
INSERT INTO `mail_box` VALUES ('14069', '35', '823', null, '32', '1', 'встреча выпускников в эту пятницу ', '1349366100', '1348608180', 'Дорогие мои, \nнадо чаще встречаться, как говорится в слогане известного пива. В эту пятницу будет 5 лет со дня нашего выпуска. Вы, конечно, все очень серьезные и занятые люди, но отказать мне не имеете права. Жду всех (я имею в виду всех, и тебя Леша, и тебя Ксюша) в 19.00 в Парке Культуры возле Бурана. Я подготовла для вас сюрприз. \nТолько немного намекну... “Он капитан, и родина его Марсель...” Помните?! \nВсех целую,\nваша вечная староста, \nМарина ', '0', null, 'M70', null);
INSERT INTO `mail_box` VALUES ('14070', '36', '823', null, '13', '1', 'короткая просьба', '1349355780', '1348608180', 'Алексей, \nперешли мне. плз., описание позиции \"Аналитик\", по которому мы Лошадкина искали. Что-то не могу его у себя в компе найти, удалила что-ли...\nНадеюсь, за твой отпуск продвинемся и к твоему возвращению будет у тебя несколько кандидатов на встречу. Время сейчас хорошее.\nУдачи,\nЛюдовкина С.', '0', null, 'M71', null);
INSERT INTO `mail_box` VALUES ('14071', '37', '823', null, '15', '1', 'отчет срочно!', '1349359380', '1348608180', 'Алексей, добрый день! \n\nМы проводим комплексный анализ работы подразделения в регионе С. В том числе нас интересует складской остаток на 01 число каждого месяца за весь текущий год. \n\nОгромная просьба подготовить этот отчет в ближайшие дни. Моя командировка закончится в понедельник, а мне еще надо провести инвентаризацию на базе данных, которые будут в этом отчете.\n\nСпасибо за помощь,\nАндрей Точных\nНач.службы внутреннего аудита', '0', null, 'M72', null);
INSERT INTO `mail_box` VALUES ('14072', '38', '823', null, '20', '1', 'обучение регионального аналитика', '1349350500', '1348608180', 'Алексей, приветствую!\nЯ взял на работу регионального аналитика, как мы и договаривались. Надеюсь, что теперь у нас будут значительно быстрее проводится все операции. Вы мне обещали его натаскать и задать корпоративный стандарт работы. Он весь ваш!\nС уважением,\nКаменский В.П.\nИсполнительный директор регионального подразделения Д', '0', null, 'M73', null);
INSERT INTO `mail_box` VALUES ('14073', '39', '823', null, '23', '1', 'запрос Крутько', '1349362800', '1348608180', 'Добрый день,\n\nВаша сотрудница М.Крутько прислана нам запрос на закупку нескольких фото файлов. Говорит, что нужны для презентации. Мы так не работаем. Нам нужен запрос от руководителя отдела и вообще-то это оформляется через служебку. Вы подтверждаете, что ей нужны файлы?\n\nОтдел рекламы и оформления\nПетрашевич И.', '0', null, 'M74', null);
INSERT INTO `mail_box` VALUES ('14074', '40', '823', null, '12', '1', 'адрес клиента', '1349371020', '1348608180', 'Алексей,\nа дай-ка мне адресок какого-нибудь положительного клиента. Хочу ему пару вопросов задач, чтобы представить весь объем моих работ по проекту.\n\nСпасибо,\nТрудякин', '0', null, 'M75', null);
INSERT INTO `mail_box` VALUES ('14075', '41', '823', null, '22', '1', 'привет', '1349353380', '1348608180', 'Алексей, привет!\nТы меня спрашивал несколько дней назад когда я смогу тебе показать работу аналитической надстройки, что прислали наши подрядчики. Могу сегодня. Тебе в 4-5 дня подойдет?\n\nМягков Юра', '0', null, 'M76', null);
INSERT INTO `mail_box` VALUES ('14076', '42', '823', null, '33', '1', 'по вашей заявке', '1349358480', '1348608180', 'Уважаемый Алексей!\n\nВы направляли в адрес нашей конференции заявку на участие в роли спикера. \n\nЗаявленная вами тема показалась оргкомитету актуальной и заслуживающей внимания.\n\nПросим вас подготовить тезисы вашего выступления и переслать их в наш адрес не позднее 30 октября.\n\nБлагодарим за ваше участие, \nОрганизационный комитет конференции \"Аналитика и бизнес\"\nИванова О.И.', '0', null, 'M77', null);
INSERT INTO `mail_box` VALUES ('14077', '43', '823', '3', '1', '2', 'Отчет для Правления', '1349281200', '1348608180', 'Раиса Романовна, добрый вечер!\n\nВо вложении файл с отчетом для Правления. Дайте знать, пожалуйста, есть ли замечания, постараюсь внести коррективы к дате встречи Правления. \n\nС уважением,\nФедоров А.', '0', null, 'MSY10', null);
INSERT INTO `mail_box` VALUES ('14078', '44', '823', null, '1', '2', 'Отчет для Правления - исправленный', '1349308800', '1348608180', 'Раиса Романовна, \n\nВо вложении скорректированный файл с отчетом для Правления.  \n\nС уважением,\nФедоров А.', '0', null, 'MS10', null);
INSERT INTO `mail_box` VALUES ('14079', '45', '823', null, '1', '2', 'служебная записка по серверу. Срочно!', '1349308800', '1348608180', 'Служебная записка', '0', null, 'MS20', null);
INSERT INTO `mail_box` VALUES ('14080', '46', '823', null, '1', '4', 'Сводный бюджет', '1349308800', '1348608180', 'Марина,\n\nво вложении - файл Сводного бюджета. Как мы и говорили, задача срочная. У нас есть всего три часа. Будут вопросы - обращайся!\n\nС уважением,\nА.Федоров', '0', null, 'MS21', null);
INSERT INTO `mail_box` VALUES ('14081', '47', '823', null, '1', '3', 'Сводный бюджет', '1349308800', '1348608180', 'Сергей,\n\nво вложении - файл Сводного бюджета. Как мы и говорили, задача срочная. У нас есть всего три часа. Будут вопросы - обращайся!\n\nС уважением,\nА.Федоров', '0', null, 'MS22', null);
INSERT INTO `mail_box` VALUES ('14082', '48', '823', null, '1', '3', 'Методика формирования сводного бюджета', '1349308800', '1348608180', 'Сергей,\n\nво вложении - Методика формирования сводного бюджета. Думаю, она поможет ответить на все твои вопросы. Если что не понятно - обращайся!\n\nС уважением,\nА.Федоров', '0', null, 'MS23', null);
INSERT INTO `mail_box` VALUES ('14083', '49', '823', null, '1', '6', 'Презентация на выставку', '1349308800', '1348608180', 'Уважаемый Валерий Семенович,\n\nво вложении - Презентация на выставку. \n\nГотов ответить на Ваши вопросы и дать комментарии!\n\nС уважением,\nА.Федоров', '0', null, 'MS25', null);
INSERT INTO `mail_box` VALUES ('14084', '50', '823', null, '1', '3', 'Fwd: Проблема с сервером!', '1349308800', '1348608180', 'Сергей! \nПрочти сообщение ниже и срочно подготовь служебку на получение денег для сервера на имя Денежной. \n\nС уважением,\nФедоров А.\n\n', '0', null, 'MS27', null);
INSERT INTO `mail_box` VALUES ('14085', '51', '823', null, '1', '11', 'бюджет производства прошлого года', '1349308800', '1348608180', 'Уважаемый Василий,\n\nя нашел для вас последнюю итоговую версию бюджета производства прошлого года. Она во вложении.\n\nВсего доброго,\nФедоров А.', '0', null, 'MS28', null);
INSERT INTO `mail_box` VALUES ('14086', '52', '823', null, '1', '3', 'задача: бюджет производства прошлого года', '1349308800', '1348608180', 'Сергей,\n\nпрошу тебя найти последнюю итоговую версию бюджета производства на 01 год и переслать ее Начальнику производственного отдела  Василию Бобру. Поставь меня в копию, пожалуйста.\n\nС уважением,\nФедоров А.', '0', null, 'MS29', null);
INSERT INTO `mail_box` VALUES ('14087', '53', '823', null, '1', '12', 'бюджет логистики', '1349308800', '1348608180', 'Егор, приветствую!\n\nНесмотря на прошедший срок сдачи, так и не получил от вас бюджет логистики на 02 год. Надеюсь, что ты понимаешь, что отсутствие вашего бюджета задерживает весь процесс бюджетирования и формирования сводного. От меня требуется подготовить и сдать сводный бюджет в течение трех часов. Срочно жду от тебя бюджет логистики! \n\nС уважением,\nФедоров А.', '0', null, 'MS30', null);
INSERT INTO `mail_box` VALUES ('14088', '54', '823', null, '1', '12', 're:re: бюджет от логистики', '1349308800', '1348608180', 'Егор, \n\nвсе возможные сроки реакции на мою просьбу уже прошли! Я требую немедленно предоставить бюджет логистики или мне придется информировать Генерального директора о несоблюдении регламента. \n\nС уважением,\nФедоров А.', '0', null, 'MS32', null);
INSERT INTO `mail_box` VALUES ('14089', '55', '823', null, '1', '2', 'Сводный бюджет', '1349308800', '1348608180', 'Вот сводный бюджет. Файл прикреплен', '0', null, 'MS35', null);
INSERT INTO `mail_box` VALUES ('14090', '56', '823', null, '1', '2', 'Сводный бюджет: итоговые корректировки', '1349308800', '1348608180', 'Вот новый сводный бюджет. Изменения следующие….Файл прикреплен', '0', null, 'MS36', null);
INSERT INTO `mail_box` VALUES ('14091', '57', '823', null, '1', '4', 're: преза для ГД, наброски', '1349308800', '1348608180', 'Марина,\n\nя посмотрел наброски к презентации. Все в порядке, продолжай! Жду итоговый вариант к 15.30.\n\nС уважением,\nФедоров А.', '0', null, 'MS57', null);
INSERT INTO `mail_box` VALUES ('14092', '58', '823', null, '1', '4', 're: Преза для ГД, итог', '1349308800', '1348608180', 'хорошо, продолжай, о результатах встречи расскажу', '0', null, 'MS37', null);
INSERT INTO `mail_box` VALUES ('14093', '59', '823', null, '1', '4', 'итог встречи по презентации для ГД', '1349308800', '1348608180', 'все хорошо, Босс доволен, ты - молодец', '0', null, 'MS38', null);
INSERT INTO `mail_box` VALUES ('14094', '60', '823', null, '1', '4', 'Презентация для ГД: распечатать', '1349308800', '1348608180', 'Распечатай столько-то к такому-то числу, в цвете. ', '0', null, 'MS39', null);
INSERT INTO `mail_box` VALUES ('14095', '61', '823', null, '1', '3', 'Задача отдела логистики', '1349308800', '1348608180', 'Сергей,\n\nнесколько дней назад логисты просили сделать для них выгрузку. Мы обсуждали с тобой эту задачу и сроки ее исполнения. Сегодня - срок сдачи работы. Перешли мне то, что у тебя получилось в ближайшие тридцать минут, пожалуйста. \n\nС уважением,\nФедоров А.', '0', null, 'MS58', null);
INSERT INTO `mail_box` VALUES ('14096', '62', '823', null, '1', '3', 'Fwd: форма по задаче от логистики, срочно!', '1349308800', '1348608180', 'Логисты хотят получить данные в приложенной форме. За последние 9 месяцев. Сделай срочно! Думаю, что пару часов тебе хватит. Вложен пример формы.', '0', null, 'MS42', null);
INSERT INTO `mail_box` VALUES ('14097', '63', '823', null, '1', '12', 're: форма по задаче от логистики, срочно!', '1349308800', '1348608180', 'Егор,\n\nво вложении - форма о твоему запросу. \n\nМы сделали срочно, как ты и просил.\n\nСообщи, пожалуйста, все ли вас устраивает и не осталось ли вопросов по этому заданию.\n\nС уважением,\nФедоров А.', '0', null, 'MS45', null);
INSERT INTO `mail_box` VALUES ('14098', '64', '823', null, '1', '3', 'Fwd: данные по рынку, срочно нужна помощь!', '1349308800', '1348608180', 'По задаче ТЕ3.2 Подготовь отчет по данным от наших клиентов - по всему рынку. В нем должно быть отражено…..  И отправь Ивану Доброхотову - я в копии.', '0', null, 'MS46', null);
INSERT INTO `mail_box` VALUES ('14099', '65', '823', null, '1', '2', 'Динамика производственных затрат', '1349308800', '1348608180', 'По задаче ТRC6 (o доле производственных затрат). Должен написать точно тему, хорошо струткурировать письмо. Сдлеть эту работу срочно после звонка.', '0', null, 'MS48', null);
INSERT INTO `mail_box` VALUES ('14100', '66', '823', null, '1', '9', 'Бюджетирование в дирекции продаж', '1349308800', '1348608180', 'Давайте встретимся. У меня есть информация по процессу вашего бюджета. Есть что обсудить.ИЛИ  Разговаривал с вашим нач.отдела продаж региона А. Он рассказал о вашей системе планирования. Это безобразие! Это не верный метод. Вы таким образом ставите под угрозу бюджет всей компании. Дайте мне слово, что все поменяете, иначе я буду жаловаться ФД!', '0', null, 'MS49', null);
INSERT INTO `mail_box` VALUES ('14101', '67', '823', null, '1', '2', 'Жалоба', '1349308800', '1348608180', 'Жалоба на ОК. Эти козлы время не согласовывают, а потом меня еще пугают!', '0', null, 'MS50', null);
INSERT INTO `mail_box` VALUES ('14102', '68', '823', null, '1', '7', 'Данные по распечатке презентаций', '1349308800', '1348608180', 'Наталья Тимофеевна,\n\nБосс просил уточнить у вас следующую информацию относительно его презентации на выставке:\n1. Сколько копий нам надо распечатать.\n2. Кому передать распечатанные копии.\n3. Когда они должны быть переданы.\n\nСпасибо за информацию,\nФедоров А.', '0', null, 'MS51', null);
INSERT INTO `mail_box` VALUES ('14103', '69', '823', null, '1', '3', 'Отчет по 3 кварталу', '1349308800', '1348608180', 'Стандартная работа по подготовке отчета по 3 кв. Начинай с продаж. К моему возвращению отчет должен быть у меня на проверку.', '0', null, 'MS54', null);
INSERT INTO `mail_box` VALUES ('14104', '70', '823', null, '1', '39', 'Приглашение: новая система премирования', '1349308800', '1348608180', 'Коллеги,\n\nзавтра, в 12.00, приглашаю вас в мой кабинет для презентации новой системы премирования на 4 квартал.\n\nС уважением,\nФедоров А.', '0', null, 'MS55', null);
INSERT INTO `mail_box` VALUES ('14105', '71', '823', null, '1', '9', 're:срочно! Отчетность', '1349308800', '1348608180', 'ответить всем и предложить встретиться для обсуждения этого вопроса, в неправильной версии - разъяснения, что аналитика понимает важность продаж, что отчетность сейчас собирается долго т.к. Не автоматизирован процесс сбора данных с клиентов, а мы этим сейчас занимаемся...', '0', null, 'MS40', null);
INSERT INTO `mail_box` VALUES ('14106', '72', '823', null, '1', '9', 're:срочно! Требования клиентов', '1349308800', '1348608180', 'предложить директору по продажам выяснить у других клиентов - так ли это у всех, если да, то выносить на общее обсуждение с участием наших ИТ-ков', '0', null, 'MS52', null);
INSERT INTO `mail_box` VALUES ('14107', '73', '823', null, '1', '2', 'план на завтра', '1349308800', '1348608180', 'Раиса Романовна\n\nПрикрепляю мой план на завтра. Завтра я должен уйти в 16.00, как я уже говорил вам ранее.\n\nС уважением,\nФедоров А.', '0', null, 'MS53', null);
INSERT INTO `mail_box` VALUES ('14108', '74', '823', null, '1', '39', 'Fwd: вакцинация! ', '1349308800', '1348608180', 'Коллеги, вам нужно пройти вакцинацию в понедельник. Запланируйте в своих календарях, пожалуйста.\n\nС уваженим,\nФедоров А.\n', '0', null, 'MS65', null);
INSERT INTO `mail_box` VALUES ('14109', '75', '823', null, '1', '15', 're: отчет срочно!', '1349308800', '1348608180', 'Аркадий, приветствую!\n\nОтчет сделаем. Данные будут у тебя завтра во второй половине дня.\n\nУдачи,\nФедоров А.', '0', null, 'MS66', null);
INSERT INTO `mail_box` VALUES ('14110', '76', '823', null, '1', '3', 'Fwd: отчет срочно!', '1349308800', '1348608180', 'Сергей, \n\nвключи это задание в свой план работ, пожалуйста. Тебе необходимо выгрузить складской остаток в регионе С на 01 число каждого месяца с января по октябрь этого года. \n\nПрошу выполнить задание до двух дня, чтобы я мог его посмотреть перед отправкой. \n\nСпасибо,\nФедоров А.', '0', null, 'MS67', null);
INSERT INTO `mail_box` VALUES ('14111', '77', '823', null, '1', '20', 're: обучение регионального аналитика', '1349308800', '1348608180', 'Добрый день, Виктор Петрович!\n\nОчень рад, что вы нашли аналитика!\n\nНепременно помогу вам с его обучением и адаптацией. Завтра с четрех я в отпуске, а потому, запланирую разговор с ним на первые дни недели после отпуска. ', '0', null, 'MS62', null);
