INSERT INTO `mail_box` VALUES ('14115', '81', '823', null, '1', '22', 're: привет', '1349308800', '1348608180', 'Привет, Юра! Сегодня и завтра, к сожалению, не могу. Давай запланируем после отпуска.', '0', null, 'MS61', null);
INSERT INTO `mail_box` VALUES ('14116', '82', '823', null, '1', '4', 'встреча с ГД по презентации', '1349308800', '1348608180', 'Марина,\n\nБосс сегодня встречаться не смог, а завтра он на выезде. Потому прошу тебя встретиться с ним в понедельник в 10.00 для пояснений по презентации. Презентацию ему я уже отправил.\n\nНе волнуйся, я уверен, что ты справишься.\n\nСпасибо,\nФедоров А.', '0', null, 'MS68', null);
INSERT INTO `mail_box` VALUES ('14117', '83', '823', null, '1', '12', 'квартальный план', '1349308800', '1348608180', 'Егор, во вложении моя версия квартального плана.\n\nС уважениям,\nФедоров А.', '0', null, 'MS69', null);
INSERT INTO `mail_box` VALUES ('14118', '84', '823', null, '1', '3', 'ошибка в отчете для правления', '1349308800', '1348608180', 'Сергей,\n\nты сделал ошибку в отчете для Правления, а я ее проустил. Опять получил сегодня выговор от Денежной. Исправь немедленно и пришли мне новую версию отчета.\n\nФедоров А.', '0', null, 'MS70', null);
