INSERT INTO `mail_box` VALUES ('40327', '1', '1032', '1', '4', '1', 'По ценовой политике', '1349222400', '1350606561', 'Добрый день! \n\nЯ немного с опережением сделала работу по ценовой политике (вчера выдался свободный вечер). Мне кажется, что я отразила все мысли, которые мы обсуждали на установочной встрече. Будет время в отпуске - посмотрите. \n\nС уважением, Марина Крутько  \nАналитик Отдела аналитики', '0', null, 'MY1', '632');
INSERT INTO `mail_box` VALUES ('40328', '2', '1032', '1', '11', '1', 'Форма отчетности для производства', '1349222400', '1350606561', 'Доброго вам времени суток! \nПроизводственный отдел просит вас рассмотреть возможность внесения изменеий в текущую форму отчетности по объемам производства и производственным мощностям. На текущий момент в отчетности не достает развернутого анализа остатков на всех наших складах, включая торговые. Это приводит к тому, что мы периодически производим товар, который уже есть в регионах. Логисты говорят, что вполне могли бы обеспечить перебросу товара из одного региона в другой. Таким образом, нам удалось бы сэкономить на производственных издержках без снижения объемов продаж. Прошу вас оценить сроки, тродоемкость и наличие возможности добавить в производственный отчет данные по складским остаткам.\nЗаранее благодарю, Бобр В.,  \nНач. производственного отдела.', '0', null, 'MY2', '662');
INSERT INTO `mail_box` VALUES ('40329', '3', '1032', '1', '13', '1', 'Новая система мотивации', '1348790400', '1350606561', 'Коллеги, добрый день!        \nПосле нескольких продуктивных совещаний с вами (отдельное спасибо Федорову А. за регулярное участие!) мы подготовили итоговую версию системы мотивации для менеджеров первого и второго уровня. Мы планируем вводить ее в действие с начала 02 года (именно она и будет забюджетирована). Ждем ваших окончательных комментариев и корректировок. Если не участвуете в обсуждении - потом не сетуйте на то, что система была принята без вашего весомого голоса! Благодарю за оперативность! \nС наилучшими пожеланиями, Людовкина С.', '0', null, 'MY3', '1125');
INSERT INTO `mail_box` VALUES ('40330', '4', '1032', '1', '18', '1', 'Трудовой договор', '1349049600', '1350606561', 'Коллеги! В связи с изменениями трудового законодательства юридический отдел вынужден внести в трудовой договор, действующий в данный момент в компании как основной, ряд корректив. Просим вас ознакомиться с ними и донести до своих сотрудников, что с 01 января 02 года будет запущена кампания по подписанию такого варианта трудового договора со всеми актуальными и вновь пришедшими сотрудниками компании. Просим отнестить к этой работе со всей ответственностью и должным вниманием. \nС уважением, Адвокатов Ю.', '0', null, 'MY4', '990');
INSERT INTO `mail_box` VALUES ('40331', '5', '1032', null, '9', '1', 'срочно! Отчетность', '1349308800', '1350606561', 'Добрый день, коллеги! \nЯ, как всегда, по срочному вопросу. Ни у кого ведь нет сомнений, что продажи крайне важны для компании?! Судя по тому, как у нас работает аналитически отдел - этот приоритет ему не ясен. Дело в том, что у нас регулярно запаздвает отчетность, я так работать не могу - данные приходят тогда, когдя я уже все продала, и планировать поздно. Таким образом, я и мои люди постоянно действуем вслепую!  И это по трем тысячам клиентов!  Какие у вас есть мнения, что с этим делать. ', '0', null, 'M1', '930');
INSERT INTO `mail_box` VALUES ('40332', '6', '1032', null, '9', '1', 'срочно! Требования клиентов', '1349308800', '1350606561', 'Без комментариев - читайте сами!  Прошу ответ срочно!\nДиректор по продажам Скоробей А.М.     \n\nFwd:\n Уважаемая Алевтина Михайловна! Несколько раз обращался к вашим менеджерам, но воз и ныне там.  Нам очень не удобно работать с вашим текущим прайс-листом! Формат, выбранный вами, не позволяет закачивать цены автоматически и все приходится вбивать вручную. Это серьезно замедляет приемку товара и постановку его в продажи! Хочу отметить, что у всех ваших конкурентов прайс-листы сделаны современым способом и не требуют от нас таких трудозатрат. \n\nПрошу вас решить эту проблему как можно скорее, иначе со следующего месяца нам придется выставлять вам счет за работу людей, вбивающих ваши цены в нашу систему. \n\nС уважением, Горбатюк Е.Д. \nДиректор ООО \"Луч\"', '0', null, 'M2', '845');
INSERT INTO `mail_box` VALUES ('40333', '7', '1032', null, '13', '1', 'твои аналитики', '1349308800', '1350606561', 'Алексей! \nЯ засекла всех твоих аналитиков на ресурсе по поиску работы. Даже новенького. Ну он еще пока может и не снимал своего объявления - ждет окончания испытательного срока, но вот другие… Что ты с ними делаешь? Бьешь что-ли? Тебе надо с ними поговорить. Я тебе трех аналитиков за 2 дня не найду!  \nВсего доброго, Людовкина С.', '0', null, 'M3', '810');
INSERT INTO `mail_box` VALUES ('40334', '8', '1032', null, '8', '1', 'предложения', '1349308800', '1350606561', 'Привет, Леша! У нас началась подготовка к годовой стратегической сессии. Ты вечно не доволен форматом нашей презентации, которую заполняют все подразделения для отчета и планов. Шли свои предложения заранее, чтобы ничего не переделывать в пожарном режиме. Удачи, Олег', '0', null, 'M4', '721');
INSERT INTO `mail_box` VALUES ('40335', '9', '1032', null, '16', '37', 'график отпусков срочно!', '1349308800', '1350606561', 'Срочно! Подготовить и переслать график отпусков на следующий год. Кто не шлет - в отпуск не идет!  \nОтдел кадров.', '0', null, 'M5', '770');
INSERT INTO `mail_box` VALUES ('40336', '10', '1032', null, '7', '37', 'консультанты и новый проект', '1349308800', '1350606561', 'Внимание! Важно!\n \nУ нас начали работу консультанты по стратегии. Проект большой и важный, требует участия каждого! Просьба всем, как можно скорее, согласовать свои встречи с консультантами! \n\nЭто просьба Генерального Директора. \n\nС уважением, ассистент ГД Долгова Н.Т.', '0', null, 'M6', '662');
INSERT INTO `mail_box` VALUES ('40337', '11', '1032', null, '14', '37', 'пришлите срочно пожелания!', '1349308800', '1350606561', 'Коллеги! \nТретий раз прошу всех переслать свои пожелания по закупке офисной мебели и планы по ремонту, я из-за вас не могу бюджет сдать нормальный. Всем, кто уже прислал - спасибо! Жду до конца сегодняшнего дня.  \nС уваженим, Хозин.', '0', null, 'M7', '700');
INSERT INTO `mail_box` VALUES ('40338', '12', '1032', null, '10', '1', '!проблема с сервером!', '1349308800', '1350606561', 'Алексей, срочный вопрос! \n\nМы протестировали ваш сервер на предмет восстановления и ап-грейда. Ребята возились с ним почти неделю, к сожалению, восстановлению и ремонту он не подлежит! Нужно менять срочно! \n\nВ нашем бюджете денег на смену сервера не предусмотрено. Я так понимаю, ты тоже такого форс-мажора не предвидел?!\n\nПиши служебку на деньги. Надо ХХ тыс. на ЕХ5 сервер (менее мощный покупать бессмысслено). \n\nПротянешь - будем разгребать проблемы с потерей информации. Мне ваши объемы информации хранить негде. \n\nВсего, Семен', '0', null, 'M8', '661');
INSERT INTO `mail_box` VALUES ('40339', '13', '1032', null, '4', '1', 'Презентация для ГД_рабочая версия', '1349308800', '1350606561', 'Добрый день! \n\nПересылаю пока сырую презентацию для ГД.  Что делать дальше мне ясно. Устраивает ли вас структура? Все данные для ее заполнения у меня готовы. Постараюсь завершить работу к 15.30. \n\nС уважением, Марина Крутько \nАналитик Отдела аналитики.', '0', null, 'M9', '0');
INSERT INTO `mail_box` VALUES ('40340', '14', '1032', null, '4', '1', 'Презентация для ГД_итог', '1349308800', '1350606561', 'Алексей, пересылаю итоговую версию презентации для ГД. Я бы еще поработала над оформлением, но суть уже закончена и можно показывать. Жду обратной связи. С уважением, Марина Крутько Аналитик Отдела аналитики.', '0', null, 'M10', '930');
INSERT INTO `mail_box` VALUES ('40341', '15', '1032', null, '4', '1', 'Презентация для ГД_драфт версия', '1349308800', '1350606561', 'Отправляю все, что есть. Версия черновая. \n\nС уважением, Марина Крутько Аналитик Отдела аналитики.', '0', null, 'M11', '0');
INSERT INTO `mail_box` VALUES ('40342', '16', '1032', null, '2', '1', 'Звонок нач.производства Бобра В.', '1349308800', '1350606561', 'Прошу не отвлекать меня от работы по вопросам, относящимся к твоей зоне ответственности.  Спроси у меня еще как цифры в excel поменять! \nДенежная Р.Р.', '0', null, 'M12', '0');
