INSERT INTO `mail_box` VALUES ('40345', '19', '1032', null, '12', '1', 'бюджет логистики', '1349308800', '1350606561', 'Алексей! Пересылаю бюджет логистики на 02 год. \nС уважением, Трудякин.', '0', null, 'M34', '0');
INSERT INTO `mail_box` VALUES ('40346', '20', '1032', null, '12', '1', 'форма по задаче от логистики, срочно!', '1349308800', '1350606561', 'Алексей, прикрепляю форму для выгрузки данных. \nСделайте точно в этом разрезе по прошедшим девяти месяцам 01 года. \nСпасибо за помощь! \nТрудякин.', '0', null, 'M41', '0');
INSERT INTO `mail_box` VALUES ('40347', '21', '1032', null, '3', '12', 'выгрузка для логистов', '1349308800', '1350606561', 'Добрый день! Заполнил вашу форму. Есть ли вопросы? \nВсего доброго, Трутнев С.', '0', null, 'M43', '0');
INSERT INTO `mail_box` VALUES ('40348', '22', '1032', null, '3', '1', 'выгрузка для логистов', '1349308800', '1350606561', 'Вот, сделал. Смотрите. \nС уваженим, Трутнев С.', '0', null, 'M44', '0');
INSERT INTO `mail_box` VALUES ('40349', '23', '1032', null, '25', '1', 'данные по рынку, срочно нужна помощь!', '1349308800', '1350606561', 'Привет, Алексей! \n\nУ меня просьба, срочная! \nПришли, пожалуйста, данные по динамике рынка за 00 - 01 год (рост объемов продаж). Даже если вы исследований не делаете, то у вас процентов 50% всего рынка представлено в закупках. Легко можно экстраполировать на весь рынок. \n\nБез этих данных я не могу проверить корректность нашего бюджета. У меня на все осталось пять дней. \n\nОчень нужно, не подведи! \n\nЗаранее благодарю, Иван Доброхотов \nНач.отдела аналитики ОАО \"Терминал\"', '0', null, 'M47', '675');
INSERT INTO `mail_box` VALUES ('40350', '24', '1032', null, '11', '1', 'новый бюджет по производству', '1349308800', '1350606561', 'Уважаемый Алексей! \nПриношу извинения еще раз! Как я сказал по телефону, здесь нет нашей прямой вины. Очень постараемся не допускать такого в будущем году. Прошу Вас рассмотреть и включить новую версию в сводный бюджет. \nС глубочайшим уважением, Бобр В.', '0', null, 'M56', '905');
INSERT INTO `mail_box` VALUES ('40351', '25', '1032', null, '19', '1', 'обновление информации', '1349308800', '1350606561', 'Коллеги!         \nПросим всех сотрудников обновить информацию о номерах своих пенсионных свидетельтв. Часть из вас не сдала свидетельства еще с прошлого года!\nОбращаем ваше внимание, что следующая зп не будет начислена, если данные не будут представлены или обновлены.  \nБухгалтерия.\n', '0', null, 'M60', '961');
INSERT INTO `mail_box` VALUES ('40352', '26', '1032', null, '24', '1', 're:обновление информации', '1349308800', '1350606561', 'Уважаемая бухгалтерия!  \nЯ передал вам информацию дважды, и вы все время ее теряете! Больше давать данные не стану - это дело принципа! Каждый должен выполнять свою работу: моя работа - заниматься производством, ваша - хранить данные!\nСерков А.Т.', '0', null, 'M61', '1005');
INSERT INTO `mail_box` VALUES ('40353', '27', '1032', null, '19', '1', 're:re:обновление информации', '1349308800', '1350606561', 'Уважаемый Г-н Серков! \nВаши данные у нас есть. Можете не предоставлять. Однако не все в офисе столь же сознательные и ответственные. А данные ваша были утрачены не по вине бухгалтерии, а по причине отвратительно организованного переезда в новый офис. \nБухгалтерия.', '0', null, 'M62', '1023');
INSERT INTO `mail_box` VALUES ('40354', '28', '1032', null, '14', '1', 're:re:re:обновление информации', '1349308800', '1350606561', 'Уважаемая бухгалтерия! \nДавайте не поднимать давно забытый скандал! Вы же даже сами тогда извинялись за свои необоснованные претензии. Для того, чтобы сохранить важные данные, их надо складывать в отведенные для этого места! \nНач.АХО, Хозин.', '0', null, 'M63', '1037');
INSERT INTO `mail_box` VALUES ('40355', '29', '1032', null, '29', '1', 'есть лишний билет ', '1349308800', '1350606561', 'Леша, здорово!\nЕсть лишний билет на матч Лиги чемпионов Спартак-Барселона в сектор С. Поедешь с нами? Давно не виделись. Ответь срочно! \nОлег \n', '0', null, 'M64', '970');
INSERT INTO `mail_box` VALUES ('40356', '30', '1032', null, '17', '1', 'вакцинация! ', '1349308800', '1350606561', 'Уважаемые коллеги, \nв понедельник в офисе будет проведена вакцинация. Время вакцинации вашего отдела с 10 до 12 в большой переговорной. Стоимость вакцинации включена в вашу страховку. Всем, кто не пройдет вакцинацию, больничный оплачиваться не будет.  \nОтдел персонала ', '0', null, 'M65', '1043');
INSERT INTO `mail_box` VALUES ('40357', '31', '1032', null, '17', '1', 'новый сотрудник ', '1349308800', '1350606561', 'Уважаемые коллеги, \nк нашей компании присоединился новый сотрудник - - главный экономист - Сергей Иванович. Сергей Иванович работал в компании “LTD” более 10 лет. Прошу вас найти время и встретиться с ним, чтобы познакомиться и помочь войти в курс дела. \nОтдел  персонала', '0', null, 'M66', '903');
INSERT INTO `mail_box` VALUES ('40358', '32', '1032', null, '30', '1', 'ДР отца', '1349308800', '1350606561', 'Леха, привет, братан!  Ты не забыл, что отцу 60 в конце этого месяца? Надо придумать подарок и организовать ресторан. Ты дернешь в отпуск - а я все буду делать один? Так не пойдет! Подарок я куплю, а ресторан бери на себя! Нам надо разместить человек двадцать, лучше без музыки и рядом с домом родителей - чтобы пешком. Найдешь - пиши адрес, я всех приглашу, так уж и быть!  \nСерый. \nP.S.Как думаешь, дядю Андрея приглашать? Он же брат, только вот они с отцом не очень...', '0', null, 'M67', '977');
INSERT INTO `mail_box` VALUES ('40359', '33', '1032', null, '19', '1', 'срок действия карты', '1349308800', '1350606561', 'Коллеги,  просим вас проверить дату истечения ваших кредитных карт. Сообщите нам, если ваша карта истекает в этом месяце, чтобы мы могли во время заняться перевыпуском. Напоминаем, если данные от вас не поступают, мы считаем, что ваша карта не нуждается в перевыпуске! \nБухгалтерия', '0', null, 'M68', '1005');
INSERT INTO `mail_box` VALUES ('40360', '34', '1032', null, '31', '1', 'вакансия ', '1349308800', '1350606561', 'Алексей, приветствую.\n\nМы не знакомы лично. Ваш адрес мне дал наш общий знакомый с самыми лучшими рекомендациями вашего профессионализма.\n \nЯ руковожу фирмой “Легкий полет”, мы ищем опытного аналитика и менеджера для нашего планового отдела из 5 человек. \n\nБыло бы вам интересно обсудить возможность другой работы? \n\nС уважением,\nСтепанов Сергей ', '0', null, 'M69', '1068');
INSERT INTO `mail_box` VALUES ('40361', '35', '1032', null, '32', '1', 'встреча выпускников в эту пятницу ', '1349308800', '1350606561', 'Дорогие мои, \nнадо чаще встречаться, как говорится в слогане известного пива. В эту пятницу будет 5 лет со дня нашего выпуска. Вы, конечно, все очень серьезные и занятые люди, но отказать мне не имеете права. Жду всех (я имею в виду всех, и тебя Леша, и тебя Ксюша) в 19.00 в Парке Культуры возле Бурана. Я подготовла для вас сюрприз. \nТолько немного намекну... “Он капитан, и родина его Марсель...” Помните?! \nВсех целую,\nваша вечная староста, \nМарина ', '0', null, 'M70', '955');
INSERT INTO `mail_box` VALUES ('40362', '36', '1032', null, '13', '1', 'короткая просьба', '1349308800', '1350606561', 'Алексей, \nперешли мне. плз., описание позиции \"Аналитик\", по которому мы Лошадкина искали. Что-то не могу его у себя в компе найти, удалила что-ли...\nНадеюсь, за твой отпуск продвинемся и к твоему возвращению будет у тебя несколько кандидатов на встречу. Время сейчас хорошее.\nУдачи,\nЛюдовкина С.', '0', null, 'M71', '783');
INSERT INTO `mail_box` VALUES ('40363', '37', '1032', null, '15', '1', 'отчет срочно!', '1349308800', '1350606561', 'Алексей, добрый день! \n\nМы проводим комплексный анализ работы подразделения в регионе С. В том числе нас интересует складской остаток на 01 число каждого месяца за весь текущий год. \n\nОгромная просьба подготовить этот отчет в ближайшие дни. Моя командировка закончится в понедельник, а мне еще надо провести инвентаризацию на базе данных, которые будут в этом отчете.\n\nСпасибо за помощь,\nАндрей Точных\nНач.службы внутреннего аудита', '0', null, 'M72', '843');
INSERT INTO `mail_box` VALUES ('40364', '38', '1032', null, '20', '1', 'обучение регионального аналитика', '1349308800', '1350606561', 'Алексей, приветствую!\nЯ взял на работу регионального аналитика, как мы и договаривались. Надеюсь, что теперь у нас будут значительно быстрее проводится все операции. Вы мне обещали его натаскать и задать корпоративный стандарт работы. Он весь ваш!\nС уважением,\nКаменский В.П.\nИсполнительный директор регионального подразделения Д', '0', null, 'M73', '695');
INSERT INTO `mail_box` VALUES ('40365', '39', '1032', null, '23', '1', 'запрос Крутько', '1349308800', '1350606561', 'Добрый день,\n\nВаша сотрудница М.Крутько прислана нам запрос на закупку нескольких фото файлов. Говорит, что нужны для презентации. Мы так не работаем. Нам нужен запрос от руководителя отдела и вообще-то это оформляется через служебку. Вы подтверждаете, что ей нужны файлы?\n\nОтдел рекламы и оформления\nПетрашевич И.', '0', null, 'M74', '900');
INSERT INTO `mail_box` VALUES ('40366', '40', '1032', null, '12', '1', 'адрес клиента', '1349308800', '1350606561', 'Алексей,\nа дай-ка мне адресок какого-нибудь положительного клиента. Хочу ему пару вопросов задач, чтобы представить весь объем моих работ по проекту.\n\nСпасибо,\nТрудякин', '0', null, 'M75', '1037');
INSERT INTO `mail_box` VALUES ('40367', '41', '1032', null, '22', '1', 'привет', '1349308800', '1350606561', 'Алексей, привет!\nТы меня спрашивал несколько дней назад когда я смогу тебе показать работу аналитической надстройки, что прислали наши подрядчики. Могу сегодня. Тебе в 4-5 дня подойдет?\n\nМягков Юра', '0', null, 'M76', '743');
INSERT INTO `mail_box` VALUES ('40368', '42', '1032', null, '33', '1', 'по вашей заявке', '1349308800', '1350606561', 'Уважаемый Алексей!\n\nВы направляли в адрес нашей конференции заявку на участие в роли спикера. \n\nЗаявленная вами тема показалась оргкомитету актуальной и заслуживающей внимания.\n\nПросим вас подготовить тезисы вашего выступления и переслать их в наш адрес не позднее 30 октября.\n\nБлагодарим за ваше участие, \nОрганизационный комитет конференции \"Аналитика и бизнес\"\nИванова О.И.', '0', null, 'M77', '828');
INSERT INTO `mail_box` VALUES ('40369', '43', '1032', '3', '1', '2', 'Отчет для Правления', '1349222400', '1350606561', 'Раиса Романовна, добрый вечер!\n\nВо вложении файл с отчетом для Правления. Дайте знать, пожалуйста, есть ли замечания, постараюсь внести коррективы к дате встречи Правления. \n\nС уважением,\nФедоров А.', '0', null, 'MSY10', '980');
INSERT INTO `mail_box` VALUES ('40370', '44', '1032', null, '1', '2', 'Отчет для Правления - исправленный', '1349308800', '1350606561', 'Раиса Романовна, \n\nВо вложении скорректированный файл с отчетом для Правления.  \n\nС уважением,\nФедоров А.', '0', null, 'MS10', '0');
INSERT INTO `mail_box` VALUES ('40371', '45', '1032', null, '1', '2', 'служебная записка по серверу. Срочно!', '1349308800', '1350606561', 'Служебная записка', '0', null, 'MS20', '0');
INSERT INTO `mail_box` VALUES ('40372', '46', '1032', null, '1', '4', 'Сводный бюджет', '1349308800', '1350606561', 'Марина,\n\nво вложении - файл Сводного бюджета. Как мы и говорили, задача срочная. У нас есть всего три часа. Будут вопросы - обращайся!\n\nС уважением,\nА.Федоров', '0', null, 'MS21', '0');
INSERT INTO `mail_box` VALUES ('40373', '47', '1032', null, '1', '3', 'Сводный бюджет', '1349308800', '1350606561', 'Сергей,\n\nво вложении - файл Сводного бюджета. Как мы и говорили, задача срочная. У нас есть всего три часа. Будут вопросы - обращайся!\n\nС уважением,\nА.Федоров', '0', null, 'MS22', '0');
INSERT INTO `mail_box` VALUES ('40374', '48', '1032', null, '1', '3', 'Методика формирования сводного бюджета', '1349308800', '1350606561', 'Сергей,\n\nво вложении - Методика формирования сводного бюджета. Думаю, она поможет ответить на все твои вопросы. Если что не понятно - обращайся!\n\nС уважением,\nА.Федоров', '0', null, 'MS23', '0');
INSERT INTO `mail_box` VALUES ('40375', '49', '1032', null, '1', '6', 'Презентация на выставку', '1349308800', '1350606561', 'Уважаемый Валерий Семенович,\n\nво вложении - Презентация на выставку. \n\nГотов ответить на Ваши вопросы и дать комментарии!\n\nС уважением,\nА.Федоров', '0', null, 'MS25', '0');
INSERT INTO `mail_box` VALUES ('40376', '50', '1032', null, '1', '3', 'Fwd: Проблема с сервером!', '1349308800', '1350606561', 'Сергей! \nПрочти сообщение ниже и срочно подготовь служебку на получение денег для сервера на имя Денежной. \n\nС уважением,\nФедоров А.\n\n', '0', null, 'MS27', '0');
INSERT INTO `mail_box` VALUES ('40377', '51', '1032', null, '1', '11', 'бюджет производства прошлого года', '1349308800', '1350606561', 'Уважаемый Василий,\n\nя нашел для вас последнюю итоговую версию бюджета производства прошлого года. Она во вложении.\n\nВсего доброго,\nФедоров А.', '0', null, 'MS28', '0');
INSERT INTO `mail_box` VALUES ('40378', '52', '1032', null, '1', '3', 'задача: бюджет производства прошлого года', '1349308800', '1350606561', 'Сергей,\n\nпрошу тебя найти последнюю итоговую версию бюджета производства на 01 год и переслать ее Начальнику производственного отдела  Василию Бобру. Поставь меня в копию, пожалуйста.\n\nС уважением,\nФедоров А.', '0', null, 'MS29', '0');
INSERT INTO `mail_box` VALUES ('40379', '53', '1032', null, '1', '12', 'бюджет логистики', '1349308800', '1350606561', 'Егор, приветствую!\n\nНесмотря на прошедший срок сдачи, так и не получил от вас бюджет логистики на 02 год. Надеюсь, что ты понимаешь, что отсутствие вашего бюджета задерживает весь процесс бюджетирования и формирования сводного. От меня требуется подготовить и сдать сводный бюджет в течение трех часов. Срочно жду от тебя бюджет логистики! \n\nС уважением,\nФедоров А.', '0', null, 'MS30', '0');
INSERT INTO `mail_box` VALUES ('40380', '54', '1032', null, '1', '12', 're:re: бюджет от логистики', '1349308800', '1350606561', 'Егор, \n\nвсе возможные сроки реакции на мою просьбу уже прошли! Я требую немедленно предоставить бюджет логистики или мне придется информировать Генерального директора о несоблюдении регламента. \n\nС уважением,\nФедоров А.', '0', null, 'MS32', '0');
INSERT INTO `mail_box` VALUES ('40381', '55', '1032', null, '1', '2', 'Сводный бюджет', '1349308800', '1350606561', 'Вот сводный бюджет. Файл прикреплен', '0', null, 'MS35', '0');
