INSERT INTO `mail_box` VALUES ('40383', '57', '1032', null, '1', '4', 're: преза для ГД, наброски', '1349308800', '1350606561', 'Марина,\n\nя посмотрел наброски к презентации. Все в порядке, продолжай! Жду итоговый вариант к 15.30.\n\nС уважением,\nФедоров А.', '0', null, 'MS57', '0');
