INSERT INTO `mail_box` VALUES ('40385', '59', '1032', null, '1', '4', 'итог встречи по презентации для ГД', '1349308800', '1350606561', 'все хорошо, Босс доволен, ты - молодец', '0', null, 'MS38', '0');
INSERT INTO `mail_box` VALUES ('40386', '60', '1032', null, '1', '4', 'Презентация для ГД: распечатать', '1349308800', '1350606561', 'Распечатай столько-то к такому-то числу, в цвете. ', '0', null, 'MS39', '0');
INSERT INTO `mail_box` VALUES ('40387', '61', '1032', null, '1', '3', 'Задача отдела логистики', '1349308800', '1350606561', 'Сергей,\n\nнесколько дней назад логисты просили сделать для них выгрузку. Мы обсуждали с тобой эту задачу и сроки ее исполнения. Сегодня - срок сдачи работы. Перешли мне то, что у тебя получилось в ближайшие тридцать минут, пожалуйста. \n\nС уважением,\nФедоров А.', '0', null, 'MS58', '0');
INSERT INTO `mail_box` VALUES ('40388', '62', '1032', null, '1', '3', 'Fwd: форма по задаче от логистики, срочно!', '1349308800', '1350606561', 'Логисты хотят получить данные в приложенной форме. За последние 9 месяцев. Сделай срочно! Думаю, что пару часов тебе хватит. Вложен пример формы.', '0', null, 'MS42', '0');
INSERT INTO `mail_box` VALUES ('40389', '63', '1032', null, '1', '12', 're: форма по задаче от логистики, срочно!', '1349308800', '1350606561', 'Егор,\n\nво вложении - форма о твоему запросу. \n\nМы сделали срочно, как ты и просил.\n\nСообщи, пожалуйста, все ли вас устраивает и не осталось ли вопросов по этому заданию.\n\nС уважением,\nФедоров А.', '0', null, 'MS45', '0');
INSERT INTO `mail_box` VALUES ('40390', '64', '1032', null, '1', '3', 'Fwd: данные по рынку, срочно нужна помощь!', '1349308800', '1350606561', 'По задаче ТЕ3.2 Подготовь отчет по данным от наших клиентов - по всему рынку. В нем должно быть отражено…..  И отправь Ивану Доброхотову - я в копии.', '0', null, 'MS46', '0');
INSERT INTO `mail_box` VALUES ('40391', '65', '1032', null, '1', '2', 'Динамика производственных затрат', '1349308800', '1350606561', 'По задаче ТRC6 (o доле производственных затрат). Должен написать точно тему, хорошо струткурировать письмо. Сдлеть эту работу срочно после звонка.', '0', null, 'MS48', '0');
INSERT INTO `mail_box` VALUES ('40392', '66', '1032', null, '1', '9', 'Бюджетирование в дирекции продаж', '1349308800', '1350606561', 'Давайте встретимся. У меня есть информация по процессу вашего бюджета. Есть что обсудить.ИЛИ  Разговаривал с вашим нач.отдела продаж региона А. Он рассказал о вашей системе планирования. Это безобразие! Это не верный метод. Вы таким образом ставите под угрозу бюджет всей компании. Дайте мне слово, что все поменяете, иначе я буду жаловаться ФД!', '0', null, 'MS49', '0');
INSERT INTO `mail_box` VALUES ('40393', '67', '1032', null, '1', '2', 'Жалоба', '1349308800', '1350606561', 'Жалоба на ОК. Эти козлы время не согласовывают, а потом меня еще пугают!', '0', null, 'MS50', '0');
INSERT INTO `mail_box` VALUES ('40394', '68', '1032', null, '1', '7', 'Данные по распечатке презентаций', '1349308800', '1350606561', 'Наталья Тимофеевна,\n\nБосс просил уточнить у вас следующую информацию относительно его презентации на выставке:\n1. Сколько копий нам надо распечатать.\n2. Кому передать распечатанные копии.\n3. Когда они должны быть переданы.\n\nСпасибо за информацию,\nФедоров А.', '0', null, 'MS51', '0');
INSERT INTO `mail_box` VALUES ('40395', '69', '1032', null, '1', '3', 'Отчет по 3 кварталу', '1349308800', '1350606561', 'Стандартная работа по подготовке отчета по 3 кв. Начинай с продаж. К моему возвращению отчет должен быть у меня на проверку.', '0', null, 'MS54', '0');
INSERT INTO `mail_box` VALUES ('40396', '70', '1032', null, '1', '39', 'Приглашение: новая система премирования', '1349308800', '1350606561', 'Коллеги,\n\nзавтра, в 12.00, приглашаю вас в мой кабинет для презентации новой системы премирования на 4 квартал.\n\nС уважением,\nФедоров А.', '0', null, 'MS55', '0');
INSERT INTO `mail_box` VALUES ('40397', '71', '1032', null, '1', '9', 're:срочно! Отчетность', '1349308800', '1350606561', 'ответить всем и предложить встретиться для обсуждения этого вопроса, в неправильной версии - разъяснения, что аналитика понимает важность продаж, что отчетность сейчас собирается долго т.к. Не автоматизирован процесс сбора данных с клиентов, а мы этим сейчас занимаемся...', '0', null, 'MS40', '0');
INSERT INTO `mail_box` VALUES ('40398', '72', '1032', null, '1', '9', 're:срочно! Требования клиентов', '1349308800', '1350606561', 'предложить директору по продажам выяснить у других клиентов - так ли это у всех, если да, то выносить на общее обсуждение с участием наших ИТ-ков', '0', null, 'MS52', '0');
INSERT INTO `mail_box` VALUES ('40399', '73', '1032', null, '1', '2', 'план на завтра', '1349308800', '1350606561', 'Раиса Романовна\n\nПрикрепляю мой план на завтра. Завтра я должен уйти в 16.00, как я уже говорил вам ранее.\n\nС уважением,\nФедоров А.', '0', null, 'MS53', '0');
INSERT INTO `mail_box` VALUES ('40400', '74', '1032', null, '1', '39', 'Fwd: вакцинация! ', '1349308800', '1350606561', 'Коллеги, вам нужно пройти вакцинацию в понедельник. Запланируйте в своих календарях, пожалуйста.\n\nС уваженим,\nФедоров А.\n', '0', null, 'MS65', '0');
INSERT INTO `mail_box` VALUES ('40401', '75', '1032', null, '1', '15', 're: отчет срочно!', '1349308800', '1350606561', 'Аркадий, приветствую!\n\nОтчет сделаем. Данные будут у тебя завтра во второй половине дня.\n\nУдачи,\nФедоров А.', '0', null, 'MS66', '0');
INSERT INTO `mail_box` VALUES ('40402', '76', '1032', null, '1', '3', 'Fwd: отчет срочно!', '1349308800', '1350606561', 'Сергей, \n\nвключи это задание в свой план работ, пожалуйста. Тебе необходимо выгрузить складской остаток в регионе С на 01 число каждого месяца с января по октябрь этого года. \n\nПрошу выполнить задание до двух дня, чтобы я мог его посмотреть перед отправкой. \n\nСпасибо,\nФедоров А.', '0', null, 'MS67', '0');
INSERT INTO `mail_box` VALUES ('40403', '77', '1032', null, '1', '20', 're: обучение регионального аналитика', '1349308800', '1350606561', 'Добрый день, Виктор Петрович!\n\nОчень рад, что вы нашли аналитика!\n\nНепременно помогу вам с его обучением и адаптацией. Завтра с четрех я в отпуске, а потому, запланирую разговор с ним на первые дни недели после отпуска. ', '0', null, 'MS62', '0');
INSERT INTO `mail_box` VALUES ('40404', '78', '1032', null, '1', '13', 're: короткая просьба', '1349308800', '1350606561', 'Хорошо, лови.', '0', null, 'MS63', '0');
INSERT INTO `mail_box` VALUES ('40405', '79', '1032', null, '1', '23', 're: запрос Крутько', '1349308800', '1350606561', 'Да, сделайте. Подтверждаю.', '0', null, 'MS64', '0');
INSERT INTO `mail_box` VALUES ('40406', '80', '1032', null, '1', '12', 're: адрес клиента', '1349308800', '1350606561', 'Адрес ниже.', '0', null, 'MS60', '0');
INSERT INTO `mail_box` VALUES ('40407', '81', '1032', null, '1', '22', 're: привет', '1349308800', '1350606561', 'Привет, Юра! Сегодня и завтра, к сожалению, не могу. Давай запланируем после отпуска.', '0', null, 'MS61', '0');
INSERT INTO `mail_box` VALUES ('40408', '82', '1032', null, '1', '4', 'встреча с ГД по презентации', '1349308800', '1350606561', 'Марина,\n\nБосс сегодня встречаться не смог, а завтра он на выезде. Потому прошу тебя встретиться с ним в понедельник в 10.00 для пояснений по презентации. Презентацию ему я уже отправил.\n\nНе волнуйся, я уверен, что ты справишься.\n\nСпасибо,\nФедоров А.', '0', null, 'MS68', '0');
INSERT INTO `mail_box` VALUES ('40409', '83', '1032', null, '1', '12', 'квартальный план', '1349308800', '1350606561', 'Егор, во вложении моя версия квартального плана.\n\nС уважениям,\nФедоров А.', '0', null, 'MS69', '0');
INSERT INTO `mail_box` VALUES ('40410', '84', '1032', null, '1', '3', 'ошибка в отчете для правления', '1349308800', '1350606561', 'Сергей,\n\nты сделал ошибку в отчете для Правления, а я ее проустил. Опять получил сегодня выговор от Денежной. Исправь немедленно и пришли мне новую версию отчета.\n\nФедоров А.', '0', null, 'MS70', '0');
