INSERT INTO `mail_template` VALUES ('1', '1', '4', '1', 'По ценовой политике', '1349260320', null, 'Добрый день! \n\nЯ немного с опережением сделала работу по ценовой политике (вчера выдался свободный вечер). Мне кажется, что я отразила все мысли, которые мы обсуждали на установочной встрече. Будет время в отпуске - посмотрите. \n\nС уважением, Марина Крутько  \nАналитик Отдела аналитики', null, 'MY1', '632', '10:32', '03.10.2012');
INSERT INTO `mail_template` VALUES ('2', '1', '11', '1', 'Форма отчетности для производства', '1349262120', null, 'Доброго вам времени суток! \nПроизводственный отдел просит вас рассмотреть возможность внесения изменеий в текущую форму отчетности по объемам производства и производственным мощностям. На текущий момент в отчетности не достает развернутого анализа остатков на всех наших складах, включая торговые. Это приводит к тому, что мы периодически производим товар, который уже есть в регионах. Логисты говорят, что вполне могли бы обеспечить перебросу товара из одного региона в другой. Таким образом, нам удалось бы сэкономить на производственных издержках без снижения объемов продаж. Прошу вас оценить сроки, тродоемкость и наличие возможности добавить в производственный отчет данные по складским остаткам.\nЗаранее благодарю, Бобр В.,  \nНач. производственного отдела.', null, 'MY2', '662', '11:02', '03.10.2012');
INSERT INTO `mail_template` VALUES ('3', '1', '13', '1', 'Новая система мотивации', '1348857900', null, 'Коллеги, добрый день!        \nПосле нескольких продуктивных совещаний с вами (отдельное спасибо Федорову А. за регулярное участие!) мы подготовили итоговую версию системы мотивации для менеджеров первого и второго уровня. Мы планируем вводить ее в действие с начала 02 года (именно она и будет забюджетирована). Ждем ваших окончательных комментариев и корректировок. Если не участвуете в обсуждении - потом не сетуйте на то, что система была принята без вашего весомого голоса! Благодарю за оперативность! \nС наилучшими пожеланиями, Людовкина С.', null, 'MY3', '1125', '18:45', '28.09.2012');
INSERT INTO `mail_template` VALUES ('4', '1', '18', '1', 'Трудовой договор', '1349109000', null, 'Коллеги! В связи с изменениями трудового законодательства юридический отдел вынужден внести в трудовой договор, действующий в данный момент в компании как основной, ряд корректив. Просим вас ознакомиться с ними и донести до своих сотрудников, что с 01 января 02 года будет запущена кампания по подписанию такого варианта трудового договора со всеми актуальными и вновь пришедшими сотрудниками компании. Просим отнестить к этой работе со всей ответственностью и должным вниманием. \nС уважением, Адвокатов Ю.', null, 'MY4', '990', '16:30', '01.10.2012');
INSERT INTO `mail_template` VALUES ('5', null, '9', '1', 'срочно! Отчетность', '1349364600', null, 'Добрый день, коллеги! \nЯ, как всегда, по срочному вопросу. Ни у кого ведь нет сомнений, что продажи крайне важны для компании?! Судя по тому, как у нас работает аналитически отдел - этот приоритет ему не ясен. Дело в том, что у нас регулярно запаздвает отчетность, я так работать не могу - данные приходят тогда, когдя я уже все продала, и планировать поздно. Таким образом, я и мои люди постоянно действуем вслепую!  И это по трем тысячам клиентов!  Какие у вас есть мнения, что с этим делать. ', null, 'M1', '930', '15:30', '04.10.2012');
INSERT INTO `mail_template` VALUES ('6', null, '9', '1', 'срочно! Требования клиентов', '1349359500', null, 'Без комментариев - читайте сами!  Прошу ответ срочно!\nДиректор по продажам Скоробей А.М.     \n\nFwd:\n Уважаемая Алевтина Михайловна! Несколько раз обращался к вашим менеджерам, но воз и ныне там.  Нам очень не удобно работать с вашим текущим прайс-листом! Формат, выбранный вами, не позволяет закачивать цены автоматически и все приходится вбивать вручную. Это серьезно замедляет приемку товара и постановку его в продажи! Хочу отметить, что у всех ваших конкурентов прайс-листы сделаны современым способом и не требуют от нас таких трудозатрат. \n\nПрошу вас решить эту проблему как можно скорее, иначе со следующего месяца нам придется выставлять вам счет за работу людей, вбивающих ваши цены в нашу систему. \n\nС уважением, Горбатюк Е.Д. \nДиректор ООО \"Луч\"', null, 'M2', '845', '14:05', '04.10.2012');
INSERT INTO `mail_template` VALUES ('7', null, '13', '1', 'твои аналитики', '1349357400', null, 'Алексей! \nЯ засекла всех твоих аналитиков на ресурсе по поиску работы. Даже новенького. Ну он еще пока может и не снимал своего объявления - ждет окончания испытательного срока, но вот другие… Что ты с ними делаешь? Бьешь что-ли? Тебе надо с ними поговорить. Я тебе трех аналитиков за 2 дня не найду!  \nВсего доброго, Людовкина С.', null, 'M3', '810', '13:30', '04.10.2012');
INSERT INTO `mail_template` VALUES ('8', null, '8', '1', 'предложения', '1349352060', null, 'Привет, Леша! У нас началась подготовка к годовой стратегической сессии. Ты вечно не доволен форматом нашей презентации, которую заполняют все подразделения для отчета и планов. Шли свои предложения заранее, чтобы ничего не переделывать в пожарном режиме. Удачи, Олег', null, 'M4', '721', '12:01', '04.10.2012');
INSERT INTO `mail_template` VALUES ('9', null, '16', '37', 'график отпусков срочно!', '1349355000', null, 'Срочно! Подготовить и переслать график отпусков на следующий год. Кто не шлет - в отпуск не идет!  \nОтдел кадров.', null, 'M5', '770', '12:50', '04.10.2012');
INSERT INTO `mail_template` VALUES ('10', null, '7', '37', 'консультанты и новый проект', '1349348520', null, 'Внимание! Важно!\n \nУ нас начали работу консультанты по стратегии. Проект большой и важный, требует участия каждого! Просьба всем, как можно скорее, согласовать свои встречи с консультантами! \n\nЭто просьба Генерального Директора. \n\nС уважением, ассистент ГД Долгова Н.Т.', null, 'M6', '662', '11:02', '04.10.2012');
INSERT INTO `mail_template` VALUES ('11', null, '14', '37', 'пришлите срочно пожелания!', '1349350800', null, 'Коллеги! \nТретий раз прошу всех переслать свои пожелания по закупке офисной мебели и планы по ремонту, я из-за вас не могу бюджет сдать нормальный. Всем, кто уже прислал - спасибо! Жду до конца сегодняшнего дня.  \nС уваженим, Хозин.', null, 'M7', '700', '11:40', '04.10.2012');
INSERT INTO `mail_template` VALUES ('12', null, '10', '1', '!проблема с сервером!', '1349348460', null, 'Алексей, срочный вопрос! \n\nМы протестировали ваш сервер на предмет восстановления и ап-грейда. Ребята возились с ним почти неделю, к сожалению, восстановлению и ремонту он не подлежит! Нужно менять срочно! \n\nВ нашем бюджете денег на смену сервера не предусмотрено. Я так понимаю, ты тоже такого форс-мажора не предвидел?!\n\nПиши служебку на деньги. Надо ХХ тыс. на ЕХ5 сервер (менее мощный покупать бессмысслено). \n\nПротянешь - будем разгребать проблемы с потерей информации. Мне ваши объемы информации хранить негде. \n\nВсего, Семен', null, 'M8', '661', '11:01', '04.10.2012');
INSERT INTO `mail_template` VALUES ('13', null, '4', '1', 'Презентация для ГД_рабочая версия', '1349308800', null, 'Добрый день! \n\nПересылаю пока сырую презентацию для ГД.  Что делать дальше мне ясно. Устраивает ли вас структура? Все данные для ее заполнения у меня готовы. Постараюсь завершить работу к 15.30. \n\nС уважением, Марина Крутько \nАналитик Отдела аналитики.', null, 'M9', '0', '', '04.10.2012');
INSERT INTO `mail_template` VALUES ('14', null, '4', '1', 'Презентация для ГД_итог', '1349364600', null, 'Алексей, пересылаю итоговую версию презентации для ГД. Я бы еще поработала над оформлением, но суть уже закончена и можно показывать. Жду обратной связи. С уважением, Марина Крутько Аналитик Отдела аналитики.', null, 'M10', '930', '15:30', '04.10.2012');
INSERT INTO `mail_template` VALUES ('15', null, '4', '1', 'Презентация для ГД_драфт версия', '1349308800', null, 'Отправляю все, что есть. Версия черновая. \n\nС уважением, Марина Крутько Аналитик Отдела аналитики.', null, 'M11', '0', '', '04.10.2012');
INSERT INTO `mail_template` VALUES ('16', null, '2', '1', 'Звонок нач.производства Бобра В.', '1349308800', null, 'Прошу не отвлекать меня от работы по вопросам, относящимся к твоей зоне ответственности.  Спроси у меня еще как цифры в excel поменять! \nДенежная Р.Р.', null, 'M12', '0', '', '04.10.2012');
INSERT INTO `mail_template` VALUES ('17', null, '12', '1', 're: бюджет от логистики', '1349308800', null, 'Привет, Алексей! Проверяю. Как будет готов - перешлю. \nУдачи, Трудякин', null, 'M31', '0', '', '04.10.2012');
INSERT INTO `mail_template` VALUES ('18', null, '12', '1', 're:re:re: бюджет от логистики', '1349308800', null, 'Прекрати отвлекать от работы! \nТрудякин.', null, 'M33', '0', '', '04.10.2012');
INSERT INTO `mail_template` VALUES ('19', null, '12', '1', 'бюджет логистики', '1349308800', null, 'Алексей! Пересылаю бюджет логистики на 02 год. \nС уважением, Трудякин.', null, 'M34', '0', '', '04.10.2012');
INSERT INTO `mail_template` VALUES ('20', null, '12', '1', 'форма по задаче от логистики, срочно!', '1349308800', null, 'Алексей, прикрепляю форму для выгрузки данных. \nСделайте точно в этом разрезе по прошедшим девяти месяцам 01 года. \nСпасибо за помощь! \nТрудякин.', null, 'M41', '0', '', '04.10.2012');
INSERT INTO `mail_template` VALUES ('21', null, '3', '12', 'выгрузка для логистов', '1349308800', null, 'Добрый день! Заполнил вашу форму. Есть ли вопросы? \nВсего доброго, Трутнев С.', null, 'M43', '0', '', '04.10.2012');
INSERT INTO `mail_template` VALUES ('22', null, '3', '1', 'выгрузка для логистов', '1349308800', null, 'Вот, сделал. Смотрите. \nС уваженим, Трутнев С.', null, 'M44', '0', '', '04.10.2012');
INSERT INTO `mail_template` VALUES ('23', null, '25', '1', 'данные по рынку, срочно нужна помощь!', '1349349300', null, 'Привет, Алексей! \n\nУ меня просьба, срочная! \nПришли, пожалуйста, данные по динамике рынка за 00 - 01 год (рост объемов продаж). Даже если вы исследований не делаете, то у вас процентов 50% всего рынка представлено в закупках. Легко можно экстраполировать на весь рынок. \n\nБез этих данных я не могу проверить корректность нашего бюджета. У меня на все осталось пять дней. \n\nОчень нужно, не подведи! \n\nЗаранее благодарю, Иван Доброхотов \nНач.отдела аналитики ОАО \"Терминал\"', null, 'M47', '675', '11:15', '04.10.2012');
INSERT INTO `mail_template` VALUES ('24', null, '11', '1', 'новый бюджет по производству', '1349363100', null, 'Уважаемый Алексей! \nПриношу извинения еще раз! Как я сказал по телефону, здесь нет нашей прямой вины. Очень постараемся не допускать такого в будущем году. Прошу Вас рассмотреть и включить новую версию в сводный бюджет. \nС глубочайшим уважением, Бобр В.', null, 'M56', '905', '15:05', '04.10.2012');
INSERT INTO `mail_template` VALUES ('25', null, '19', '1', 'обновление информации', '1349366460', null, 'Коллеги!         \nПросим всех сотрудников обновить информацию о номерах своих пенсионных свидетельтв. Часть из вас не сдала свидетельства еще с прошлого года!\nОбращаем ваше внимание, что следующая зп не будет начислена, если данные не будут представлены или обновлены.  \nБухгалтерия.\n', null, 'M60', '961', '16:01', '04.10.2012');
INSERT INTO `mail_template` VALUES ('26', null, '24', '1', 're:обновление информации', '1349369100', null, 'Уважаемая бухгалтерия!  \nЯ передал вам информацию дважды, и вы все время ее теряете! Больше давать данные не стану - это дело принципа! Каждый должен выполнять свою работу: моя работа - заниматься производством, ваша - хранить данные!\nСерков А.Т.', null, 'M61', '1005', '16:45', '04.10.2012');
INSERT INTO `mail_template` VALUES ('27', null, '19', '1', 're:re:обновление информации', '1349370180', null, 'Уважаемый Г-н Серков! \nВаши данные у нас есть. Можете не предоставлять. Однако не все в офисе столь же сознательные и ответственные. А данные ваша были утрачены не по вине бухгалтерии, а по причине отвратительно организованного переезда в новый офис. \nБухгалтерия.', null, 'M62', '1023', '17:03', '04.10.2012');
INSERT INTO `mail_template` VALUES ('28', null, '14', '1', 're:re:re:обновление информации', '1349371020', null, 'Уважаемая бухгалтерия! \nДавайте не поднимать давно забытый скандал! Вы же даже сами тогда извинялись за свои необоснованные претензии. Для того, чтобы сохранить важные данные, их надо складывать в отведенные для этого места! \nНач.АХО, Хозин.', null, 'M63', '1037', '17:17', '04.10.2012');
INSERT INTO `mail_template` VALUES ('29', null, '29', '1', 'есть лишний билет ', '1349367000', null, 'Леша, здорово!\nЕсть лишний билет на матч Лиги чемпионов Спартак-Барселона в сектор С. Поедешь с нами? Давно не виделись. Ответь срочно! \nОлег \n', null, 'M64', '970', '16:10', '04.10.2012');
INSERT INTO `mail_template` VALUES ('30', null, '17', '1', 'вакцинация! ', '1349371380', null, 'Уважаемые коллеги, \nв понедельник в офисе будет проведена вакцинация. Время вакцинации вашего отдела с 10 до 12 в большой переговорной. Стоимость вакцинации включена в вашу страховку. Всем, кто не пройдет вакцинацию, больничный оплачиваться не будет.  \nОтдел персонала ', null, 'M65', '1043', '17:23', '04.10.2012');
INSERT INTO `mail_template` VALUES ('31', null, '17', '1', 'новый сотрудник ', '1349362980', null, 'Уважаемые коллеги, \nк нашей компании присоединился новый сотрудник - - главный экономист - Сергей Иванович. Сергей Иванович работал в компании “LTD” более 10 лет. Прошу вас найти время и встретиться с ним, чтобы познакомиться и помочь войти в курс дела. \nОтдел  персонала', null, 'M66', '903', '15:03', '04.10.2012');
INSERT INTO `mail_template` VALUES ('32', null, '30', '1', 'ДР отца', '1349367420', null, 'Леха, привет, братан!  Ты не забыл, что отцу 60 в конце этого месяца? Надо придумать подарок и организовать ресторан. Ты дернешь в отпуск - а я все буду делать один? Так не пойдет! Подарок я куплю, а ресторан бери на себя! Нам надо разместить человек двадцать, лучше без музыки и рядом с домом родителей - чтобы пешком. Найдешь - пиши адрес, я всех приглашу, так уж и быть!  \nСерый. \nP.S.Как думаешь, дядю Андрея приглашать? Он же брат, только вот они с отцом не очень...', null, 'M67', '977', '16:17', '04.10.2012');
INSERT INTO `mail_template` VALUES ('33', null, '19', '1', 'срок действия карты', '1349369100', null, 'Коллеги,  просим вас проверить дату истечения ваших кредитных карт. Сообщите нам, если ваша карта истекает в этом месяце, чтобы мы могли во время заняться перевыпуском. Напоминаем, если данные от вас не поступают, мы считаем, что ваша карта не нуждается в перевыпуске! \nБухгалтерия', null, 'M68', '1005', '16:45', '04.10.2012');
INSERT INTO `mail_template` VALUES ('34', null, '31', '1', 'вакансия ', '1349372880', null, 'Алексей, приветствую.\n\nМы не знакомы лично. Ваш адрес мне дал наш общий знакомый с самыми лучшими рекомендациями вашего профессионализма.\n \nЯ руковожу фирмой “Легкий полет”, мы ищем опытного аналитика и менеджера для нашего планового отдела из 5 человек. \n\nБыло бы вам интересно обсудить возможность другой работы? \n\nС уважением,\nСтепанов Сергей ', null, 'M69', '1068', '17:48', '04.10.2012');
INSERT INTO `mail_template` VALUES ('35', null, '32', '1', 'встреча выпускников в эту пятницу ', '1349366100', null, 'Дорогие мои, \nнадо чаще встречаться, как говорится в слогане известного пива. В эту пятницу будет 5 лет со дня нашего выпуска. Вы, конечно, все очень серьезные и занятые люди, но отказать мне не имеете права. Жду всех (я имею в виду всех, и тебя Леша, и тебя Ксюша) в 19.00 в Парке Культуры возле Бурана. Я подготовла для вас сюрприз. \nТолько немного намекну... “Он капитан, и родина его Марсель...” Помните?! \nВсех целую,\nваша вечная староста, \nМарина ', null, 'M70', '955', '15:55', '04.10.2012');
INSERT INTO `mail_template` VALUES ('36', null, '13', '1', 'короткая просьба', '1349355780', null, 'Алексей, \nперешли мне. плз., описание позиции \"Аналитик\", по которому мы Лошадкина искали. Что-то не могу его у себя в компе найти, удалила что-ли...\nНадеюсь, за твой отпуск продвинемся и к твоему возвращению будет у тебя несколько кандидатов на встречу. Время сейчас хорошее.\nУдачи,\nЛюдовкина С.', null, 'M71', '783', '13:03', '04.10.2012');
INSERT INTO `mail_template` VALUES ('37', null, '15', '1', 'отчет срочно!', '1349359380', null, 'Алексей, добрый день! \n\nМы проводим комплексный анализ работы подразделения в регионе С. В том числе нас интересует складской остаток на 01 число каждого месяца за весь текущий год. \n\nОгромная просьба подготовить этот отчет в ближайшие дни. Моя командировка закончится в понедельник, а мне еще надо провести инвентаризацию на базе данных, которые будут в этом отчете.\n\nСпасибо за помощь,\nАндрей Точных\nНач.службы внутреннего аудита', null, 'M72', '843', '14:03', '04.10.2012');
INSERT INTO `mail_template` VALUES ('38', null, '20', '1', 'обучение регионального аналитика', '1349350500', null, 'Алексей, приветствую!\nЯ взял на работу регионального аналитика, как мы и договаривались. Надеюсь, что теперь у нас будут значительно быстрее проводится все операции. Вы мне обещали его натаскать и задать корпоративный стандарт работы. Он весь ваш!\nС уважением,\nКаменский В.П.\nИсполнительный директор регионального подразделения Д', null, 'M73', '695', '11:35', '04.10.2012');
INSERT INTO `mail_template` VALUES ('39', null, '23', '1', 'запрос Крутько', '1349362800', null, 'Добрый день,\n\nВаша сотрудница М.Крутько прислана нам запрос на закупку нескольких фото файлов. Говорит, что нужны для презентации. Мы так не работаем. Нам нужен запрос от руководителя отдела и вообще-то это оформляется через служебку. Вы подтверждаете, что ей нужны файлы?\n\nОтдел рекламы и оформления\nПетрашевич И.', null, 'M74', '900', '15:00', '04.10.2012');
INSERT INTO `mail_template` VALUES ('40', null, '12', '1', 'адрес клиента', '1349371020', null, 'Алексей,\nа дай-ка мне адресок какого-нибудь положительного клиента. Хочу ему пару вопросов задач, чтобы представить весь объем моих работ по проекту.\n\nСпасибо,\nТрудякин', null, 'M75', '1037', '17:17', '04.10.2012');
INSERT INTO `mail_template` VALUES ('41', null, '22', '1', 'привет', '1349353380', null, 'Алексей, привет!\nТы меня спрашивал несколько дней назад когда я смогу тебе показать работу аналитической надстройки, что прислали наши подрядчики. Могу сегодня. Тебе в 4-5 дня подойдет?\n\nМягков Юра', null, 'M76', '743', '12:23', '04.10.2012');
INSERT INTO `mail_template` VALUES ('42', null, '33', '1', 'по вашей заявке', '1349358480', null, 'Уважаемый Алексей!\n\nВы направляли в адрес нашей конференции заявку на участие в роли спикера. \n\nЗаявленная вами тема показалась оргкомитету актуальной и заслуживающей внимания.\n\nПросим вас подготовить тезисы вашего выступления и переслать их в наш адрес не позднее 30 октября.\n\nБлагодарим за ваше участие, \nОрганизационный комитет конференции \"Аналитика и бизнес\"\nИванова О.И.', null, 'M77', '828', '13:48', '04.10.2012');
INSERT INTO `mail_template` VALUES ('43', '3', '1', '2', 'Отчет для Правления', '1349281200', null, 'Раиса Романовна, добрый вечер!\n\nВо вложении файл с отчетом для Правления. Дайте знать, пожалуйста, есть ли замечания, постараюсь внести коррективы к дате встречи Правления. \n\nС уважением,\nФедоров А.', null, 'MSY10', '980', '16:20', '03.10.2012');
INSERT INTO `mail_template` VALUES ('44', null, '1', '2', 'Отчет для Правления - исправленный', '1349308800', null, 'Раиса Романовна, \n\nВо вложении скорректированный файл с отчетом для Правления.  \n\nС уважением,\nФедоров А.', null, 'MS10', '0', '', '04.10.2012');
INSERT INTO `mail_template` VALUES ('45', null, '1', '2', 'служебная записка по серверу. Срочно!', '1349308800', null, 'Служебная записка', null, 'MS20', '0', '', '04.10.2012');
INSERT INTO `mail_template` VALUES ('46', null, '1', '4', 'Сводный бюджет', '1349308800', null, 'Марина,\n\nво вложении - файл Сводного бюджета. Как мы и говорили, задача срочная. У нас есть всего три часа. Будут вопросы - обращайся!\n\nС уважением,\nА.Федоров', null, 'MS21', '0', '', '04.10.2012');
INSERT INTO `mail_template` VALUES ('47', null, '1', '3', 'Сводный бюджет', '1349308800', null, 'Сергей,\n\nво вложении - файл Сводного бюджета. Как мы и говорили, задача срочная. У нас есть всего три часа. Будут вопросы - обращайся!\n\nС уважением,\nА.Федоров', null, 'MS22', '0', '', '04.10.2012');
INSERT INTO `mail_template` VALUES ('48', null, '1', '3', 'Методика формирования сводного бюджета', '1349308800', null, 'Сергей,\n\nво вложении - Методика формирования сводного бюджета. Думаю, она поможет ответить на все твои вопросы. Если что не понятно - обращайся!\n\nС уважением,\nА.Федоров', null, 'MS23', '0', '', '04.10.2012');
INSERT INTO `mail_template` VALUES ('49', null, '1', '6', 'Презентация на выставку', '1349308800', null, 'Уважаемый Валерий Семенович,\n\nво вложении - Презентация на выставку. \n\nГотов ответить на Ваши вопросы и дать комментарии!\n\nС уважением,\nА.Федоров', null, 'MS25', '0', '', '04.10.2012');
INSERT INTO `mail_template` VALUES ('50', null, '1', '3', 'Fwd: Проблема с сервером!', '1349308800', null, 'Сергей! \nПрочти сообщение ниже и срочно подготовь служебку на получение денег для сервера на имя Денежной. \n\nС уважением,\nФедоров А.\n\n', null, 'MS27', '0', '', '04.10.2012');
INSERT INTO `mail_template` VALUES ('51', null, '1', '11', 'бюджет производства прошлого года', '1349308800', null, 'Уважаемый Василий,\n\nя нашел для вас последнюю итоговую версию бюджета производства прошлого года. Она во вложении.\n\nВсего доброго,\nФедоров А.', null, 'MS28', '0', '', '04.10.2012');
INSERT INTO `mail_template` VALUES ('52', null, '1', '3', 'задача: бюджет производства прошлого года', '1349308800', null, 'Сергей,\n\nпрошу тебя найти последнюю итоговую версию бюджета производства на 01 год и переслать ее Начальнику производственного отдела  Василию Бобру. Поставь меня в копию, пожалуйста.\n\nС уважением,\nФедоров А.', null, 'MS29', '0', '', '04.10.2012');
INSERT INTO `mail_template` VALUES ('53', null, '1', '12', 'бюджет логистики', '1349308800', null, 'Егор, приветствую!\n\nНесмотря на прошедший срок сдачи, так и не получил от вас бюджет логистики на 02 год. Надеюсь, что ты понимаешь, что отсутствие вашего бюджета задерживает весь процесс бюджетирования и формирования сводного. От меня требуется подготовить и сдать сводный бюджет в течение трех часов. Срочно жду от тебя бюджет логистики! \n\nС уважением,\nФедоров А.', null, 'MS30', '0', '', '04.10.2012');
INSERT INTO `mail_template` VALUES ('54', null, '1', '12', 're:re: бюджет от логистики', '1349308800', null, 'Егор, \n\nвсе возможные сроки реакции на мою просьбу уже прошли! Я требую немедленно предоставить бюджет логистики или мне придется информировать Генерального директора о несоблюдении регламента. \n\nС уважением,\nФедоров А.', null, 'MS32', '0', '', '04.10.2012');
INSERT INTO `mail_template` VALUES ('55', null, '1', '2', 'Сводный бюджет', '1349308800', null, 'Вот сводный бюджет. Файл прикреплен', null, 'MS35', '0', '', '04.10.2012');
INSERT INTO `mail_template` VALUES ('56', null, '1', '2', 'Сводный бюджет: итоговые корректировки', '1349308800', null, 'Вот новый сводный бюджет. Изменения следующие….Файл прикреплен', null, 'MS36', '0', '', '04.10.2012');
INSERT INTO `mail_template` VALUES ('57', null, '1', '4', 're: преза для ГД, наброски', '1349308800', null, 'Марина,\n\nя посмотрел наброски к презентации. Все в порядке, продолжай! Жду итоговый вариант к 15.30.\n\nС уважением,\nФедоров А.', null, 'MS57', '0', '', '04.10.2012');
INSERT INTO `mail_template` VALUES ('58', null, '1', '4', 're: Преза для ГД, итог', '1349308800', null, 'хорошо, продолжай, о результатах встречи расскажу', null, 'MS37', '0', '', '04.10.2012');
INSERT INTO `mail_template` VALUES ('59', null, '1', '4', 'итог встречи по презентации для ГД', '1349308800', null, 'все хорошо, Босс доволен, ты - молодец', null, 'MS38', '0', '', '04.10.2012');
INSERT INTO `mail_template` VALUES ('60', null, '1', '4', 'Презентация для ГД: распечатать', '1349308800', null, 'Распечатай столько-то к такому-то числу, в цвете. ', null, 'MS39', '0', '', '04.10.2012');
INSERT INTO `mail_template` VALUES ('61', null, '1', '3', 'Задача отдела логистики', '1349308800', null, 'Сергей,\n\nнесколько дней назад логисты просили сделать для них выгрузку. Мы обсуждали с тобой эту задачу и сроки ее исполнения. Сегодня - срок сдачи работы. Перешли мне то, что у тебя получилось в ближайшие тридцать минут, пожалуйста. \n\nС уважением,\nФедоров А.', null, 'MS58', '0', '', '04.10.2012');
INSERT INTO `mail_template` VALUES ('62', null, '1', '3', 'Fwd: форма по задаче от логистики, срочно!', '1349308800', null, 'Логисты хотят получить данные в приложенной форме. За последние 9 месяцев. Сделай срочно! Думаю, что пару часов тебе хватит. Вложен пример формы.', null, 'MS42', '0', '', '04.10.2012');
INSERT INTO `mail_template` VALUES ('63', null, '1', '12', 're: форма по задаче от логистики, срочно!', '1349308800', null, 'Егор,\n\nво вложении - форма о твоему запросу. \n\nМы сделали срочно, как ты и просил.\n\nСообщи, пожалуйста, все ли вас устраивает и не осталось ли вопросов по этому заданию.\n\nС уважением,\nФедоров А.', null, 'MS45', '0', '', '04.10.2012');
INSERT INTO `mail_template` VALUES ('64', null, '1', '3', 'Fwd: данные по рынку, срочно нужна помощь!', '1349308800', null, 'По задаче ТЕ3.2 Подготовь отчет по данным от наших клиентов - по всему рынку. В нем должно быть отражено…..  И отправь Ивану Доброхотову - я в копии.', null, 'MS46', '0', '', '04.10.2012');
INSERT INTO `mail_template` VALUES ('65', null, '1', '2', 'Динамика производственных затрат', '1349308800', null, 'По задаче ТRC6 (o доле производственных затрат). Должен написать точно тему, хорошо струткурировать письмо. Сдлеть эту работу срочно после звонка.', null, 'MS48', '0', '', '04.10.2012');
INSERT INTO `mail_template` VALUES ('66', null, '1', '9', 'Бюджетирование в дирекции продаж', '1349308800', null, 'Давайте встретимся. У меня есть информация по процессу вашего бюджета. Есть что обсудить.ИЛИ  Разговаривал с вашим нач.отдела продаж региона А. Он рассказал о вашей системе планирования. Это безобразие! Это не верный метод. Вы таким образом ставите под угрозу бюджет всей компании. Дайте мне слово, что все поменяете, иначе я буду жаловаться ФД!', null, 'MS49', '0', '', '04.10.2012');
INSERT INTO `mail_template` VALUES ('67', null, '1', '2', 'Жалоба', '1349308800', null, 'Жалоба на ОК. Эти козлы время не согласовывают, а потом меня еще пугают!', null, 'MS50', '0', '', '04.10.2012');
INSERT INTO `mail_template` VALUES ('68', null, '1', '7', 'Данные по распечатке презентаций', '1349308800', null, 'Наталья Тимофеевна,\n\nБосс просил уточнить у вас следующую информацию относительно его презентации на выставке:\n1. Сколько копий нам надо распечатать.\n2. Кому передать распечатанные копии.\n3. Когда они должны быть переданы.\n\nСпасибо за информацию,\nФедоров А.', null, 'MS51', '0', '', '04.10.2012');
INSERT INTO `mail_template` VALUES ('69', null, '1', '3', 'Отчет по 3 кварталу', '1349308800', null, 'Стандартная работа по подготовке отчета по 3 кв. Начинай с продаж. К моему возвращению отчет должен быть у меня на проверку.', null, 'MS54', '0', '', '04.10.2012');
INSERT INTO `mail_template` VALUES ('70', null, '1', '39', 'Приглашение: новая система премирования', '1349308800', null, 'Коллеги,\n\nзавтра, в 12.00, приглашаю вас в мой кабинет для презентации новой системы премирования на 4 квартал.\n\nС уважением,\nФедоров А.', null, 'MS55', '0', '', '04.10.2012');
INSERT INTO `mail_template` VALUES ('71', null, '1', '9', 're:срочно! Отчетность', '1349308800', null, 'ответить всем и предложить встретиться для обсуждения этого вопроса, в неправильной версии - разъяснения, что аналитика понимает важность продаж, что отчетность сейчас собирается долго т.к. Не автоматизирован процесс сбора данных с клиентов, а мы этим сейчас занимаемся...', null, 'MS40', '0', '', '04.10.2012');
INSERT INTO `mail_template` VALUES ('72', null, '1', '9', 're:срочно! Требования клиентов', '1349308800', null, 'предложить директору по продажам выяснить у других клиентов - так ли это у всех, если да, то выносить на общее обсуждение с участием наших ИТ-ков', null, 'MS52', '0', '', '04.10.2012');
INSERT INTO `mail_template` VALUES ('73', null, '1', '2', 'план на завтра', '1349308800', null, 'Раиса Романовна\n\nПрикрепляю мой план на завтра. Завтра я должен уйти в 16.00, как я уже говорил вам ранее.\n\nС уважением,\nФедоров А.', null, 'MS53', '0', '', '04.10.2012');
INSERT INTO `mail_template` VALUES ('74', null, '1', '39', 'Fwd: вакцинация! ', '1349308800', null, 'Коллеги, вам нужно пройти вакцинацию в понедельник. Запланируйте в своих календарях, пожалуйста.\n\nС уваженим,\nФедоров А.\n', null, 'MS65', '0', '', '04.10.2012');
INSERT INTO `mail_template` VALUES ('75', null, '1', '15', 're: отчет срочно!', '1349308800', null, 'Аркадий, приветствую!\n\nОтчет сделаем. Данные будут у тебя завтра во второй половине дня.\n\nУдачи,\nФедоров А.', null, 'MS66', '0', '', '04.10.2012');
INSERT INTO `mail_template` VALUES ('76', null, '1', '3', 'Fwd: отчет срочно!', '1349308800', null, 'Сергей, \n\nвключи это задание в свой план работ, пожалуйста. Тебе необходимо выгрузить складской остаток в регионе С на 01 число каждого месяца с января по октябрь этого года. \n\nПрошу выполнить задание до двух дня, чтобы я мог его посмотреть перед отправкой. \n\nСпасибо,\nФедоров А.', null, 'MS67', '0', '', '04.10.2012');
INSERT INTO `mail_template` VALUES ('77', null, '1', '20', 're: обучение регионального аналитика', '1349308800', null, 'Добрый день, Виктор Петрович!\n\nОчень рад, что вы нашли аналитика!\n\nНепременно помогу вам с его обучением и адаптацией. Завтра с четрех я в отпуске, а потому, запланирую разговор с ним на первые дни недели после отпуска. ', null, 'MS62', '0', '', '04.10.2012');
INSERT INTO `mail_template` VALUES ('78', null, '1', '13', 're: короткая просьба', '1349308800', null, 'Хорошо, лови.', null, 'MS63', '0', '', '04.10.2012');
INSERT INTO `mail_template` VALUES ('79', null, '1', '23', 're: запрос Крутько', '1349308800', null, 'Да, сделайте. Подтверждаю.', null, 'MS64', '0', '', '04.10.2012');
INSERT INTO `mail_template` VALUES ('80', null, '1', '12', 're: адрес клиента', '1349308800', null, 'Адрес ниже.', null, 'MS60', '0', '', '04.10.2012');
INSERT INTO `mail_template` VALUES ('81', null, '1', '22', 're: привет', '1349308800', null, 'Привет, Юра! Сегодня и завтра, к сожалению, не могу. Давай запланируем после отпуска.', null, 'MS61', '0', '', '04.10.2012');
INSERT INTO `mail_template` VALUES ('82', null, '1', '4', 'встреча с ГД по презентации', '1349308800', null, 'Марина,\n\nБосс сегодня встречаться не смог, а завтра он на выезде. Потому прошу тебя встретиться с ним в понедельник в 10.00 для пояснений по презентации. Презентацию ему я уже отправил.\n\nНе волнуйся, я уверен, что ты справишься.\n\nСпасибо,\nФедоров А.', null, 'MS68', '0', '', '04.10.2012');
INSERT INTO `mail_template` VALUES ('83', null, '1', '12', 'квартальный план', '1349308800', null, 'Егор, во вложении моя версия квартального плана.\n\nС уважениям,\nФедоров А.', null, 'MS69', '0', '', '04.10.2012');
INSERT INTO `mail_template` VALUES ('84', null, '1', '3', 'ошибка в отчете для правления', '1349308800', null, 'Сергей,\n\nты сделал ошибку в отчете для Правления, а я ее проустил. Опять получил сегодня выговор от Денежной. Исправь немедленно и пришли мне новую версию отчета.\n\nФедоров А.', null, 'MS70', '0', '', '04.10.2012');
